(10258, 1, 1, '<p><strong>ROZMIAR</strong></p><p>S, M, (L), XL, 2XL, 3XL, 4XL, 5XL</p><p>\n<strong>WYMIARY</strong></p><p>Szerokość: 48, 48, (61), 74, 87, 100, 113, 126 cm</p><p>Długość: 48 cm (można dostosować)</p><p>Długość rękawa: 39 cm (można dostosować)</p><p>\n<strong>INFORMACJE O WZORZE</strong></p><p>Ten sweter to prosty i zabawny projekt, świetny zarówno dla początkujących, jak i doświadczonych szydełkujących. Składa się z czterech podstawowych elementów: dwóch prostokątów na przód i tył oraz dwóch na rękawy. Sweter wykonuje się od dołu do góry różnymi ściegami, tworząc luźne paski łatwe do przerabiania.</p><p>\n</p><p>Dzięki zastosowaniu szydełka 4 mm, robótki szybko przybywa i jest przyjemna w dotyku. Wzór zawiera pomocny przewodnik ze zdjęciami, więc nawet jeśli jesteś nowicjuszem w szydełkowaniu, będziesz w stanie z łatwością go śledzić. Niezależnie od tego, czy szukasz przyjemnego projektu na wieczór, czy też wygodnego, ręcznie wykonanego dodatku do swojej garderoby, ten sweter jest idealną opcją.</p>', '', 'holiday-glow-sweter', '', '', '', 'Holiday Glow - Sweter', '', '', '', ''),
(10258, 1, 2, '<p><strong>ROZMIAR</strong></p><p>S, M, (L), XL, 2XL, 3XL, 4XL, 5XL</p><p>\n<strong>WYMIARY</strong></p><p>Szerokość: 48, 48, (61), 74, 87, 100, 113, 126 cm</p><p>Długość: 48 cm (można dostosować)</p><p>Długość rękawa: 39 cm (można dostosować)</p><p>\n<strong>INFORMACJE O WZORZE</strong></p><p>Ten sweter to prosty i zabawny projekt, świetny zarówno dla początkujących, jak i doświadczonych szydełkujących. Składa się z czterech podstawowych elementów: dwóch prostokątów na przód i tył oraz dwóch na rękawy. Sweter wykonuje się od dołu do góry różnymi ściegami, tworząc luźne paski łatwe do przerabiania.</p><p>\n</p><p>Dzięki zastosowaniu szydełka 4 mm, robótki szybko przybywa i jest przyjemna w dotyku. Wzór zawiera pomocny przewodnik ze zdjęciami, więc nawet jeśli jesteś nowicjuszem w szydełkowaniu, będziesz w stanie z łatwością go śledzić. Niezależnie od tego, czy szukasz przyjemnego projektu na wieczór, czy też wygodnego, ręcznie wykonanego dodatku do swojej garderoby, ten sweter jest idealną opcją.</p>', '', 'holiday-glow-sweter', '', '', '', 'Holiday Glow - Sweter', '', '', '', ''),
(10259, 1, 1, '<p><strong>ROZMIAR</strong></p><p>S (M)</p><p>\n<strong>WYMIARY</strong></p><p>Szerokość: 15 (15) cm</p><p>Wysokość: 19 (23) cm</p><p>\n</p><p><strong>INFORMACJE O WZORZE</strong></p><p>Wzór obejmuje dwa koszyki z kwiatkami: mały i średni. Do wykonania każdego z koszyków potrzeba mniej niż jednego motka włóczki Rafaella i szydełka 6 mm. Kwiatki wykonuje się oddzielnie z włóczki Friends Cotton 8/4 i szydełkiem 3,00 mm. Dostępne są trzy wzory kwiatków. Kwiaty są mocowane do koszyka za pomocą szydełka. We wzorze znajduje się tutorial fotograficzny wyjaśniający cały proces.</p>', '', 'wildflowers-koszyk', '', '', '', 'Wildflowers - Koszyk', '', '', '', ''),
(10259, 1, 2, '<p><strong>ROZMIAR</strong></p><p>S (M)</p><p>\n<strong>WYMIARY</strong></p><p>Szerokość: 15 (15) cm</p><p>Wysokość: 19 (23) cm</p><p>\n</p><p><strong>INFORMACJE O WZORZE</strong></p><p>Wzór obejmuje dwa koszyki z kwiatkami: mały i średni. Do wykonania każdego z koszyków potrzeba mniej niż jednego motka włóczki Rafaella i szydełka 6 mm. Kwiatki wykonuje się oddzielnie z włóczki Friends Cotton 8/4 i szydełkiem 3,00 mm. Dostępne są trzy wzory kwiatków. Kwiaty są mocowane do koszyka za pomocą szydełka. We wzorze znajduje się tutorial fotograficzny wyjaśniający cały proces.</p>', '', 'wildflowers-koszyk', '', '', '', 'Wildflowers - Koszyk', '', '', '', ''),
(10260, 1, 1, '<p><strong>WYMIARY</strong></p><p>Szerokość (korpus): około 23 cm</p><p>\n<strong>OBJAŚNIENIE DO WZORU</strong></p><p>Wzór wykonany jest w ciągłych okrążeniach. Nie łącz okrążeń, chyba, że wyraźnie zaznaczono inaczej. Zmiana koloru jest wyraźnie zaznaczona we wzorze, przed oczkiem, które ma być przerabianie nowym kolorem. Kontynuuj przerabianie podanym kolorem aż do następnej zmiany koloru. Oczy są szydełkowane. Po zszyciu każdej części zakończ i wszyj końce, chyba, że wyraźnie zaznaczono inaczej.</p>', '', 'peppermint', '', '', '', 'Peppermint', '', '', '', ''),
