(10267, 1, 1, '<p><strong>ROZMIAR</strong></p><p>6 miesięcy (1) 2-3 (3-4) 5-6 lat</p><p>\n<strong>WYMIARY</strong></p><p>Szerokość: 26 (28) 30 (34) 38 cm</p><p>\n</p><p><strong>OBJAŚNIENIE DO WZORU</strong></p><p>Love Moon to miękki i delikatny kardigan, który zachęca do zajęcia małych rączek. Zrób na drutach 2 urocze figurki, które mogą być włożone do kieszeni lub swobodnie zwisać. Możesz łatwo stworzyć własną ekspresję w modelu, eksperymentując kolorami. Kardigan Love Moon jest przerabiany od dołu do góry z raglanowymi rękawami, dwoma nitkami włóczki trzymanymi razem.</p>', '', 'love-moon-kardigan-dzieciecy', '', '', '', 'Love Moon - Kardigan Dziecięcy', '', '', '', ''),
(10267, 1, 2, '<p><strong>ROZMIAR</strong></p><p>6 miesięcy (1) 2-3 (3-4) 5-6 lat</p><p>\n<strong>WYMIARY</strong></p><p>Szerokość: 26 (28) 30 (34) 38 cm</p><p>\n</p><p><strong>OBJAŚNIENIE DO WZORU</strong></p><p>Love Moon to miękki i delikatny kardigan, który zachęca do zajęcia małych rączek. Zrób na drutach 2 urocze figurki, które mogą być włożone do kieszeni lub swobodnie zwisać. Możesz łatwo stworzyć własną ekspresję w modelu, eksperymentując kolorami. Kardigan Love Moon jest przerabiany od dołu do góry z raglanowymi rękawami, dwoma nitkami włóczki trzymanymi razem.</p>', '', 'love-moon-kardigan-dzieciecy', '', '', '', 'Love Moon - Kardigan Dziecięcy', '', '', '', ''),
(10268, 1, 1, '<p><strong>ROZMIAR</strong></p><p>1 (2) 3-4 (5-6) 7-8 lat</p><p>\n<strong>WYMIARY</strong></p><p>Szerokość: 32 (36) 40 (44) 50 cm</p><p>\n</p><p><strong>OBJAŚNIENIE DO WZORU</strong></p><p>Sunshine to oversize\'owy T-shirt lekko opadający na ramiona. Motyw jest haftowany ściegiem dzianinowym, a pachy oraz dekolt wykończone brzegiem I-cord. Sunshine jest przerabiany od góry do dołu. Najpierw w tę i z powrotem nad oczkami tyłu. Następnie nabiera się oczka na ramiona, które są przerabiane w tę i z powrotem osobno, zanim robótka zostanie połączona na drucie i przerabiana na okrągło.</p>', '', 'sunshine-dzieciecy-t-shirt', '', '', '', 'Sunshine - Dziecięcy-t-shirt', '', '', '', ''),
(10268, 1, 2, '<p><strong>ROZMIAR</strong></p><p>1 (2) 3-4 (5-6) 7-8 lat</p><p>\n<strong>WYMIARY</strong></p><p>Szerokość: 32 (36) 40 (44) 50 cm</p><p>\n</p><p><strong>OBJAŚNIENIE DO WZORU</strong></p><p>Sunshine to oversize\'owy T-shirt lekko opadający na ramiona. Motyw jest haftowany ściegiem dzianinowym, a pachy oraz dekolt wykończone brzegiem I-cord. Sunshine jest przerabiany od góry do dołu. Najpierw w tę i z powrotem nad oczkami tyłu. Następnie nabiera się oczka na ramiona, które są przerabiane w tę i z powrotem osobno, zanim robótka zostanie połączona na drucie i przerabiana na okrągło.</p>', '', 'sunshine-dzieciecy-t-shirt', '', '', '', 'Sunshine - Dziecięcy-t-shirt', '', '', '', ''),
(10269, 1, 1, '<p><strong>WYMIARY</strong></p><p>Szerokość: 25 cm</p><p>Długość: 38 cm</p><p>\n<strong>INFORMACJE O WZORZE</strong></p><p>Wzór Albers to zabawny szydełkowy projekt, za pomocą którego można wykonać fajny wiszący koszyk. Koszyk ten jest idealny do przechowywania włóczki, materiałów lub czegokolwiek innego, co wymaga uporządkowania. Do jego wykonania użyjesz włóczki tasiemki i szydełka 6 mm.</p><p>\n</p><p>Do wykonania tego projektu potrzebne będą dwa motki włóczki w dwóch różnych kolorach. Podczas szydełkowania będziesz zmieniać te kolory, aby stworzyć unikalny wzór, który będzie wyglądał niesamowicie po obu stronach koszyka. Nie martw się, we wzorze znajduje się pomocny przewodnik ze zdjęciami i łatwe do wykonania instrukcje, które poprowadzą Cię na każdym kroku.</p>', '', 'albers-wiszacy-koszyk', '', '', '', 'Albers - Wiszący koszyk', '', '', '', ''),
(10269, 1, 2, '<p><strong>WYMIARY</strong></p><p>Szerokość: 25 cm</p><p>Długość: 38 cm</p><p>\n<strong>INFORMACJE O WZORZE</strong></p><p>Wzór Albers to zabawny szydełkowy projekt, za pomocą którego można wykonać fajny wiszący koszyk. Koszyk ten jest idealny do przechowywania włóczki, materiałów lub czegokolwiek innego, co wymaga uporządkowania. Do jego wykonania użyjesz włóczki tasiemki i szydełka 6 mm.</p><p>\n</p><p>Do wykonania tego projektu potrzebne będą dwa motki włóczki w dwóch różnych kolorach. Podczas szydełkowania będziesz zmieniać te kolory, aby stworzyć unikalny wzór, który będzie wyglądał niesamowicie po obu stronach koszyka. Nie martw się, we wzorze znajduje się pomocny przewodnik ze zdjęciami i łatwe do wykonania instrukcje, które poprowadzą Cię na każdym kroku.</p>', '', 'albers-wiszacy-koszyk', '', '', '', 'Albers - Wiszący koszyk', '', '', '', ''),
(10270, 1, 1, '<p><strong>WYMIARY</strong></p><p>Szerokość: 84 cm</p><p>Długość: 91,5 cm</p><p>\n<strong>INFORMACJE O WZORZE</strong></p><p>Każde dziecko lub maluch pokochają ten miękki, aksamitny kocyk pełen ciepła i przyjemnej w dotyku tekstury. Wybierz dwa zabawne kolory, które będą pasować do ich osobowości. Będzie to jeden z tych kocyków, które zapamiętają na długie lata.</p><p>Kocyk jest przerabiany na płasko w jednym kawałku, z supełkami przerabianymi na lewej stronie robótki. Brzeg jest przerabiany na okrągło i wykończony ściągaczem z oczek reliefowych przednich i tylnych.</p>', '', 'baby-bobble-blanket-kocyk', '', '', '', 'Baby Bobble Blanket - Kocyk', '', '', '', ''),
(10270, 1, 2, '<p><strong>WYMIARY</strong></p><p>Szerokość: 84 cm</p><p>Długość: 91,5 cm</p><p>\n<strong>INFORMACJE O WZORZE</strong></p><p>Każde dziecko lub maluch pokochają ten miękki, aksamitny kocyk pełen ciepła i przyjemnej w dotyku tekstury. Wybierz dwa zabawne kolory, które będą pasować do ich osobowości. Będzie to jeden z tych kocyków, które zapamiętają na długie lata.</p><p>Kocyk jest przerabiany na płasko w jednym kawałku, z supełkami przerabianymi na lewej stronie robótki. Brzeg jest przerabiany na okrągło i wykończony ściągaczem z oczek reliefowych przednich i tylnych.</p>', '', 'baby-bobble-blanket-kocyk', '', '', '', 'Baby Bobble Blanket - Kocyk', '', '', '', ''),
(10271, 1, 1, '<p><strong>ROZMIAR</strong></p><p>1 (2) 3 (4) 5 (6) 7 (8) 9</p><p>\n<strong>WYMIARY</strong></p><p>Szerokość: 48 (52,8) 57,6 (62,4) 67,2 (72) 76,8 (81,6) 86,4 cm</p><p>Długość: 50 (50) 50 (52) 52 (54) 54 (56) 58 (60) cm</p><p>\n</p><p><strong>INFORMACJE O WZORZE</strong></p><p>Sweter Azulejo inspirowany jest tradycyjnymi kafelkami z Portugalii i części Hiszpanii. Jest to sweter typu top-down z opadającymi ramionami i żakardowym motywem fair isle na całej powierzchni. Ramiona uformowane są za pomocą krótkich rzędów, a korpus i rękawy wykończone są fałszywym ściągaczem i zakończone włoską metodą zamykania oczek. Motyw fair isle jest przedstawiony na schemacie.</p><p>\nSweter ma ok. 10-15 cm dodatniego luzu.\n</p>', '', 'azulejo-sweter', '', '', '', 'Azulejo - Sweter', '', '', '', ''),
(10271, 1, 2, '<p><strong>ROZMIAR</strong></p><p>1 (2) 3 (4) 5 (6) 7 (8) 9</p><p>\n<strong>WYMIARY</strong></p><p>Szerokość: 48 (52,8) 57,6 (62,4) 67,2 (72) 76,8 (81,6) 86,4 cm</p><p>Długość: 50 (50) 50 (52) 52 (54) 54 (56) 58 (60) cm</p><p>\n</p><p><strong>INFORMACJE O WZORZE</strong></p><p>Sweter Azulejo inspirowany jest tradycyjnymi kafelkami z Portugalii i części Hiszpanii. Jest to sweter typu top-down z opadającymi ramionami i żakardowym motywem fair isle na całej powierzchni. Ramiona uformowane są za pomocą krótkich rzędów, a korpus i rękawy wykończone są fałszywym ściągaczem i zakończone włoską metodą zamykania oczek. Motyw fair isle jest przedstawiony na schemacie.</p><p>\nSweter ma ok. 10-15 cm dodatniego luzu.\n</p>', '', 'azulejo-sweter', '', '', '', 'Azulejo - Sweter', '', '', '', ''),
(10272, 1, 1, '<p>Måneskin to uroczy i prosty śliniak z odrobiną stylu retro.</p><p>Można go wykonać w takim kolorze, który najlepiej pasuje do innych ubranek dziecka, a jego zapięcie na słodki guziczek można regulować.</p><p>Zrobiono go szydełkiem z naszej Baby Cotton, niewiarygodnie miękkiej i świetnej bawełny z certyfikatem GOTS.</p><p>Dobrej zabawy!</p><p>\n</p><p>Na zdjęciach pokazane są następujące kolory/jakości:</p><p>Baby Cotton Organic - Pastel Purple (13)\n</p>', '', 'maneskin-sliniak', '', '', '', 'Måneskin - śliniak', '', '', '', ''),
(10272, 1, 2, '<p>Måneskin to uroczy i prosty śliniak z odrobiną stylu retro.</p><p>Można go wykonać w takim kolorze, który najlepiej pasuje do innych ubranek dziecka, a jego zapięcie na słodki guziczek można regulować.</p><p>Zrobiono go szydełkiem z naszej Baby Cotton, niewiarygodnie miękkiej i świetnej bawełny z certyfikatem GOTS.</p><p>Dobrej zabawy!</p><p>\n</p><p>Na zdjęciach pokazane są następujące kolory/jakości:</p><p>Baby Cotton Organic - Pastel Purple (13)\n</p>', '', 'maneskin-sliniak', '', '', '', 'Måneskin - śliniak', '', '', '', ''),
(10273, 1, 1, '<p>Ten fason będący połączeniem poncha i swetra jest absolutnie idealny dla początkujących. Jest naprawdę łatwe do wykonania na szydełku i nie musisz się martwić odejmowaniem i dodawaniem oczek. W rzeczywistości składa się tylko i wyłącznie z kwadratów. Nie potrzebujesz nic więcej, aby wykonać piękne, lekkie i nowoczesne swoncho.\n</p>', '', 'butterfly-swoncho', '', '', '', 'Butterfly Swoncho', '', '', '', ''),
(10273, 1, 2, '<p>Ten fason będący połączeniem poncha i swetra jest absolutnie idealny dla początkujących. Jest naprawdę łatwe do wykonania na szydełku i nie musisz się martwić odejmowaniem i dodawaniem oczek. W rzeczywistości składa się tylko i wyłącznie z kwadratów. Nie potrzebujesz nic więcej, aby wykonać piękne, lekkie i nowoczesne swoncho.\n</p>', '', 'butterfly-swoncho', '', '', '', 'Butterfly Swoncho', '', '', '', ''),
(10274, 1, 1, '<p>Wspaniała mała Ballerina jest gotowa na spotkanie z najmłodszymi!</p><p>Ballerina posiada środek do wańki-wstańki, dzięki któremu będzie się podnosiła raz za razem po przewróceniu.</p><p>Ku wielkiej radości małych szkrabów.</p><p>Środek wyposażono w mały dzwonek, który oddaje cichy odgłos przy przewracaniu.</p><p>Ballerina jest wykonana na szydełku z Rainbow Cotton 8/4, która jest dostępna w wielu pięknych kolorach!</p><p>Przyjemnej zabawy!</p>', '', 'ballerina-wanka-wstanka', '', '', '', 'Ballerina - wańka-wstańka', '', '', '', ''),
(10274, 1, 2, '<p>Wspaniała mała Ballerina jest gotowa na spotkanie z najmłodszymi!</p><p>Ballerina posiada środek do wańki-wstańki, dzięki któremu będzie się podnosiła raz za razem po przewróceniu.</p><p>Ku wielkiej radości małych szkrabów.</p><p>Środek wyposażono w mały dzwonek, który oddaje cichy odgłos przy przewracaniu.</p><p>Ballerina jest wykonana na szydełku z Rainbow Cotton 8/4, która jest dostępna w wielu pięknych kolorach!</p><p>Przyjemnej zabawy!</p>', '', 'ballerina-wanka-wstanka', '', '', '', 'Ballerina - wańka-wstańka', '', '', '', ''),
(10275, 1, 1, '<p>Myszka Fie wygląda tak uroczo w swojej małej, eleganckiej sukience. Kocha stroić się w różową kokardę i jest gotowa, żeby sprawić dziecku radość i przytulić je wiele razy :) Myszkę szydełkuje się z Rainbow Cotton 8/6 i wtedy ma ok. 35 cm wysokości.</p><p>\n</p><p>Dobrej zabawy!</p><p>\n</p>', '', 'myszka-fie', '', '', '', 'Myszka Fie', '', '', '', ''),
(10275, 1, 2, '<p>Myszka Fie wygląda tak uroczo w swojej małej, eleganckiej sukience. Kocha stroić się w różową kokardę i jest gotowa, żeby sprawić dziecku radość i przytulić je wiele razy :) Myszkę szydełkuje się z Rainbow Cotton 8/6 i wtedy ma ok. 35 cm wysokości.</p><p>\n</p><p>Dobrej zabawy!</p><p>\n</p>', '', 'myszka-fie', '', '', '', 'Myszka Fie', '', '', '', ''),
(10276, 1, 1, '<p>Rusty Gold to marzenie każdego szydełkującego! Wykonuje się go od góry dwiema nićmi. Nie jest dopasowany, jeśli chodzi o szerokość w klatce piersiowej, to jest ona o 15 cm większa niż standardowa. Więc jeśli szalejesz na punkcie obszernych dzianin z moheru, to jest to projekt stworzony dla Ciebie!</p><p>\n</p><p>Projekt: Catalina Ungureanu</p><p>\n\n</p>', '', 'rusty-gold-sweter', '', '', '', 'Rusty Gold Sweter', '', '', '', ''),
(10276, 1, 2, '<p>Rusty Gold to marzenie każdego szydełkującego! Wykonuje się go od góry dwiema nićmi. Nie jest dopasowany, jeśli chodzi o szerokość w klatce piersiowej, to jest ona o 15 cm większa niż standardowa. Więc jeśli szalejesz na punkcie obszernych dzianin z moheru, to jest to projekt stworzony dla Ciebie!</p><p>\n</p><p>Projekt: Catalina Ungureanu</p><p>\n\n</p>', '', 'rusty-gold-sweter', '', '', '', 'Rusty Gold Sweter', '', '', '', ''),
(10277, 1, 1, '<p>Ładny i przewiewny kardigan z naszej świetnej Diablo Multi.</p><p>Włóczka sprawia, że jest taki świetny i ciepły, jednocześnie też lekki i przewiewny podczas noszenia.</p><p>Sweterek cechuje się prostotą, ale ma też mnóstwo subtelnych detali, takich jak m.in. i-cordowy brzeg i dekolt w serek.</p><p>Miłej pracy!</p><p>\n\n</p>', '', 'dagny-kardigan', '', '', '', 'Dagny - Kardigan', '', '', '', ''),
(10277, 1, 2, '<p>Ładny i przewiewny kardigan z naszej świetnej Diablo Multi.</p><p>Włóczka sprawia, że jest taki świetny i ciepły, jednocześnie też lekki i przewiewny podczas noszenia.</p><p>Sweterek cechuje się prostotą, ale ma też mnóstwo subtelnych detali, takich jak m.in. i-cordowy brzeg i dekolt w serek.</p><p>Miłej pracy!</p><p>\n\n</p>', '', 'dagny-kardigan', '', '', '', 'Dagny - Kardigan', '', '', '', ''),
(10278, 1, 1, '<p>Czy Twój mąż potrzebuje nieco rozpieszczenia?</p><p>Zrób mu na drutach świetny zestaw ściegiem ryżowym: krawat i poszetkę.</p><p>Komplet Emil dzierga się z włóczki Rainbow - w kolorach pasujących do reszty odświętnego stroju.</p><p>Miłego dziergania!</p><p>\n\n</p>', '', 'emil-komplet', '', '', '', 'Emil Komplet', '', '', '', ''),
(10278, 1, 2, '<p>Czy Twój mąż potrzebuje nieco rozpieszczenia?</p><p>Zrób mu na drutach świetny zestaw ściegiem ryżowym: krawat i poszetkę.</p><p>Komplet Emil dzierga się z włóczki Rainbow - w kolorach pasujących do reszty odświętnego stroju.</p><p>Miłego dziergania!</p><p>\n\n</p>', '', 'emil-komplet', '', '', '', 'Emil Komplet', '', '', '', ''),
