(10289, 1, 1, '<p><strong>ROZMIAR</strong></p><p>1 (2)</p><p>\n<strong>WYMIARY</strong></p><p>Wymiary gotowego projektu – obwód stopy: 16,5 (20) cm – ujemny luz (negative ease) 1,5-2,5 cm</p><p>Długość stopy jest regulowana.</p><p>\n</p><p><strong>OBJAŚNIENIE DO WZORU</strong></p><p>Skarpety Oak Seed są przerabiane od mankietu do dołu w jednym kawałku. Zaczynając od wykonania brzegu pikotką, a następnie ściegu ściągaczowego z przekręconych oczek. Po ściągaczu wykonana ozdobna koronka, a pozostała część skarpet przerabiana fantazyjnym wzorem, aby uzyskać ładną teksturę. Pięta robiona klasyczną metodą z klapką i klinem.</p>', '', 'oak-seed-teksturowe-skarpetki', '', '', '', 'Oak Seed - Teksturowe Skarpetki', '', '', '', ''),
