tałtach</p></li><li><p>1 zestaw magnesów</p></li><li><p>1 długopis do robienia notatek na wydrukowanym wzorze</p></li></ul><p>Długość szydełek (bez żyłki): 15 cm</p>', '', 'ginger-zestaw-wymiennych-afganskich-tunezyjskich-szydelek', '', '', '', 'Ginger – Zestaw Wymiennych Afgańskich/Tunezyjskich Szydełek', '', '', '', ''),
(10333, 1, 1, '<p>To tunezyjskie szydełko od KnitPro wykonane jest z najlepszej jakości bambusa pochodzącego z Japonii. Praca z tym przyrządem to czysta przyjemność!\n</p><p>Przejścia między szydełkiem a żyłką zaprojektowano tak, aby łatwo było je zamontować oraz aby oczka bez problemu przez nie przechodziły. Co więcej, są one pozłacane, co nadaje im ekskluzywny wygląd.</p><p>Bambus znany jest ze swej wytrzymałości i lekkości, która daje duży komfort pracy. Z tym szydełkiem możesz pracować długimi godzinami bez uczucia bólu w dłoniach i palcach.</p><p>Szydełko to dostępne jest w rozmiarach 3-8 mm.</p><p>Szydełka sprzedawane są pojedynczo.\n</p><p><em>Uwaga! Nie zawiera żyłki, ale jeśli skorzystasz z powyższego linku, znajdziesz żyłki, które są kompatybilne ze wszystkimi wymiennymi drutami i szydełkami firmy Knitpro.</em>\n</p>', '', 'wymienne-szydelko-tunezyjskie-bamboo', '', '', '', 'Wymienne szydełko tunezyjskie Bamboo', '', '', '', ''),
(10333, 1, 2, '<p>To tunezyjskie szydełko od KnitPro wykonane jest z najlepszej jakości bambusa pochodzącego z Japonii. Praca z tym przyrządem to czysta przyjemność!\n</p><p>Przejścia między szydełkiem a żyłką zaprojektowano tak, aby łatwo było je zamontować oraz aby oczka bez problemu przez nie przechodziły. Co więcej, są one pozłacane, co nadaje im ekskluzywny wygląd.</p><p>Bambus znany jest ze swej wytrzymałości i lekkości, która daje duży komfort pracy. Z tym szydełkiem możesz pracować długimi godzinami bez uczucia bólu w dłoniach i palcach.</p><p>Szydełko to dostępne jest w rozmiarach 3-8 mm.</p><p>Szydełka sprzedawane są pojedynczo.\n</p><p><em>Uwaga! Nie zawiera żyłki, ale jeśli skorzystasz z powyższego linku, znajdziesz żyłki, które są kompatybilne ze wszystkimi wymiennymi drutami i szydełkami firmy Knitpro.</em>\n</p>', '', 'wymienne-szydelko-tunezyjskie-bamboo', '', '', '', 'Wymienne szydełko tunezyjskie Bamboo', '', '', '', ''),
(10334, 1, 1, '<p>Ten oto zestaw ergonomicznych szydełek marki Prym stanowi idealny i stylowy prezent dla siebie samego albo dla kogoś, komu chciałbyś sprawić przyjemność. Nie tylko ładnie wygląda, ale jest też ucieleśnieniem marzeń każdego dziergającego. Składa się z 5 funkcjonalnych szydełek do wełny w różnych rozmiarach i kolorach, co ułatwia ich odróżnienie. Najważniejszy ich element stanowi ergonomicznie wykonany uchwyt, który zapewnia maksymalny komfort podczas dziergania. Zrobiono go z antypoślizgowego materiału wysokiej jakości, lekkiego i tym samym dobrego dla nadgarstków. Cała powierzchnia szydełka jest gładka, oczka ślizgają się bezproblemowo i po haczyku i po uchwycie.</p><p>Podsumowując, ten kolorowy zestaw okaże się być hitem u każdego amatora szydełkowania.</p><p>W powyższym linku znajdziesz odpowiedni zestaw ergonomicznych szydełek do wełny firmy Prym w rozmiarach 3,5 - 6,0 mm.</p>', '', 'zestaw-ergonomicznych-szydelek-do-welny', '', '', '', 'Zestaw ergonomicznych szydełek do wełny', '', '', '', ''),
(10334, 1, 2, '<p>Ten oto zestaw ergonomicznych szydełek marki Prym stanowi idealny i stylowy prezent dla siebie samego albo dla kogoś, komu chciałbyś sprawić przyjemność. Nie tylko ładnie wygląda, ale jest też ucieleśnieniem marzeń każdego dziergającego. Składa się z 5 funkcjonalnych szydełek do wełny w różnych rozmiarach i kolorach, co ułatwia ich odróżnienie. Najważniejszy ich element stanowi ergonomicznie wykonany uchwyt, który zapewnia maksymalny komfort podczas dziergania. Zrobiono go z antypoślizgowego materiału wysokiej jakości, lekkiego i tym samym dobrego dla nadgarstków. Cała powierzchnia szydełka jest gładka, oczka ślizgają się bezproblemowo i po haczyku i po uchwycie.</p><p>Podsumowując, ten kolorowy zestaw okaże się być hitem u każdego amatora szydełkowania.</p><p>W powyższym linku znajdziesz odpowiedni zestaw ergonomicznych szydełek do wełny firmy Prym w rozmiarach 3,5 - 6,0 mm.</p>', '', 'zestaw-ergonomicznych-szydelek-do-welny', '', '', '', 'Zestaw ergonomicznych szydełek do wełny', '', '', '', ''),
(10335, 1, 1, '<p>To fantastyczne szydełko od KnitPro wykonane jest z bambusa pochodzącego z Japonii i daje prawdziwą przyjemność w pracy z nim.\n</p><p>Bambus znany jest ze swojej wytrzymałości i lekkości materiału, dzięki której komfortowo się szydełkuje nawet przez wiele godzin.</p><p>\n</p>', '', 'szydelko-bamboo', '', '', '', 'Szydełko Bamboo', '', '', '', ''),
(10335, 1, 2, '<p>To fantastyczne szydełko od KnitPro wykonane jest z bambusa pochodzącego z Japonii i daje prawdziwą przyjemność w pracy z nim.\n</p><p>Bambus znany jest ze swojej wytrzymałości i lekkości materiału, dzięki której komfortowo się szydełkuje nawet przez wiele godzin.</p><p>\n</p>', '', 'szydelko-bamboo', '', '', '', 'Szydełko Bamboo', '', '', '', ''),
(10336, 1, 1, '<p>Przedstawiamy nasz zestaw 14 szydełek w kolorze różowego złota. Znajdziesz w nim następujące rozmiary: 2, 2,5, 3, 3,5, 4, 4,5, 5, 5,5, 6, 7, 8, 9, 10 i 12 mm.</p><p>Ten zestaw szydełek nie zawiera niklu, wykonany jest z anodowanego aluminium, a uchwyty z tworzywa ABS.\n</p><p>Szydełka są zapakowane w praktyczne i estetyczne etui zamykane na zamek błyskawiczny.</p><p>Życzymy przyjemności w pracy z zestawem!</p>', '', 'zestaw-14-szydelek', '', '', '', 'Zestaw 14 Szydełek', '', '', '', ''),
(10336, 1, 2, '<p>Przedstawiamy nasz zestaw 14 szydełek w kolorze różowego złota. Znajdziesz w nim następujące rozmiary: 2, 2,5, 3, 3,5, 4, 4,5, 5, 5,5, 6, 7, 8, 9, 10 i 12 mm.</p><p>Ten zestaw szydełek nie zawiera niklu, wykonany jest z anodowanego aluminium, a uchwyty z tworzywa ABS.\n</p><p>Szydełka są zapakowane w praktyczne i estetyczne etui zamykane na zamek błyskawiczny.</p><p>Życzymy przyjemności w pracy z zestawem!</p>', '', 'zestaw-14-szydelek', '', '', '', 'Zestaw 14 Szydełek', '', '', '', ''),
(10337, 1, 1, '<p>To ładne i wytrzymałe szydełko od KnitPro to połączenie komfortu i wygody pracy z wytrzymałością.\n</p><p>Wykonane jest z drewna brzozy, które poddane zostało laminowaniu i barwieniu, czego rezultatem końcowym jest gładka i ładna powierzchnia.</p><p>Jako że szydełko ma haczyki na obu końcach otrzymujesz 2 w 1: 2 rozmiary w jednym szydełku.</p><p>Szydełko dostępne jest w rozmiarach: 3/3.5, 4/4.5, 5/5.5, 6/6.5, 7/8 oraz 9/10 mm.\n</p>', '', 'podwojne-szydelko-symfonie', '', '', '', 'Podwójne szydełko Symfonie', '', '', '', ''),
(10337, 1, 2, '<p>To ładne i wytrzymałe szydełko od KnitPro to połączenie komfortu i wygody pracy z wytrzymałością.\n</p><p>Wykonane jest z drewna brzozy, które poddane zostało laminowaniu i barwieniu, czego rezultatem końcowym jest gładka i ładna powierzchnia.</p><p>Jako że szydełko ma haczyki na obu końcach otrzymujesz 2 w 1: 2 rozmiary w jednym szydełku.</p><p>Szydełko dostępne jest w rozmiarach: 3/3.5, 4/4.5, 5/5.5, 6/6.5, 7/8 oraz 9/10 mm.\n</p>', '', 'podwojne-szydelko-symfonie', '', '', '', 'Podwójne szydełko Symfonie', '', '', '', ''),
(10338, 1, 1, '<p><strong>Dobre i mocne szydełko do techniki tunezyjskiej od Pony</strong></p><p>Szydełko to ma długość 30-35 cm i jest dostępne w rozmiarach 3-12 mm, więc z pewnością znajdziesz takie, które pasować będzie akurat do Twojego projektu. Te najmniejsze rozmiary wykonane są z aluminium , a te większe z mocnego plastiku.</p><p>UPS! Te szydełka o długości 35 cm są podwójne - mają haczyki na obu końcach.</p>', '', 'szydelko-tunezyjskie', '', '', '', 'Szydełko tunezyjskie', '', '', '', ''),
(10338, 1, 2, '<p><strong>Dobre i mocne szydełko do techniki tunezyjskiej od Pony</strong></p><p>Szydełko to ma długość 30-35 cm i jest dostępne w rozmiarach 3-12 mm, więc z pewnością znajdziesz takie, które pasować będzie akurat do Twojego projektu. Te najmniejsze rozmiary wykonane są z aluminium , a te większe z mocnego plastiku.</p><p>UPS! Te szydełka o długości 35 cm są podwójne - mają haczyki na obu końcach.</p>', '', 'szydelko-tunezyjskie', '', '', '', 'Szydełko tunezyjskie', '', '', '', ''),
(10339, 1, 1, '<p>Najwyższej jakości szydełka Clover Amour z wyprofilowaną rączką.\nZestaw zawiera 9 aluminiowych szydełek w pięknych kolorach i w rozmiarach od 2 do 6 mm. Ergonomiczna rączka o długości 10 cm zapewni szydełkowanie bez odczucia bólu.\n</p><p><strong>Rozmiary</strong>:</p><p>2.0mm - Jasny zielony\n2.5mm - Żółty\n3.0mm - Pomarańczowy\n3.5mm - Różowy\n4.0mm - Liliowy\n4.5mm - Turkusowy\n5.0mm - Niebieski\n5.5mm - Zielony\n6.0mm - Brązowy</p><p><strong>Haczyk</strong>: Aluminium</p><p><strong>Rączka</strong>: Tworzywo ABS</p><p><strong>Długość</strong>: 14 cm</p><p>Idealny zestaw dla prawdziwego miłośnika szydełkowania!\n</p><p>\n</p>', '', 'zestaw-szydelek-amour-9-rozmiarow', '', '', '', 'Zestaw Szydełek Amour - 9 rozmiarów', '', '', '', ''),
(10339, 1, 2, '<p>Najwyższej jakości szydełka Clover Amour z wyprofilowaną rączką.\nZestaw zawiera 9 aluminiowych szydełek w pięknych kolorach i w rozmiarach od 2 do 6 mm. Ergonomiczna rączka o długości 10 cm zapewni szydełkowanie bez odczucia bólu.\n</p><p><strong>Rozmiary</strong>:</p><p>2.0mm - Jasny zielony\n2.5mm - Żółty\n3.0mm - Pomarańczowy\n3.5mm - Różowy\n4.0mm - Liliowy\n4.5mm - Turkusowy\n5.0mm - Niebieski\n5.5mm - Zielony\n6.0mm - Brązowy</p><p><strong>Haczyk</strong>: Aluminium</p><p><strong>Rączka</strong>: Tworzywo ABS</p><p><strong>Długość</strong>: 14 cm</p><p>Idealny zestaw dla prawdziwego miłośnika szydełkowania!\n</p><p>\n</p>', '', 'zestaw-szydelek-amour-9-rozmiarow', '', '', '', 'Zestaw Szydełek Amour - 9 rozmiarów', '', '', '', ''),
(10340, 1, 1, '<p>Szydełko wykonane jest z akrylu, który jest bardzo łatwy i wygodny w pracy. Szydełko wyposażone jest w rowki na końcu uchwytu co ma na celu zapobieganie gubienia oczek. Oprócz tego szydełko bardzo wygodnie się trzyma i zwiększa kontrolę nawet w przypadku włóczek, które po innych szydełkach się ‘ślizgają’. Dlatego tez produkt ten polecany jest osobom początkującym.\n</p><p>Szydełko dostępne jest w rozmiarach 5-12 mm, gdzie każdy rozmiar ma swój konkretny kolor. Będzie Ci nie tylko łatwo odróżnić rozmiary, ale również miło patrzeć na zestaw!</p>', '', 'szydelko-z-serii-trendz', '', '', '', 'Szydełko z serii Trendz', '', '', '', ''),
(10340, 1, 2, '<p>Szydełko wykonane jest z akrylu, który jest bardzo łatwy i wygodny w pracy. Szydełko wyposażone jest w rowki na końcu uchwytu co ma na celu zapobieganie gubienia oczek. Oprócz tego szydełko bardzo wygodnie się trzyma i zwiększa kontrolę nawet w przypadku włóczek, które po innych szydełkach się ‘ślizgają’. Dlatego tez produkt ten polecany jest osobom początkującym.\n</p><p>Szydełko dostępne jest w rozmiarach 5-12 mm, gdzie każdy rozmiar ma swój konkretny kolor. Będzie Ci nie tylko łatwo odróżnić rozmiary, ale również miło patrzeć na zestaw!</p>', '', 'szydelko-z-serii-trendz', '', '', '', 'Szydełko z serii Trendz', '', '', '', ''),
(10341, 1, 1, '<p>Zestaw szydełek tunezyjskich zakończonych z dwóch stron haczykiem. Haczyki są tego samego rozmiaru.</p><p>W zestawie otrzymujesz 4 rozmiary w czterech różnych pięknych metalicznych kolorach.</p><p>4 mm = Różowy\n5 mm = Niebieski\n6 mm = Fioletowy\n7 mm = Zielony</p><p>Aluminium to wspaniały i wytrzymały materiał. Ściegi doskonale przesuwają się po powierzchni szydełka, a lekkość metalu pozwala na długi czas szydełkowania.\n</p>', '', 'alu-zestaw-podwojnych-szydelek-tunezyjskich-14-cm', '', '', '', 'Alu Zestaw Podwójnych Szydełek Tunezyjskich - 14 cm', '', '', '', ''),
(10341, 1, 2, '<p>Zestaw szydełek tunezyjskich zakończonych z dwóch stron haczykiem. Haczyki są tego samego rozmiaru.</p><p>W zestawie otrzymujesz 4 rozmiary w czterech różnych pięknych metalicznych kolorach.</p><p>4 mm = Różowy\n5 mm = Niebieski\n6 mm = Fioletowy\n7 mm = Zielony</p><p>Aluminium to wspaniały i wytrzymały materiał. Ściegi doskonale przesuwają się po powierzchni szydełka, a lekkość metalu pozwala na długi czas szydełkowania.\n</p>', '', 'alu-zestaw-podwojnych-szydelek-tunezyjskich-14-cm', '', '', '', 'Alu Zestaw Podwójnych Szydełek Tunezyjskich - 14 cm', '', '', '', ''),
(10342, 1, 1, '<p>Najlepszy zestaw tunezyjskich szydełek dla wszystkich miłośników szydełkowania, a zwłaszcza miłośników serii Symfonie! Zawierający 8 rozmiarów Szydełek Tunezyjskich z czterema żyłkami o różnej długości i bogatym asortymentem akcesoriów, zestaw zaspokoi wszystkie Twoje potrzeby związane z szydełkowaniem. Nawet jeśli nie miałaś styczności z tunezyjskim rękodziełem, szydełko sprawdzi się we wszystkich projektach.\n</p><p>Łatwa do zamontowania żyłka ma gładkie łącze, które pozwala na płynne przerabianie oczek bez zaczepiania się włóczki. Ręcznie wykonana przez wykwalifikowanych rzemieślników, polerowana drewniana powierzchnia Symfonie współpracuje ze wszystkimi rodzajami włóczek, zapewniając godziny płynnego szydełkowania.</p><p>Wymienne szydełka Symfonie idealnie nadają się do tworzenia tunezyjskich projektów szydełkowych o różnych szerokościach i rozmiarach.</p><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami firmy KnitPro!</p><p>Metalowy kluczyk służy do dokręcenia żyłki z drutami, aby druty nie odkręciły się podczas pracy. Włóż końcówkę klucza przez mały otwór w gwincie i mocno dokręć drut, trzymając klucz w miejscu. Na tej stronie znajdziesz link do filmu.</p><p>Jeśli potrzebujesz drutów wymiennych bez żyłki możesz wykorzystać stopery i przykręcić je do żyłki. W ten sposób robótka pozostanie na żyłce, a ty możesz wykorzystać druty do innego projektu. Stopery przykręcasz do żyłki w taki sam sposób jak druty.</p><p><strong>Zawartość zestawu:</strong></p><ul><li><p>8 rozmiarów wymiennych szydełek tunezyjskich/afgańskich (3,5 - 4,0 - 4,5 - 5,0 - 5,5 - 6,0 - 7,0 - 8,0)</p></li><li><p>4 żyłki (60cm, 2 x 80cm &amp; 100cm)</p></li><li><p>8 stoperów</p></li><li><p>4 klucze do żyłki</p></li><li><p>1 zestaw łączników do żyłek</p></li><li><p>Filetowe etui zapinane na zamek</p></li></ul>', '', 'symfonie-zestaw-afganskich-tunezyjskich-szydelek', '', '', '', 'Symfonie Zestaw Afgańskich/Tunezyjskich Szydełek', '', '', '', ''),
(10342, 1, 2, '<p>Najlepszy zestaw tunezyjskich szydełek dla wszystkich miłośników szydełkowania, a zwłaszcza miłośników serii Symfonie! Zawierający 8 rozmiarów Szydełek Tunezyjskich z czterema żyłkami o różnej długości i bogatym asortymentem akcesoriów, zestaw zaspokoi wszystkie Twoje potrzeby związane z szydełkowaniem. Nawet jeśli nie miałaś styczności z tunezyjskim rękodziełem, szydełko sprawdzi się we wszystkich projektach.\n</p><p>Łatwa do zamontowania żyłka ma gładkie łącze, które pozwala na płynne przerabianie oczek bez zaczepiania się włóczki. Ręcznie wykonana przez wykwalifikowanych rzemieślników, polerowana drewniana powierzchnia Symfonie współpracuje ze wszystkimi rodzajami włóczek, zapewniając godziny płynnego szydełkowania.</p><p>Wymienne szydełka Symfonie idealnie nadają się do tworzenia tunezyjskich projektów szydełkowych o różnych szerokościach i rozmiarach.</p><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami firmy KnitPro!</p><p>Metalowy kluczyk służy do dokręcenia żyłki z drutami, aby druty nie odkręciły się podczas pracy. Włóż końcówkę klucza przez mały otwór w gwincie i mocno dokręć drut, trzymając klucz w miejscu. Na tej stronie znajdziesz link do filmu.</p><p>Jeśli potrzebujesz drutów wymiennych bez żyłki możesz wykorzystać stopery i przykręcić je do żyłki. W ten sposób robótka pozostanie na żyłce, a ty możesz wykorzystać druty do innego projektu. Stopery przykręcasz do żyłki w taki sam sposób jak druty.</p><p><strong>Zawartość zestawu:</strong></p><ul><li><p>8 rozmiarów wymiennych szydełek tunezyjskich/afgańskich (3,5 - 4,0 - 4,5 - 5,0 - 5,5 - 6,0 - 7,0 - 8,0)</p></li><li><p>4 żyłki (60cm, 2 x 80cm &amp; 100cm)</p></li><li><p>8 stoperów</p></li><li><p>4 klucze do żyłki</p></li><li><p>1 zestaw łączników do żyłek</p></li><li><p>Filetowe etui zapinane na zamek</p></li></ul>', '', 'symfonie-zestaw-afganskich-tunezyjskich-szydelek', '', '', '', 'Symfonie Zestaw Afgańskich/Tunezyjskich Szydełek', '', '', '', ''),
(10343, 1, 1, '<p>W tym zestawie z serii Bamboo od KnitPro otrzymasz 8 szydełek w rozmiarach 3,5-8 mm. Wykonane są one z wysokiej jakości bambusa pochodzącego z Japonii.</p><p>Bambus znany jest ze swojej wytrzymałości i lekkości, która zapewnia duży komfort pracy. Z tymi drutami możesz pracować przez wiele godzin bez poczucia bólu w dłoniach.</p><p>Szydełka zapakowane są w praktyczne, zielone etui zamykane na zamek błyskawiczny - możesz w nim przechowywać zawartość zestawu.</p><p>Rozmiary szydełek: 3,5 - 4 - 4,5 - 5 - 5,5 - 6 - 7 - 8 mm</p>', '', 'zestaw-szydelek-bamboo', '', '', '', 'Zestaw szydełek Bamboo', '', '', '', ''),
(10343, 1, 2, '<p>W tym zestawie z serii Bamboo od KnitPro otrzymasz 8 szydełek w rozmiarach 3,5-8 mm. Wykonane są one z wysokiej jakości bambusa pochodzącego z Japonii.</p><p>Bambus znany jest ze swojej wytrzymałości i lekkości, która zapewnia duży komfort pracy. Z tymi drutami możesz pracować przez wiele godzin bez poczucia bólu w dłoniach.</p><p>Szydełka zapakowane są w praktyczne, zielone etui zamykane na zamek błyskawiczny - możesz w nim przechowywać zawartość zestawu.</p><p>Rozmiary szydełek: 3,5 - 4 - 4,5 - 5 - 5,5 - 6 - 7 - 8 mm</p>', '', 'zestaw-szydelek-bamboo', '', '', '', 'Zestaw szydełek Bamboo', '', '', '', ''),
(10344, 1, 1, '<p>Te ładne i wytrzymałe szydełka od KnitPro to połączenie komfortu i wygody pracy z wytrzymałością. Wykonane są z drewna brzozy, które poddane zostało laminowaniu i barwieniu, czego rezultatem końcowym jest gładka i ładna powierzchnia.</p><p>Zestaw zawiera 5 szydełek w rozmiarach: 3,5 - 4,5 - 5 - 6 - 8 mm. oraz zapakowany jest w przezroczyste, plastikowe etui.\n</p>', '', 'zestaw-szydelek-symfonie-pojedyncze', '', '', '', 'Zestaw szydełek Symfonie - Pojedyncze', '', '', '', ''),
(10344, 1, 2, '<p>Te ładne i wytrzymałe szydełka od KnitPro to połączenie komfortu i wygody pracy z wytrzymałością. Wykonane są z drewna brzozy, które poddane zostało laminowaniu i barwieniu, czego rezultatem końcowym jest gładka i ładna powierzchnia.</p><p>Zestaw zawiera 5 szydełek w rozmiarach: 3,5 - 4,5 - 5 - 6 - 8 mm. oraz zapakowany jest w przezroczyste, plastikowe etui.\n</p>', '', 'zestaw-szydelek-symfonie-pojedyncze', '', '', '', 'Zestaw szydełek Symfonie - Pojedyncze', '', '', '', ''),
(10345, 1, 1, '<p><strong>Easy Touch Berry </strong>Zestaw zawiera 9 szydełek w różnych rozmiarach - 2 mm, 2,5 mm, 3 mm, 3,5 mm, 4 mm, 4,5 mm, 5 mm, 5,5 mm i 6 mm.\n</p><p>Tutaj otrzymujesz szydełka tej samej dobrej jakości, co nasze zwykłe szydełka Easy Touch - ale to nie koniec. Są one dostępne w zestawie prezentowym, w ładnym płóciennym etui i z szydełkami w pięknych stonowanych kolorach.</p><p>Szydełka wykonane są z miękkiego, ergonomicznego uchwytu w pięknej czerwonawej skali kolorów, gdzie każde szydełko ma piękny jagodowy kolor. Stąd nazwa <strong>Berry</strong>.</p><p>Ergonomiczne uchwyty zapewniają, że możesz szydełkować nimi przez kilka godzin bez bólu rąk. Haczyki wykonane są z aluminium, dzięki czemu nie zawierają niklu.</p><p>Im więcej szydełkujesz za pomocą Easy Touch Berry - tym bardziej je pokochasz.</p>', '', 'zestaw-szydelek-easy-touch-berry-9-rozmiarow', '', '', '', 'Zestaw szydełek Easy Touch - Berry - 9 rozmiarów', '', '', '', ''),
(10345, 1, 2, '<p><strong>Easy Touch Berry </strong>Zestaw zawiera 9 szydełek w różnych rozmiarach - 2 mm, 2,5 mm, 3 mm, 3,5 mm, 4 mm, 4,5 mm, 5 mm, 5,5 mm i 6 mm.\n</p><p>Tutaj otrzymujesz szydełka tej samej dobrej jakości, co nasze zwykłe szydełka Easy Touch - ale to nie koniec. Są one dostępne w zestawie prezentowym, w ładnym płóciennym etui i z szydełkami w pięknych stonowanych kolorach.</p><p>Szydełka wykonane są z miękkiego, ergonomicznego uchwytu w pięknej czerwonawej skali kolorów, gdzie każde szydełko ma piękny jagodowy kolor. Stąd nazwa <strong>Berry</strong>.</p><p>Ergonomiczne uchwyty zapewniają, że możesz szydełkować nimi przez kilka godzin bez bólu rąk. Haczyki wykonane są z aluminium, dzięki czemu nie zawierają niklu.</p><p>Im więcej szydełkujesz za pomocą Easy Touch Berry - tym bardziej je pokochasz.</p>', '', 'zestaw-szydelek-easy-touch-berry-9-rozmiarow', '', '', '', 'Zestaw szydełek Easy Touch - Berry - 9 rozmiarów', '', '', '', ''),
(10346, 1, 1, '<p>Amour to najwyższej jakości szydełka znanej marki Clover. Zestaw zawiera 7 szydełek w pięknych pastelowych kolorach wykonanych ze stali w rozmiarach od 0,6 do 1,75 mm.\nErgonomiczna rączka \"easy grip\" o długości 9,3 cm zapewni szydełkowanie bez odczucia bólu. Polecają się do wykonywania delikatnych koronek i mniejszych projektów.</p><p><strong>Rozmiary/kolory:</strong>\n0.60mm - Pastelowa Czerwień\n0.75mm - Pastelowy Niebieski\n0.90mm - Pastelowa Mięta\n1.00mm - Pastelowy Liliowy\n1.25mm - Pastelowy Różowy\n1.50mm - Pastelowy Żółty\n1.75mm - Pastelowy Zielony</p><p><strong>Haczyk</strong>: Stal</p><p><strong>Rączka</strong>: Tworzywo ABS</p><p><strong>Długość</strong>: 12,5 cm</p><p>Absolutny must-have dla prawdziwego miłośnika szydełkowania!</p>', '', 'zestaw-szydelek-amour-7-rozmiarow', '', '', '', 'Zestaw szydełek Amour - 7 rozmiarów', '', '', '', ''),
(10346, 1, 2, '<p>Amour to najwyższej jakości szydełka znanej marki Clover. Zestaw zawiera 7 szydełek w pięknych pastelowych kolorach wykonanych ze stali w rozmiarach od 0,6 do 1,75 mm.\nErgonomiczna rączka \"easy grip\" o długości 9,3 cm zapewni szydełkowanie bez odczucia bólu. Polecają się do wykonywania delikatnych koronek i mniejszych projektów.</p><p><strong>Rozmiary/kolory:</strong>\n0.60mm - Pastelowa Czerwień\n0.75mm - Pastelowy Niebieski\n0.90mm - Pastelowa Mięta\n1.00mm - Pastelowy Liliowy\n1.25mm - Pastelowy Różowy\n1.50mm - Pastelowy Żółty\n1.75mm - Pastelowy Zielony</p><p><strong>Haczyk</strong>: Stal</p><p><strong>Rączka</strong>: Tworzywo ABS</p><p><strong>Długość</strong>: 12,5 cm</p><p>Absolutny must-have dla prawdziwego miłośnika szydełkowania!</p>', '', 'zestaw-szydelek-amour-7-rozmiarow', '', '', '', 'Zestaw szydełek Amour - 7 rozmiarów', '', '', '', ''),
(10347, 1, 1, '<p>Zapomnij o nudnym, szarym akrylu - KnitPro przedstawia serię Zing: szydełka wykonane z lekkiego metalu, gdzie każdy rozmiar ma swój własny kolor o metalicznym połysku.</p><p>Szydełka Zing wykonane są z aluminium i zakończone lśniącą, srebrną końcówką, która pozwala dostrzec włóczkę, niezależnie od jej koloru. Perfekcyjny kształt szydełka wraz z gładką powierzchnią czynią szydełko bardzo wygodnym i poręcznym.</p><p>Wyraźnie widoczne rozmiary są wydrukowane laserowo na każdym szydełku, a fachowo wykończona końcówka idealnie sprawdzi się do każdej włóczki. Szydełka są „ciepłe” w dotyku i wyjątkowo delikatne w dłoni. Atrakcyjne różowe etui z tkaniny pozwala uporządkować zestaw.\n</p><p><strong>Zestaw zawiera następujące rozmiary:</strong></p><ul><li><p>2.0 mm – Koral</p></li><li><p>2.5 mm – Granat</p></li><li><p>3.0 mm – Jadeit</p></li><li><p>3.5 mm – Beryl</p></li><li><p>4.0 mm – Szafir</p></li><li><p>4.5 mm - Kordieryt</p></li><li><p>5.0 mm - Rubin</p></li><li><p>5.5 mm – Siena</p></li><li><p>6.0 mm – Liliowy aksamit</p></li></ul>', '', 'zing-zestaw-szydelek', '', '', '', 'Zing Zestaw Szydełek', '', '', '', ''),
(10347, 1, 2, '<p>Zapomnij o nudnym, szarym akrylu - KnitPro przedstawia serię Zing: szydełka wykonane z lekkiego metalu, gdzie każdy rozmiar ma swój własny kolor o metalicznym połysku.</p><p>Szydełka Zing wykonane są z aluminium i zakończone lśniącą, srebrną końcówką, która pozwala dostrzec włóczkę, niezależnie od jej koloru. Perfekcyjny kształt szydełka wraz z gładką powierzchnią czynią szydełko bardzo wygodnym i poręcznym.</p><p>Wyraźnie widoczne rozmiary są wydrukowane laserowo na każdym szydełku, a fachowo wykończona końcówka idealnie sprawdzi się do każdej włóczki. Szydełka są „ciepłe” w dotyku i wyjątkowo delikatne w dłoni. Atrakcyjne różowe etui z tkaniny pozwala uporządkować zestaw.\n</p><p><strong>Zestaw zawiera następujące rozmiary:</strong></p><ul><li><p>2.0 mm – Koral</p></li><li><p>2.5 mm – Granat</p></li><li><p>3.0 mm – Jadeit</p></li><li><p>3.5 mm – Beryl</p></li><li><p>4.0 mm – Szafir</p></li><li><p>4.5 mm - Kordieryt</p></li><li><p>5.0 mm - Rubin</p></li><li><p>5.5 mm – Siena</p></li><li><p>6.0 mm – Liliowy aksamit</p></li></ul>', '', 'zing-zestaw-szydelek', '', '', '', 'Zing Zestaw Szydełek', '', '', '', ''),
(10348, 1, 1, '<p><strong>Świetny zestaw szydełek w naprawdę dobrej cenie!</strong></p><p>Easy Touch Zestaw Szydełek zawiera 6 szydełek w rozmiarach: 0,5 - 0,75 - 1,0 - 1,25 - 1,5 &amp; 1,75 mm.</p><p><strong>Rozmiary/kolory:</strong></p><ul><li><p>Szydełko 0,5 mm – Miętowy</p></li><li><p>Szydełko 0,75 mm – Zielony</p></li><li><p>Szydełko 1,0 mm – Różowy</p></li><li><p>Szydełko 1,25 mm – Czerwony</p></li><li><p>Szydełko 1,5 mm – Żółty</p></li><li><p>Szydełko 1,75 mm – Pomarańczowy</p></li></ul><p>Szydełka posiadają miękki ergonomiczny uchwyt, co zapewni szydełkowanie przez kilka godzin nie odczuwając bólu rąk. Każdy rozmiar ma swój własny kolor, dzięki czemu łatwo je odróżnisz. Im więcej będziesz szydełkować tymi szydełkami, tym bardziej je pokochasz.</p><p>Absolutny must-have dla prawdziwego miłośnika szydełkowania :)</p>', '', 'zestaw-szydelek-easy-touch-6-rozmiarow', '', '', '', 'Zestaw szydełek Easy Touch - 6 rozmiarów', '', '', '', ''),
(10348, 1, 2, '<p><strong>Świetny zestaw szydełek w naprawdę dobrej cenie!</strong></p><p>Easy Touch Zestaw Szydełek zawiera 6 szydełek w rozmiarach: 0,5 - 0,75 - 1,0 - 1,25 - 1,5 &amp; 1,75 mm.</p><p><strong>Rozmiary/kolory:</strong></p><ul><li><p>Szydełko 0,5 mm – Miętowy</p></li><li><p>Szydełko 0,75 mm – Zielony</p></li><li><p>Szydełko 1,0 mm – Różowy</p></li><li><p>Szydełko 1,25 mm – Czerwony</p></li><li><p>Szydełko 1,5 mm – Żółty</p></li><li><p>Szydełko 1,75 mm – Pomarańczowy</p></li></ul><p>Szydełka posiadają miękki ergonomiczny uchwyt, co zapewni szydełkowanie przez kilka godzin nie odczuwając bólu rąk. Każdy rozmiar ma swój własny kolor, dzięki czemu łatwo je odróżnisz. Im więcej będziesz szydełkować tymi szydełkami, tym bardziej je pokochasz.</p><p>Absolutny must-have dla prawdziwego miłośnika szydełkowania :)</p>', '', 'zestaw-szydelek-easy-touch-6-rozmiarow', '', '', '', 'Zestaw szydełek Easy Touch - 6 rozmiarów', '', '', '', ''),
(10349, 1, 1, '<p><strong>\"Easy Grip - Easy Crochet\"</strong></p><p>Polka Dot Zestaw szydełek firmy Pony zawiera 9 szydełek w rozmiarach od 2-4 mm. Każdy rozmiar ma swój własny kolor.</p><p>Jak sama nazwa wskazuje, szydełka te leżą wygodnie w dłoniach dając Ci pewny uchwyt, dzięki czemu uzyskasz najlepszy punkt wyjścia do rozpoczęcia szydełkowania. Rączka sprawia, że nawet długotrwałe szydełkowanie jest przyjemne i nie sprawia bólu.</p><p><strong>Materiał</strong>: aluminium i plastik</p><p><strong>Rozmiary</strong>: 2,0 - 2,5 - 3,0 - 3,5 - 4,0</p><p><strong>Długość</strong>: 14 cm</p><p></p><p><strong>Zestaw zawiera:</strong>\n2.0 mm - Różowy\n2.5 mm - Zielony\n3.0 mm - Pomarańczowy\n3.5 mm - Róż\n4.0 mm - Jasnoniebieski\n\n</p>', '', 'zestaw-szydelek-easy-grip', '', '', '', 'Zestaw szydełek Easy Grip', '', '', '', ''),
(10349, 1, 2, '<p><strong>\"Easy Grip - Easy Crochet\"</strong></p><p>Polka Dot Zestaw szydełek firmy Pony zawiera 9 szydełek w rozmiarach od 2-4 mm. Każdy rozmiar ma swój własny kolor.</p><p>Jak sama nazwa wskazuje, szydełka te leżą wygodnie w dłoniach dając Ci pewny uchwyt, dzięki czemu uzyskasz najlepszy punkt wyjścia do rozpoczęcia szydełkowania. Rączka sprawia, że nawet długotrwałe szydełkowanie jest przyjemne i nie sprawia bólu.</p><p><strong>Materiał</strong>: aluminium i plastik</p><p><strong>Rozmiary</strong>: 2,0 - 2,5 - 3,0 - 3,5 - 4,0</p><p><strong>Długość</strong>: 14 cm</p><p></p><p><strong>Zestaw zawiera:</strong>\n2.0 mm - Różowy\n2.5 mm - Zielony\n3.0 mm - Pomarańczowy\n3.5 mm - Róż\n4.0 mm - Jasnoniebieski\n\n</p>', '', 'zestaw-szydelek-easy-grip', '', '', '', 'Zestaw szydełek Easy Grip', '', '', '', '');
