(10350, 1, 1, '<p>Elegancki komplet szydełek Addi Swings. Zestaw w etui z wysokiej jakości imitacji skóry z podszewką z prawdziwego jedwabiu zawiera 7 ergonomicznych szydełek w rozmiarach od 2 do 8 mm.\n</p><p>Szydełka Addi Swings mają ergonomiczny kształt, który odciąża dłoń i ramię podczas pracy. Wykonano je z aluminium, a ich trzonki z silikonu. Długość każdego to 16 cm, ale każdy rozmiar ma inny kolor.</p><p><strong>Zestaw zawiera:</strong>\n- 7 szydełek o grubościach: 2, 3, 4, 5, 6, 7, 8 mm\n- 1 czarne etui z dobrej jakości imitacji skóry wyłożone prawdziwym jedwabiem.</p><p>\n</p>', '', 'zestaw-szydelek-swings', '', '', '', 'Zestaw szydełek Swings', '', '', '', ''),
(10350, 1, 2, '<p>Elegancki komplet szydełek Addi Swings. Zestaw w etui z wysokiej jakości imitacji skóry z podszewką z prawdziwego jedwabiu zawiera 7 ergonomicznych szydełek w rozmiarach od 2 do 8 mm.\n</p><p>Szydełka Addi Swings mają ergonomiczny kształt, który odciąża dłoń i ramię podczas pracy. Wykonano je z aluminium, a ich trzonki z silikonu. Długość każdego to 16 cm, ale każdy rozmiar ma inny kolor.</p><p><strong>Zestaw zawiera:</strong>\n- 7 szydełek o grubościach: 2, 3, 4, 5, 6, 7, 8 mm\n- 1 czarne etui z dobrej jakości imitacji skóry wyłożone prawdziwym jedwabiem.</p><p>\n</p>', '', 'zestaw-szydelek-swings', '', '', '', 'Zestaw szydełek Swings', '', '', '', ''),
(10351, 1, 1, '<p>Piękne, podwójne tunezyjskie szydełko z haczykiem tej samej wielkości na obu końcach. Każde szydełko ma swój unikatowy, metaliczny kolor.\n</p><p>Aluminium to wspaniały i łatwy w obróbce materiał. Oczka doskonale przesuwają się po powierzchni, a lekkość metalu sprawia, że ​​praca pozostaje komfortowa przez dłuższy czas.</p><p>Te tunezyjskie szydełka są wyjątkowo długie.</p>', '', 'aluminiowe-podwojne-szydelko-tunezyjskie-28-cm', '', '', '', 'Aluminiowe, podwójne szydełko tunezyjskie - 28 cm', '', '', '', ''),
(10351, 1, 2, '<p>Piękne, podwójne tunezyjskie szydełko z haczykiem tej samej wielkości na obu końcach. Każde szydełko ma swój unikatowy, metaliczny kolor.\n</p><p>Aluminium to wspaniały i łatwy w obróbce materiał. Oczka doskonale przesuwają się po powierzchni, a lekkość metalu sprawia, że ​​praca pozostaje komfortowa przez dłuższy czas.</p><p>Te tunezyjskie szydełka są wyjątkowo długie.</p>', '', 'aluminiowe-podwojne-szydelko-tunezyjskie-28-cm', '', '', '', 'Aluminiowe, podwójne szydełko tunezyjskie - 28 cm', '', '', '', ''),
(10352, 1, 1, '<p>Druty na żyłce z serii Basix frimy KnitPro wykonane są z drewna bukowego. Podkreślają naturalne właściwości i wytrzymałość drewna oraz mają ładny, jasny kolor. Przejścia między drutami a żyłką są gładko wykończone, co zapobiega „haczeniu” się włóczki. Dodatkowo żyłki są elastyczne i wytrzymałe, dzięki czemu można je łatwo złożyć bez ryzyka złamania.\n</p><p>Druty na żyłce są dostępne w kilku różnych długościach i rozmiarach, dlatego idealnie sprawdzą się do wielu projektów.</p><p>Przyjemny, naturalny materiał sprawia, że druty są wygodne w użyciu i pozwalają na dzierganie przez kilka godzin bez bólu rąk.</p><p>Materiał: Buk</p>', '', 'basix-druty-na-zylce', '', '', '', 'Basix Druty na żyłce', '', '', '', ''),
(10352, 1, 2, '<p>Druty na żyłce z serii Basix frimy KnitPro wykonane są z drewna bukowego. Podkreślają naturalne właściwości i wytrzymałość drewna oraz mają ładny, jasny kolor. Przejścia między drutami a żyłką są gładko wykończone, co zapobiega „haczeniu” się włóczki. Dodatkowo żyłki są elastyczne i wytrzymałe, dzięki czemu można je łatwo złożyć bez ryzyka złamania.\n</p><p>Druty na żyłce są dostępne w kilku różnych długościach i rozmiarach, dlatego idealnie sprawdzą się do wielu projektów.</p><p>Przyjemny, naturalny materiał sprawia, że druty są wygodne w użyciu i pozwalają na dzierganie przez kilka godzin bez bólu rąk.</p><p>Materiał: Buk</p>', '', 'basix-druty-na-zylce', '', '', '', 'Basix Druty na żyłce', '', '', '', ''),
(10353, 1, 1, '<p>Bamboo Druty pojedyncze firmy Hobbii to idealne druty dla każdej dziewiarki. Te druty o długości 30 cm wykonane są z bambusa moso, który jest niezwykle trwałym materiałem. Są lekkie i gładkie, dzięki czemu przyjemnie się nimi pracuje. Są również przyjazne dla środowiska i mają naturalny kolor.\n</p><p>Oferujemy rozmiary od 3,0 - 10,0 mm. Wypróbuj je dziś i przekonaj się jak przyjemnie będzie się nimi pracowało.</p>', '', 'bamboo-druty-pojedyncze', '', '', '', 'Bamboo Druty Pojedyncze', '', '', '', ''),
(10353, 1, 2, '<p>Bamboo Druty pojedyncze firmy Hobbii to idealne druty dla każdej dziewiarki. Te druty o długości 30 cm wykonane są z bambusa moso, który jest niezwykle trwałym materiałem. Są lekkie i gładkie, dzięki czemu przyjemnie się nimi pracuje. Są również przyjazne dla środowiska i mają naturalny kolor.\n</p><p>Oferujemy rozmiary od 3,0 - 10,0 mm. Wypróbuj je dziś i przekonaj się jak przyjemnie będzie się nimi pracowało.</p>', '', 'bamboo-druty-pojedyncze', '', '', '', 'Bamboo Druty Pojedyncze', '', '', '', ''),
(10354, 1, 1, '<p>Nova Metal to druty w małych rozmiarach i o krótkich długościach, których nie znajdziesz wśród wymiennych drutów Nova Metals. Rozmiary i długości, o których mowa to 2.00-12.00 mm oraz 40-150 cm.\n</p><p>Tak jak reszta serii Nova Metal, druty te są wykonane z mosiądzu i mają ładną wypolerowaną powierzchnię. Gładka powierzchnia sprawia, że oczka łatwo przemieszczają się po drutach, zwłaszcza, że łączenie drutów z żyłką wykonane jest w taki sposób, aby oczka się tam nie zatrzymywały.</p><p>Zakończenia drutów robią się ostrzejszy im bliżej końców, co ułatwia pracę. Fakt, iż druty wykonane są z mosiądzu, a w środku są puste, także polepsza ich jakość. Daje im to bowiem lekkość, która umożliwia pracę z nimi przez długie godziny. Żyłka jest natomiast elastyczna i może być złożona bez ryzyka, że w którymś miejscu pęknie.</p>', '', 'druty-na-zylce-nova-metal', '', '', '', 'Druty na żyłce Nova Metal', '', '', '', ''),
(10354, 1, 2, '<p>Nova Metal to druty w małych rozmiarach i o krótkich długościach, których nie znajdziesz wśród wymiennych drutów Nova Metals. Rozmiary i długości, o których mowa to 2.00-12.00 mm oraz 40-150 cm.\n</p><p>Tak jak reszta serii Nova Metal, druty te są wykonane z mosiądzu i mają ładną wypolerowaną powierzchnię. Gładka powierzchnia sprawia, że oczka łatwo przemieszczają się po drutach, zwłaszcza, że łączenie drutów z żyłką wykonane jest w taki sposób, aby oczka się tam nie zatrzymywały.</p><p>Zakończenia drutów robią się ostrzejszy im bliżej końców, co ułatwia pracę. Fakt, iż druty wykonane są z mosiądzu, a w środku są puste, także polepsza ich jakość. Daje im to bowiem lekkość, która umożliwia pracę z nimi przez długie godziny. Żyłka jest natomiast elastyczna i może być złożona bez ryzyka, że w którymś miejscu pęknie.</p>', '', 'druty-na-zylce-nova-metal', '', '', '', 'Druty na żyłce Nova Metal', '', '', '', ''),
(10355, 1, 1, '<p>Druty na żyłce addi Lace mają ekstra długie, cienkie i ostre (ale nie za bardzo!) końce do drobnych włóczek i zaawansowanych technik. Wydłużone końcówki i gładka powierzchnia sprawiają, że wkłuwanie się w oczka z najdelikatniejszej włóczki to bułka z masłem. Powinieneś więc je wybrać, jeżeli lubisz pracować szybko i gładko. I oczywiście, jak rezultat jest zachwycający! Te druty na żyłce są odpowiednie do drobnych robótek ręcznych.</p><p>addi Lace Drut na żyłce ma mocną, elastyczną czerwoną żyłkę, z idealnym przejściem między drutem a żyłką, dzięki czemu włóczka ślizga się jak marzenie.</p><p>Siedziba addi znajduje się w Niemczech i tam też produkowane są ich produkty. Wyroby tej firmy to fantastyczna jakość i wytrzymałość! Druty są wolne od niklu i mogą być używane przez alergików.</p><p><strong>Materiał</strong>: Mosiądz powleczony białym brązem, bez niklu\n<strong>Długość</strong>: 40 cm - 60 cm - 80 cm\n<strong>Rozmiary</strong>: 2,0 - 2,25 - 2,5 - 2,75 - 3,0 - 3,25 - 3,5 - 3,75 - 4,0 - 4,5 - 5,0 - 5,5 - 6,0 - 6,5 - 7,0 - 8,0 mm</p><p>Producent umieścił długość i rozmiar na żyłce, co jest bardzo praktyczne.</p><p>\n</p>', '', 'lace-druty-na-zylce', '', '', '', 'Lace druty na żyłce', '', '', '', ''),
(10355, 1, 2, '<p>Druty na żyłce addi Lace mają ekstra długie, cienkie i ostre (ale nie za bardzo!) końce do drobnych włóczek i zaawansowanych technik. Wydłużone końcówki i gładka powierzchnia sprawiają, że wkłuwanie się w oczka z najdelikatniejszej włóczki to bułka z masłem. Powinieneś więc je wybrać, jeżeli lubisz pracować szybko i gładko. I oczywiście, jak rezultat jest zachwycający! Te druty na żyłce są odpowiednie do drobnych robótek ręcznych.</p><p>addi Lace Drut na żyłce ma mocną, elastyczną czerwoną żyłkę, z idealnym przejściem między drutem a żyłką, dzięki czemu włóczka ślizga się jak marzenie.</p><p>Siedziba addi znajduje się w Niemczech i tam też produkowane są ich produkty. Wyroby tej firmy to fantastyczna jakość i wytrzymałość! Druty są wolne od niklu i mogą być używane przez alergików.</p><p><strong>Materiał</strong>: Mosiądz powleczony białym brązem, bez niklu\n<strong>Długość</strong>: 40 cm - 60 cm - 80 cm\n<strong>Rozmiary</strong>: 2,0 - 2,25 - 2,5 - 2,75 - 3,0 - 3,25 - 3,5 - 3,75 - 4,0 - 4,5 - 5,0 - 5,5 - 6,0 - 6,5 - 7,0 - 8,0 mm</p><p>Producent umieścił długość i rozmiar na żyłce, co jest bardzo praktyczne.</p><p>\n</p>', '', 'lace-druty-na-zylce', '', '', '', 'Lace druty na żyłce', '', '', '', ''),
(10356, 1, 1, '<p>Druty na żyłce KnitPro Zing są niezwykle lekkie i gładkie, oczka bardzo dobrze się po nich przesuwają.</p><p>Druty występują w pięknych kolorach, więc nie tylko się fantastycznie nimi pracuje, ale też wspaniale na nie patrzeć. Ich barwa zależy od ich grubości, co jest bardzo praktyczne. Od razu widać jaki rozmiar ma się w ręce, nie sposób się pomylić.</p><p>Zing są wolne od niklu, więc nie trzeba się martwić o alergię.</p><p>Druty są ostro zakończone, na każdym nadrukowano laserowo rozmiar.</p>', '', 'druty-na-zylce-zing', '', '', '', 'Druty na żyłce Zing', '', '', '', ''),
(10356, 1, 2, '<p>Druty na żyłce KnitPro Zing są niezwykle lekkie i gładkie, oczka bardzo dobrze się po nich przesuwają.</p><p>Druty występują w pięknych kolorach, więc nie tylko się fantastycznie nimi pracuje, ale też wspaniale na nie patrzeć. Ich barwa zależy od ich grubości, co jest bardzo praktyczne. Od razu widać jaki rozmiar ma się w ręce, nie sposób się pomylić.</p><p>Zing są wolne od niklu, więc nie trzeba się martwić o alergię.</p><p>Druty są ostro zakończone, na każdym nadrukowano laserowo rozmiar.</p>', '', 'druty-na-zylce-zing', '', '', '', 'Druty na żyłce Zing', '', '', '', ''),
(10357, 1, 1, '<p>Fantastyczny zestaw nylonowych żyłek firmy Knitpro. Żyłki są wytrzymałe, elastyczne i dostępne w fioletowym kolorze. Zakończone gwintem zapewniającym gładkie i płynne połączenie z drutami.</p><p><strong>W zestawie znajduje się:</strong></p><ul><li><p>1 żyłka</p></li><li><p>2 stopery</p></li><li><p>1 klucz ułatwiający przykręcenie</p></li></ul><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami firmy KnitPro!</p><p>Metalowy kluczyk służy do dokręcenia żyłki z drutami, aby druty nie odkręciły się podczas pracy. Włóż końcówkę klucza przez mały otwór w gwincie i mocno dokręć drut, trzymając klucz w miejscu. Na tej stronie znajdziesz link do filmu.</p><p>Jeśli potrzebujesz drutów wymiennych bez żyłki możesz wykorzystać stopery i przykręcić je do żyłki. W ten sposób robótka pozostanie na żyłce, a ty możesz wykorzystać druty do innego projektu. Stopery przykręcasz do żyłki w taki sam sposób jak druty.</p><p><strong>Pssst! Zwróć uwagę, że podana długość to całkowita długość żyłki z drutami:</strong>\n</p><p></p><p>40 cm: żyłka ma 20 cm długości bez drutów\n50 cm: żyłka ma 28 cm długości bez drutów\n60 cm: żyłka ma 35 cm długości bez drutów\n80 cm: żyłka ma 56 cm długości bez drutów\n100 cm: żyłka ma 76 cm długości bez drutów\n120 cm: żyłka ma 94 cm długości bez drutów\n150 cm: żyłka ma 126 cm długości bez drutów</p><p></p>', '', 'zylka-do-wymiennych-drutow', '', '', '', 'Żyłka do wymiennych drutów', '', '', '', ''),
(10357, 1, 2, '<p>Fantastyczny zestaw nylonowych żyłek firmy Knitpro. Żyłki są wytrzymałe, elastyczne i dostępne w fioletowym kolorze. Zakończone gwintem zapewniającym gładkie i płynne połączenie z drutami.</p><p><strong>W zestawie znajduje się:</strong></p><ul><li><p>1 żyłka</p></li><li><p>2 stopery</p></li><li><p>1 klucz ułatwiający przykręcenie</p></li></ul><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami firmy KnitPro!</p><p>Metalowy kluczyk służy do dokręcenia żyłki z drutami, aby druty nie odkręciły się podczas pracy. Włóż końcówkę klucza przez mały otwór w gwincie i mocno dokręć drut, trzymając klucz w miejscu. Na tej stronie znajdziesz link do filmu.</p><p>Jeśli potrzebujesz drutów wymiennych bez żyłki możesz wykorzystać stopery i przykręcić je do żyłki. W ten sposób robótka pozostanie na żyłce, a ty możesz wykorzystać druty do innego projektu. Stopery przykręcasz do żyłki w taki sam sposób jak druty.</p><p><strong>Pssst! Zwróć uwagę, że podana długość to całkowita długość żyłki z drutami:</strong>\n</p><p></p><p>40 cm: żyłka ma 20 cm długości bez drutów\n50 cm: żyłka ma 28 cm długości bez drutów\n60 cm: żyłka ma 35 cm długości bez drutów\n80 cm: żyłka ma 56 cm długości bez drutów\n100 cm: żyłka ma 76 cm długości bez drutów\n120 cm: żyłka ma 94 cm długości bez drutów\n150 cm: żyłka ma 126 cm długości bez drutów</p><p></p>', '', 'zylka-do-wymiennych-drutow', '', '', '', 'Żyłka do wymiennych drutów', '', '', '', ''),
(10358, 1, 1, '<p>Rozpocznij swój projekt dziewiarski z serią bambusowych drutów Hobbii. Druty wykonane są z bambusa Moso, dzięki czemu są zarówno mocne, jak i lekkie. Bambus Moso jest jednym z najpopularniejszych gatunków bambusa na świecie, dzięki swojej wytrzymałości i szybkości wzrostu. Druty mają gładką powierzchnię, a rozmiar jest nadrukowany laserowo na końcówkach. Zdecydowanie uważamy, że zaletą jest to, że rozmiar nie ściera się po krótkim okresie użytkowania, jak to często bywa.\n</p><p>Stylowe, czarne żyłki wykonane są ze stali nierdzewnej i pokryte poliamidem. Są bardzo dobre w utrzymywaniu kształtu i zawsze się prostują, gdy są używane, i nie skręcają się. Ponieważ żyłki są bardziej sztywne (w przeciwieństwie do np. żyłek nylonowych) nadal można ich używać do techniki magic-loop, jeśli kupisz druty na żyłce o długości 80 cm.\n</p><p>Życzymy przyjemnego dziergania nowymi drutami :-)</p>', '', 'bamboo-druty-na-zylce-80-cm', '', '', '', 'Bamboo Druty na żyłce - 80 cm', '', '', '', ''),
(10358, 1, 2, '<p>Rozpocznij swój projekt dziewiarski z serią bambusowych drutów Hobbii. Druty wykonane są z bambusa Moso, dzięki czemu są zarówno mocne, jak i lekkie. Bambus Moso jest jednym z najpopularniejszych gatunków bambusa na świecie, dzięki swojej wytrzymałości i szybkości wzrostu. Druty mają gładką powierzchnię, a rozmiar jest nadrukowany laserowo na końcówkach. Zdecydowanie uważamy, że zaletą jest to, że rozmiar nie ściera się po krótkim okresie użytkowania, jak to często bywa.\n</p><p>Stylowe, czarne żyłki wykonane są ze stali nierdzewnej i pokryte poliamidem. Są bardzo dobre w utrzymywaniu kształtu i zawsze się prostują, gdy są używane, i nie skręcają się. Ponieważ żyłki są bardziej sztywne (w przeciwieństwie do np. żyłek nylonowych) nadal można ich używać do techniki magic-loop, jeśli kupisz druty na żyłce o długości 80 cm.\n</p><p>Życzymy przyjemnego dziergania nowymi drutami :-)</p>', '', 'bamboo-druty-na-zylce-80-cm', '', '', '', 'Bamboo Druty na żyłce - 80 cm', '', '', '', ''),
(10359, 1, 1, '<p>Druty wymienne z serii Symfonie od KnitPro to połączenie wytrzymałości z ładnym designem. Druty są wygodne, praktyczne i doceniane na całym świecie. Wykonane z brzozy i laminowane, mają gładką powierzchnię i wygodnie leżą w dłoniach. Możesz z nimi pracować długimi godzinami bez uczucia bólu.</p>', '', 'wymienne-druty-brzozowe-symfonie', '', '', '', 'Wymienne druty brzozowe Symfonie', '', '', '', ''),
(10359, 1, 2, '<p>Druty wymienne z serii Symfonie od KnitPro to połączenie wytrzymałości z ładnym designem. Druty są wygodne, praktyczne i doceniane na całym świecie. Wykonane z brzozy i laminowane, mają gładką powierzchnię i wygodnie leżą w dłoniach. Możesz z nimi pracować długimi godzinami bez uczucia bólu.</p>', '', 'wymienne-druty-brzozowe-symfonie', '', '', '', 'Wymienne druty brzozowe Symfonie', '', '', '', ''),
(10360, 1, 1, '<p>Pojedyncze druty w pięknych pastelowych kolorach. Zaprojektowane przez Hobbii i wykonane z tworzywa sztucznego, dzięki czemu są wyjątkowo lekkie. Idealnie sprawdzą się do różnego rodzaju robótek ręcznych, ale najbardziej do tych, które należy przerabiać w tę i z powrotem.</p><p>Główki drutów z nabitą numeracją zapobiegają zsuwaniu się oczek. Życzymy przyjemnego dziergania :-)</p>', '', 'druty-pojedyncze', '', '', '', 'Druty pojedyncze', '', '', '', ''),
(10360, 1, 2, '<p>Pojedyncze druty w pięknych pastelowych kolorach. Zaprojektowane przez Hobbii i wykonane z tworzywa sztucznego, dzięki czemu są wyjątkowo lekkie. Idealnie sprawdzą się do różnego rodzaju robótek ręcznych, ale najbardziej do tych, które należy przerabiać w tę i z powrotem.</p><p>Główki drutów z nabitą numeracją zapobiegają zsuwaniu się oczek. Życzymy przyjemnego dziergania :-)</p>', '', 'druty-pojedyncze', '', '', '', 'Druty pojedyncze', '', '', '', ''),
(10361, 1, 1, '<p>Zestaw nylonowych żyłek firmy Knitpro. Dostępne w różnych kombinacjach kolorystycznych, wytrzymałe i elastyczne. Zakończone gwintem zapewniającym gładkie i płynne połączenie z drutami.\n</p><p><strong>W zestawie znajduje się:</strong></p><ul><li><p>1 żyłka</p></li><li><p>2 stopery</p></li><li><p>1 klucz ułatwiający przykręcenie</p></li></ul><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami firmy KnitPro!</p><p>Metalowy kluczyk służy do dokręcenia żyłki z drutami, aby druty nie odkręciły się podczas pracy. Włóż końcówkę klucza przez mały otwór w gwincie i mocno dokręć drut, trzymając klucz w miejscu. Na tej stronie znajdziesz link do filmu.</p><p>Jeśli potrzebujesz drutów wymiennych bez żyłki możesz wykorzystać stopery i przykręcić je do żyłki. W ten sposób robótka pozostanie na żyłce, a ty możesz wykorzystać druty do innego projektu. Stopery przykręcasz do żyłki w taki sam sposób jak druty.</p><p><strong>Pssst! Zwróć uwagę, że podana długość to całkowita długość żyłki z drutami:</strong>\n</p><p></p><p>40 cm: żyłka ma 20 cm długości bez drutów\n50 cm: żyłka ma 28 cm długości bez drutów\n60 cm: żyłka ma 35 cm długości bez drutów\n80 cm: żyłka ma 56 cm długości bez drutów\n100 cm: żyłka ma 76 cm długości bez drutów\n120 cm: żyłka ma 94 cm długości bez drutów\n150 cm: żyłka ma 126 cm długości bez drutów</p>', '', 'zylka-do-wymiennych-drutow', '', '', '', 'Żyłka do wymiennych drutów', '', '', '', ''),
(10361, 1, 2, '<p>Zestaw nylonowych żyłek firmy Knitpro. Dostępne w różnych kombinacjach kolorystycznych, wytrzymałe i elastyczne. Zakończone gwintem zapewniającym gładkie i płynne połączenie z drutami.\n</p><p><strong>W zestawie znajduje się:</strong></p><ul><li><p>1 żyłka</p></li><li><p>2 stopery</p></li><li><p>1 klucz ułatwiający przykręcenie</p></li></ul><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami firmy KnitPro!</p><p>Metalowy kluczyk służy do dokręcenia żyłki z drutami, aby druty nie odkręciły się podczas pracy. Włóż końcówkę klucza przez mały otwór w gwincie i mocno dokręć drut, trzymając klucz w miejscu. Na tej stronie znajdziesz link do filmu.</p><p>Jeśli potrzebujesz drutów wymiennych bez żyłki możesz wykorzystać stopery i przykręcić je do żyłki. W ten sposób robótka pozostanie na żyłce, a ty możesz wykorzystać druty do innego projektu. Stopery przykręcasz do żyłki w taki sam sposób jak druty.</p><p><strong>Pssst! Zwróć uwagę, że podana długość to całkowita długość żyłki z drutami:</strong>\n</p><p></p><p>40 cm: żyłka ma 20 cm długości bez drutów\n50 cm: żyłka ma 28 cm długości bez drutów\n60 cm: żyłka ma 35 cm długości bez drutów\n80 cm: żyłka ma 56 cm długości bez drutów\n100 cm: żyłka ma 76 cm długości bez drutów\n120 cm: żyłka ma 94 cm długości bez drutów\n150 cm: żyłka ma 126 cm długości bez drutów</p>', '', 'zylka-do-wymiennych-drutow', '', '', '', 'Żyłka do wymiennych drutów', '', '', '', ''),
(10362, 1, 1, '<p>BARDZO KRÓTKIE wymienne druty na żyłce firmy KnitPro to pozycja obowiązkowa dla tych, którzy potrzebują alternatywy dla drutów pończoszniczych podczas robienia bardzo małych obwodów. Dzięki nim możesz robić rękawy, skarpety, rękawiczki itp. bez użycia drutów pończoszniczych lub metody magic-loop. Wspaniale – dzierganie będzie wyjątkowo szybkie :-)\n</p><p>Druty mają zaledwie 5 cm długości, a łącząc je z krótkimi żyłkami uzyskasz obwód wynoszący zaledwie 26 cm!! Potrzebne żyłki są również bardzo krótkie i można je kupić jako zestaw zawierający dwie żyłki. Link do żyłek znajdziesz na tej stronie.</p><p>Podobnie jak drewniane druty dziewiarskie Symfonie firmy KnitPro, druty te są mocne, gładkie i mają bardzo precyzyjną końcówkę, która jest idealna do wszystkich rodzajów włóczki.</p>', '', 'denim-bardzo-krotkie-wymienne-druty-na-zylce', '', '', '', 'DENIM Bardzo Krótkie Wymienne Druty na żyłce', '', '', '', ''),
(10362, 1, 2, '<p>BARDZO KRÓTKIE wymienne druty na żyłce firmy KnitPro to pozycja obowiązkowa dla tych, którzy potrzebują alternatywy dla drutów pończoszniczych podczas robienia bardzo małych obwodów. Dzięki nim możesz robić rękawy, skarpety, rękawiczki itp. bez użycia drutów pończoszniczych lub metody magic-loop. Wspaniale – dzierganie będzie wyjątkowo szybkie :-)\n</p><p>Druty mają zaledwie 5 cm długości, a łącząc je z krótkimi żyłkami uzyskasz obwód wynoszący zaledwie 26 cm!! Potrzebne żyłki są również bardzo krótkie i można je kupić jako zestaw zawierający dwie żyłki. Link do żyłek znajdziesz na tej stronie.</p><p>Podobnie jak drewniane druty dziewiarskie Symfonie firmy KnitPro, druty te są mocne, gładkie i mają bardzo precyzyjną końcówkę, która jest idealna do wszystkich rodzajów włóczki.</p>', '', 'denim-bardzo-krotkie-wymienne-druty-na-zylce', '', '', '', 'DENIM Bardzo Krótkie Wymienne Druty na żyłce', '', '', '', ''),
(10363, 1, 1, '<p>Ładne i wytrzymałe druty od KnitPro wykonane z drewna brzozy, które poddane zostało laminowaniu i barwieniu, czego rezultatem końcowym jest gładka i ładna powierzchnia. KnitPro, jedna z wiodących marek w świecie szydełkowania i robienia na drutach, stworzyła te druty z myślą o osobach, które cenią wygodę i komfort pracy. Druty te są tak dobrej jakości, że możesz z nimi pracować nawet przez długie godziny bez uczucia bólu.\n</p><p>Całkowita długość: 40 cm\nDługość drutów:\n2-7 mm = 8,5 cm\n8 mm = 9,5 cm\n</p>', '', 'druty-na-zylce-symfonie-40-cm', '', '', '', 'Druty na żyłce Symfonie - 40 cm', '', '', '', ''),
(10363, 1, 2, '<p>Ładne i wytrzymałe druty od KnitPro wykonane z drewna brzozy, które poddane zostało laminowaniu i barwieniu, czego rezultatem końcowym jest gładka i ładna powierzchnia. KnitPro, jedna z wiodących marek w świecie szydełkowania i robienia na drutach, stworzyła te druty z myślą o osobach, które cenią wygodę i komfort pracy. Druty te są tak dobrej jakości, że możesz z nimi pracować nawet przez długie godziny bez uczucia bólu.\n</p><p>Całkowita długość: 40 cm\nDługość drutów:\n2-7 mm = 8,5 cm\n8 mm = 9,5 cm\n</p>', '', 'druty-na-zylce-symfonie-40-cm', '', '', '', 'Druty na żyłce Symfonie - 40 cm', '', '', '', ''),
(10364, 1, 1, '<p>Ginger krótkie wymienne druty na żyłce są dostępne w szerokiej gamie rozmiarów i pasują do każdego projektu dziewiarskiego. Krótkie druty to doskonała inwestycja, jeśli chcesz mieć druty na żyłce o mniejszym obwodzie – około 40 cm.</p><p>Druty mają najpiękniejszy, ciepły, ciemny kolor i są wykonane z klejonego drewna brzozowego. Końcówki są dopracowane do perfekcji i sprawiają, że robienie na drutach jest dziecinnie proste.</p><p>Te Ginger druty są kompatybilne ze wszystkimi żyłkami KnitPro.</p><p><strong>Materiał</strong>: Brzoza\n<strong>Długość drutów 3 - 6 mm</strong>: 8,5 cm\n<strong>Długość drutów 6,5 - 12 mm:</strong> 10 cm\n</p>', '', 'ginger-krotkie-wymienne-druty-na-zylce-brzoza', '', '', '', 'Ginger – Krótkie Wymienne Druty na żyłce – Brzoza', '', '', '', ''),
(10364, 1, 2, '<p>Ginger krótkie wymienne druty na żyłce są dostępne w szerokiej gamie rozmiarów i pasują do każdego projektu dziewiarskiego. Krótkie druty to doskonała inwestycja, jeśli chcesz mieć druty na żyłce o mniejszym obwodzie – około 40 cm.</p><p>Druty mają najpiękniejszy, ciepły, ciemny kolor i są wykonane z klejonego drewna brzozowego. Końcówki są dopracowane do perfekcji i sprawiają, że robienie na drutach jest dziecinnie proste.</p><p>Te Ginger druty są kompatybilne ze wszystkimi żyłkami KnitPro.</p><p><strong>Materiał</strong>: Brzoza\n<strong>Długość drutów 3 - 6 mm</strong>: 8,5 cm\n<strong>Długość drutów 6,5 - 12 mm:</strong> 10 cm\n</p>', '', 'ginger-krotkie-wymienne-druty-na-zylce-brzoza', '', '', '', 'Ginger – Krótkie Wymienne Druty na żyłce – Brzoza', '', '', '', ''),
(10365, 1, 1, '<p>Te ładne, małe druty z żyłką od niemieckiego producenta addi sprawiają, że dzierganie skarpet, rękawów, rękawiczek i ubranek dziecięcych staje się prostsze. <strong>Sock Wonder Lace</strong> są asymetryczne, dzięki czemu łatwiej przerabia się robótki dookoła, których obwód jest niewielki. Dłuższy z drutów ma 70, a krótszy 45 mm. Praworęczni powinni dziergać trzymając dłuższy w prawej ręce i krótszy w lewej, leworęczni oczywiście na odwrót. Dzięki tym przyborom zyskasz możliwość wykonania całej skarpetki bez zmiany drutów. Żyłka jest taka sama jak w innych zestawach od addi, gładka i lekka, ale ma tylko 13,5 cm długości. Całość wykonano w tak rewelacyjny sposób, a druty tak płynnie łączą się z żyłką, że wciąż ma się ochotę na tworzenie nowych robótek.</p><p>Długi drut ma końcówkę LACE, dzięki czemu jest ostrzejszy i cieńszy niż krótka końcówka.</p><p>Siedziba addi znajduje się w Niemczech, tam też wytwarzane są ich produkty. Przybory z tej firmy mają gwarancję jakości i długiej wytrzymałości! Nie zawierają niklu i mogą być używane przez alergików.\n</p><p><strong>Materiał</strong>: mosiądz niezawierający niklu\n<strong>Długość żyłki</strong>: 13,5 cm\n<strong>Długość drutów</strong>: 45 mm i 70 mm\n<strong>Grubość drutów</strong>: 2,0 - 2,5 - 3,0 - 3,5 - 4,0 - 4,5 - 5,0 mm</p>', '', 'sock-wonder-lace', '', '', '', 'Sock Wonder Lace', '', '', '', ''),
(10365, 1, 2, '<p>Te ładne, małe druty z żyłką od niemieckiego producenta addi sprawiają, że dzierganie skarpet, rękawów, rękawiczek i ubranek dziecięcych staje się prostsze. <strong>Sock Wonder Lace</strong> są asymetryczne, dzięki czemu łatwiej przerabia się robótki dookoła, których obwód jest niewielki. Dłuższy z drutów ma 70, a krótszy 45 mm. Praworęczni powinni dziergać trzymając dłuższy w prawej ręce i krótszy w lewej, leworęczni oczywiście na odwrót. Dzięki tym przyborom zyskasz możliwość wykonania całej skarpetki bez zmiany drutów. Żyłka jest taka sama jak w innych zestawach od addi, gładka i lekka, ale ma tylko 13,5 cm długości. Całość wykonano w tak rewelacyjny sposób, a druty tak płynnie łączą się z żyłką, że wciąż ma się ochotę na tworzenie nowych robótek.</p><p>Długi drut ma końcówkę LACE, dzięki czemu jest ostrzejszy i cieńszy niż krótka końcówka.</p><p>Siedziba addi znajduje się w Niemczech, tam też wytwarzane są ich produkty. Przybory z tej firmy mają gwarancję jakości i długiej wytrzymałości! Nie zawierają niklu i mogą być używane przez alergików.\n</p><p><strong>Materiał</strong>: mosiądz niezawierający niklu\n<strong>Długość żyłki</strong>: 13,5 cm\n<strong>Długość drutów</strong>: 45 mm i 70 mm\n<strong>Grubość drutów</strong>: 2,0 - 2,5 - 3,0 - 3,5 - 4,0 - 4,5 - 5,0 mm</p>', '', 'sock-wonder-lace', '', '', '', 'Sock Wonder Lace', '', '', '', ''),
(10366, 1, 1, '<p>Rozpocznij swój projekt dziewiarski z serią bambusowych drutów Hobbii. Druty wykonane są z bambusa Moso, dzięki czemu są zarówno mocne, jak i lekkie. Bambus Moso jest jednym z najpopularniejszych gatunków bambusa na świecie, dzięki swojej wytrzymałości i szybkości wzrostu. Druty mają gładką powierzchnię, a rozmiar jest nadrukowany laserowo na końcówkach. Zdecydowanie uważamy, że zaletą jest to, że rozmiar nie ściera się po krótkim okresie użytkowania, jak to często bywa.\n</p><p>Stylowe czarne żyłki wykonane są ze stali nierdzewnej i pokryte poliamidem. Są bardzo dobre w utrzymywaniu kształtu i zawsze się prostują, gdy są używane, i nie skręcają się. Ponieważ żyłki są bardziej sztywne (w przeciwieństwie do np. żyłek nylonowych) nie zalecamy używania ich do techniki magic-loop przy tej długości. Jeśli chcesz użyć naszych Bamboo Drutów na żyłce do techniki magic-loop, zalecamy zakup ich w długości 80 cm, do których link znajdziesz tutaj na stornie.\n</p><p>Życzymy przyjemnego dziergania nowymi drutami :-)</p>', '', 'bamboo-druty-na-zylce-60-cm', '', '', '', 'Bamboo Druty na żyłce - 60 cm', '', '', '', ''),
(10366, 1, 2, '<p>Rozpocznij swój projekt dziewiarski z serią bambusowych drutów Hobbii. Druty wykonane są z bambusa Moso, dzięki czemu są zarówno mocne, jak i lekkie. Bambus Moso jest jednym z najpopularniejszych gatunków bambusa na świecie, dzięki swojej wytrzymałości i szybkości wzrostu. Druty mają gładką powierzchnię, a rozmiar jest nadrukowany laserowo na końcówkach. Zdecydowanie uważamy, że zaletą jest to, że rozmiar nie ściera się po krótkim okresie użytkowania, jak to często bywa.\n</p><p>Stylowe czarne żyłki wykonane są ze stali nierdzewnej i pokryte poliamidem. Są bardzo dobre w utrzymywaniu kształtu i zawsze się prostują, gdy są używane, i nie skręcają się. Ponieważ żyłki są bardziej sztywne (w przeciwieństwie do np. żyłek nylonowych) nie zalecamy używania ich do techniki magic-loop przy tej długości. Jeśli chcesz użyć naszych Bamboo Drutów na żyłce do techniki magic-loop, zalecamy zakup ich w długości 80 cm, do których link znajdziesz tutaj na stornie.\n</p><p>Życzymy przyjemnego dziergania nowymi drutami :-)</p>', '', 'bamboo-druty-na-zylce-60-cm', '', '', '', 'Bamboo Druty na żyłce - 60 cm', '', '', '', ''),
(10367, 1, 1, '<p>Karbonz to seria produktów wykonanych z lekkich i eleganckich włókien węglowych. Druty zostały dodatkowo wzmocnione na końcówkach mosiądzem, dzięki czemu łatwo prześlizgują się one między oczkami, niezależnie od tego z jaką włóczką pracujesz.\n</p><p>Druty dostępne są w rozmiarach 1-6 mm oraz w długościach 15 cm i 20 cm</p><p>Pssst! Zwróć uwagę, że rozmiary 1 mm oraz 1,5 mm wykonane są wyłącznie z włókien węglowych i nie mają mosiężnych końcówek.</p>', '', 'druty-podwojne-karbonz', '', '', '', 'Druty podwójne Karbonz', '', '', '', ''),
(10367, 1, 2, '<p>Karbonz to seria produktów wykonanych z lekkich i eleganckich włókien węglowych. Druty zostały dodatkowo wzmocnione na końcówkach mosiądzem, dzięki czemu łatwo prześlizgują się one między oczkami, niezależnie od tego z jaką włóczką pracujesz.\n</p><p>Druty dostępne są w rozmiarach 1-6 mm oraz w długościach 15 cm i 20 cm</p><p>Pssst! Zwróć uwagę, że rozmiary 1 mm oraz 1,5 mm wykonane są wyłącznie z włókien węglowych i nie mają mosiężnych końcówek.</p>', '', 'druty-podwojne-karbonz', '', '', '', 'Druty podwójne Karbonz', '', '', '', ''),
(10368, 1, 1, '<p>Zing to super lekkie i gładkie druty wykonane z lekkiego metalu, który nadaje ładnego, metalicznego wykończenia. Aby ułatwić Ci znalezienie odpowiedniego rozmiaru, druty są oznaczone przy użyciu laseru.</p><p>Druty sprzedawane są w zestawach po 5 sztuk.</p><p>\n</p>', '', 'druty-podwojne-zing', '', '', '', 'Druty podwójne Zing', '', '', '', ''),
(10368, 1, 2, '<p>Zing to super lekkie i gładkie druty wykonane z lekkiego metalu, który nadaje ładnego, metalicznego wykończenia. Aby ułatwić Ci znalezienie odpowiedniego rozmiaru, druty są oznaczone przy użyciu laseru.</p><p>Druty sprzedawane są w zestawach po 5 sztuk.</p><p>\n</p>', '', 'druty-podwojne-zing', '', '', '', 'Druty podwójne Zing', '', '', '', ''),
(10369, 1, 1, '<p>addi Crasy Trio umożliwia bezproblemowe wykonanie nawet najmniejszej średnicy. Jeśli chcesz wydziergać na drutach skarpety, rękawy lub coś innego o małej średnicy, możesz teraz korzystać zaledwie z trzech drutów. Druty te funkcjonują w taki sam sposób jak druty pończosznicze, gdzie dzielisz oczka na dwa druty a przerabiasz trzecim drutem. Końcówki drutów są wykonane z metalu i mierzą 8,5 cm, i są połączone krótką elastyczną żyłką pośrodku. Każdy drut mierzy w sumie 21 cm. Elastyczny środek sprawia, że druty dobrze leżą w dłoni i można je zgiąć, aby nie przeszkadzały. To fajny i nieco inny sposób dziergania.</p><p>addi Crasy Trio ma zwykłą końcówkę na jednym końcu i LACE końcówkę na drugim końcu, co sprawia że są idealne do wszelkiego typu włóczek. Druty można również korzystnie używać przy dzierganiu warkoczy.</p><p>Druty nie zawierają niklu i jeśli masz wątpliwości jak ich używać, w każdym opakowaniu znajduje się przewodnik (UWAGA: przewodnik jest tylko w języku angielskim i niemieckim, ale addi dodał kilka łatwych do zrozumienia zdjęć).</p><p><strong>Długość</strong>: 21 cm\n<strong>Rozmiary</strong>: 2,0 - 2,25 - 2,5 - 2,75 - 3,0 - 3,25 - 3,5 - 4,0 - 4,5 - 5,0\n</p>', '', 'crasy-trio', '', '', '', 'Crasy Trio', '', '', '', ''),
(10369, 1, 2, '<p>addi Crasy Trio umożliwia bezproblemowe wykonanie nawet najmniejszej średnicy. Jeśli chcesz wydziergać na drutach skarpety, rękawy lub coś innego o małej średnicy, możesz teraz korzystać zaledwie z trzech drutów. Druty te funkcjonują w taki sam sposób jak druty pończosznicze, gdzie dzielisz oczka na dwa druty a przerabiasz trzecim drutem. Końcówki drutów są wykonane z metalu i mierzą 8,5 cm, i są połączone krótką elastyczną żyłką pośrodku. Każdy drut mierzy w sumie 21 cm. Elastyczny środek sprawia, że druty dobrze leżą w dłoni i można je zgiąć, aby nie przeszkadzały. To fajny i nieco inny sposób dziergania.</p><p>addi Crasy Trio ma zwykłą końcówkę na jednym końcu i LACE końcówkę na drugim końcu, co sprawia że są idealne do wszelkiego typu włóczek. Druty można również korzystnie używać przy dzierganiu warkoczy.</p><p>Druty nie zawierają niklu i jeśli masz wątpliwości jak ich używać, w każdym opakowaniu znajduje się przewodnik (UWAGA: przewodnik jest tylko w języku angielskim i niemieckim, ale addi dodał kilka łatwych do zrozumienia zdjęć).</p><p><strong>Długość</strong>: 21 cm\n<strong>Rozmiary</strong>: 2,0 - 2,25 - 2,5 - 2,75 - 3,0 - 3,25 - 3,5 - 4,0 - 4,5 - 5,0\n</p>', '', 'crasy-trio', '', '', '', 'Crasy Trio', '', '', '', ''),
(10370, 1, 1, '<p>Kombinacja włókna węglowego z gładkim mosiądzem daje wyjątkowe doświadczenie pracy z drutami. Żyłka jest gładka, elastyczna i giętka, dzięki czemu nie pęknie gdy będziesz ją zwijać.\n</p><p>Końcówki są do tego wzmocnione mosiądzem niklowym - druty te nadadzą się dzięki temu na każdą włóczkę i na każdy projekt!</p><p>Druty dostępne są w długościach 40, 60, 80 i 100 cm, oraz w rozmiarach 2-8 mm.</p>', '', 'druty-na-zylce-karbonz', '', '', '', 'Druty na żyłce Karbonz', '', '', '', ''),
(10370, 1, 2, '<p>Kombinacja włókna węglowego z gładkim mosiądzem daje wyjątkowe doświadczenie pracy z drutami. Żyłka jest gładka, elastyczna i giętka, dzięki czemu nie pęknie gdy będziesz ją zwijać.\n</p><p>Końcówki są do tego wzmocnione mosiądzem niklowym - druty te nadadzą się dzięki temu na każdą włóczkę i na każdy projekt!</p><p>Druty dostępne są w długościach 40, 60, 80 i 100 cm, oraz w rozmiarach 2-8 mm.</p>', '', 'druty-na-zylce-karbonz', '', '', '', 'Druty na żyłce Karbonz', '', '', '', ''),
(10371, 1, 1, '<p>Praca tymi bambusowymi drutami podwójnymi jest wyjątkowo komfortowa – możesz pracować godzinami bez uczucia bólu w dłoniach! Druty mają ostre końcówki i są bardzo lekkie, dzięki czemu idealnie nadają się do wszystkich rodzajów włóczek i projektów.</p><p>Druty pończosznicze wykonane z bambusowego drewna Moso. Moso jest jednym z najpopularniejszych gatunków bambusa, ma unikalne właściwości wzrostu i jest znany jako najtwardszy bambus na świecie.</p>', '', 'druty-podwojne-bamboo', '', '', '', 'Druty podwójne Bamboo', '', '', '', ''),
(10371, 1, 2, '<p>Praca tymi bambusowymi drutami podwójnymi jest wyjątkowo komfortowa – możesz pracować godzinami bez uczucia bólu w dłoniach! Druty mają ostre końcówki i są bardzo lekkie, dzięki czemu idealnie nadają się do wszystkich rodzajów włóczek i projektów.</p><p>Druty pończosznicze wykonane z bambusowego drewna Moso. Moso jest jednym z najpopularniejszych gatunków bambusa, ma unikalne właściwości wzrostu i jest znany jako najtwardszy bambus na świecie.</p>', '', 'druty-podwojne-bamboo', '', '', '', 'Druty podwójne Bamboo', '', '', '', ''),
(10372, 1, 1, '<p>Ładne i wytrzymałe druty od KnitPro wykonane z drewna brzozy, które poddane zostało laminowaniu i barwieniu, czego rezultatem końcowym jest gładka i ładna powierzchnia. KnitPro, jedna z wiodących marek w świecie szydełkowania i robienia na drutach, stworzyła te druty z myślą o osobach, które cenią wygodę i komfort pracy. Druty te są tak dobrej jakości, że możesz z nimi pracować nawet przez długie godziny bez uczucia bólu.\n</p><p>Całkowita długość: 60 cm\nDługość drutów:\n2-9 mm = 12,8 cm\n12 mm = 14,3 cm\n</p>', '', 'druty-na-zylce-symfonie-60-cm', '', '', '', 'Druty na żyłce Symfonie 60 cm', '', '', '', ''),
(10372, 1, 2, '<p>Ładne i wytrzymałe druty od KnitPro wykonane z drewna brzozy, które poddane zostało laminowaniu i barwieniu, czego rezultatem końcowym jest gładka i ładna powierzchnia. KnitPro, jedna z wiodących marek w świecie szydełkowania i robienia na drutach, stworzyła te druty z myślą o osobach, które cenią wygodę i komfort pracy. Druty te są tak dobrej jakości, że możesz z nimi pracować nawet przez długie godziny bez uczucia bólu.\n</p><p>Całkowita długość: 60 cm\nDługość drutów:\n2-9 mm = 12,8 cm\n12 mm = 14,3 cm\n</p>', '', 'druty-na-zylce-symfonie-60-cm', '', '', '', 'Druty na żyłce Symfonie 60 cm', '', '', '', ''),
(10373, 1, 1, '<p>Te kanciaste druty wygodnie leżą w dłoniach i są łatwe do trzymania. Są dobrym wyborem dla wszystkich, ale zwłaszcza dla tych, którzy mają słabe nadgarstki lub cierpią na bóle stawów. Z tymi drutami ręce nie będą się tak szybko męczyć.\n</p><p>Seria Nova Cubics łączy najlepsze właściwości: wytrzymałość materiału oraz gładkość i odpowiednią formę drutów.</p><p>Druty dostępne są w 5 różnych długościach: 40, 60, 80, 100 i 120 cm, oraz w rozmiarach: 2,5-8 mm. Bez problemu znajdziesz taką długość i rozmiar, który pasuje akurat do Twojego projektu.</p>', '', 'druty-nova-cubics', '', '', '', 'Druty Nova Cubics', '', '', '', ''),
(10373, 1, 2, '<p>Te kanciaste druty wygodnie leżą w dłoniach i są łatwe do trzymania. Są dobrym wyborem dla wszystkich, ale zwłaszcza dla tych, którzy mają słabe nadgarstki lub cierpią na bóle stawów. Z tymi drutami ręce nie będą się tak szybko męczyć.\n</p><p>Seria Nova Cubics łączy najlepsze właściwości: wytrzymałość materiału oraz gładkość i odpowiednią formę drutów.</p><p>Druty dostępne są w 5 różnych długościach: 40, 60, 80, 100 i 120 cm, oraz w rozmiarach: 2,5-8 mm. Bez problemu znajdziesz taką długość i rozmiar, który pasuje akurat do Twojego projektu.</p>', '', 'druty-nova-cubics', '', '', '', 'Druty Nova Cubics', '', '', '', ''),
(10374, 1, 1, '<p>Oto seria drutów na żyłce z mosiądzu firmy addi. Addi jest znana z wyrobu produktów wysokiej jakości, a ich hasło ”Luksus dla rąk” jest prawdziwe. Te druty na żyłce są puste w środku, co pomaga lepiej kontrolować ciepło a druty nie są zimne. Pozatym druty są zauważalnie lekkie. Seria addiBasic ma gładkie końcówki, co sprawia, że druty są oczywiste w użyciu dla tych, którzy lubią przesuwać ściegi popychając palcem czubek drutów bez kłucia się.</p><p>Podsumowując, otrzymujesz druty, które dobrze leżą w dłoni i są bardzo wytrzymałe.\n</p><p>Druty te są idealne do wszelkiego typu projektów. Jest to naprawdę fantastyczny produkt idealnie nadający się do dziergania swetrów na okrągło. Druty mają gładkie mosiężne końcówki pokryte białym brązem, metal nie zawiera niklu, a przejście między drutem a żyłką jest jak marzenie i z pewnością włóczka nie będzie się haczyć. Więc Twój projekt zostanie zrobiony w mgnieniu oka! Z tego samego powodu wiele osób nadało tym drutom przydomek \"Turbo\".</p><p>Żyłka jest miękka, mocna i elastyczna. Żyłka jest pokryta plastikiem PVC w złotym kolorze a długość i rozmiar są nadrukowane bezpośrednio na żyłce. Według nas jest to świetne!</p><p>Te druty na żyłce są szczególnie dobre do przędz wełnianych!</p><p><strong>Długości</strong>: 40 cm - 60 cm - 80 cm\n<strong>Rozmiary</strong>: 2 - 15 mm\n<strong>Materiał</strong>: Mosiądz powleczony białym brązem bez niklu &amp; PVC-plastik\n<strong>Kolor</strong>: Srebrny &amp; Złoty</p><p>Siedziba addi oraz fabryki znajdują się w Niemczech.</p><p>\n</p>', '', 'druty-na-zylce-turbo', '', '', '', 'Druty na żyłce - Turbo', '', '', '', ''),
(10374, 1, 2, '<p>Oto seria drutów na żyłce z mosiądzu firmy addi. Addi jest znana z wyrobu produktów wysokiej jakości, a ich hasło ”Luksus dla rąk” jest prawdziwe. Te druty na żyłce są puste w środku, co pomaga lepiej kontrolować ciepło a druty nie są zimne. Pozatym druty są zauważalnie lekkie. Seria addiBasic ma gładkie końcówki, co sprawia, że druty są oczywiste w użyciu dla tych, którzy lubią przesuwać ściegi popychając palcem czubek drutów bez kłucia się.</p><p>Podsumowując, otrzymujesz druty, które dobrze leżą w dłoni i są bardzo wytrzymałe.\n</p><p>Druty te są idealne do wszelkiego typu projektów. Jest to naprawdę fantastyczny produkt idealnie nadający się do dziergania swetrów na okrągło. Druty mają gładkie mosiężne końcówki pokryte białym brązem, metal nie zawiera niklu, a przejście między drutem a żyłką jest jak marzenie i z pewnością włóczka nie będzie się haczyć. Więc Twój projekt zostanie zrobiony w mgnieniu oka! Z tego samego powodu wiele osób nadało tym drutom przydomek \"Turbo\".</p><p>Żyłka jest miękka, mocna i elastyczna. Żyłka jest pokryta plastikiem PVC w złotym kolorze a długość i rozmiar są nadrukowane bezpośrednio na żyłce. Według nas jest to świetne!</p><p>Te druty na żyłce są szczególnie dobre do przędz wełnianych!</p><p><strong>Długości</strong>: 40 cm - 60 cm - 80 cm\n<strong>Rozmiary</strong>: 2 - 15 mm\n<strong>Materiał</strong>: Mosiądz powleczony białym brązem bez niklu &amp; PVC-plastik\n<strong>Kolor</strong>: Srebrny &amp; Złoty</p><p>Siedziba addi oraz fabryki znajdują się w Niemczech.</p><p>\n</p>', '', 'druty-na-zylce-turbo', '', '', '', 'Druty na żyłce - Turbo', '', '', '', ''),
(10375, 1, 1, '<p>Druty te wykonane są z akrylu, który zwiększa wygodę pracy oraz ułatwia utrzymanie robótki pod kontrolą. Nawet włóczki, które ‘ślizgają’ się po innych szydełkach, na tym będą się dobrze zachowywać. Dlatego też druty te polecane są osobom początkującym.\n</p><p>Przejście między żyłką a drutami zostało zaprojektowane tak żeby łatwo je ze sobą połączyć a jednocześnie zapewnić oczkom gładkie przejście z drutów na żyłkę.</p><p>Druty dostępne są w rozmiarach 3,5-12 mm, gdzie każdy rozmiar ma swój własny kolor.</p><p>Druty Trendz to wysoka jakość za przystępną cenę.</p><p>Długość drutów: 11,6 cm (13 cm od rozmiaru 9 mm)\n</p>', '', 'wymienne-druty-na-zylce-trendz', '', '', '', 'Wymienne druty na żyłce Trendz', '', '', '', ''),
(10375, 1, 2, '<p>Druty te wykonane są z akrylu, który zwiększa wygodę pracy oraz ułatwia utrzymanie robótki pod kontrolą. Nawet włóczki, które ‘ślizgają’ się po innych szydełkach, na tym będą się dobrze zachowywać. Dlatego też druty te polecane są osobom początkującym.\n</p><p>Przejście między żyłką a drutami zostało zaprojektowane tak żeby łatwo je ze sobą połączyć a jednocześnie zapewnić oczkom gładkie przejście z drutów na żyłkę.</p><p>Druty dostępne są w rozmiarach 3,5-12 mm, gdzie każdy rozmiar ma swój własny kolor.</p><p>Druty Trendz to wysoka jakość za przystępną cenę.</p><p>Długość drutów: 11,6 cm (13 cm od rozmiaru 9 mm)\n</p>', '', 'wymienne-druty-na-zylce-trendz', '', '', '', 'Wymienne druty na żyłce Trendz', '', '', '', ''),
(10376, 1, 1, '<p>Druty wymienne z serii Symfonie od KnitPro to połączenie wytrzymałości z ładnym designem. Druty są wygodne, praktyczne i doceniane na całym świecie. Wykonane z brzozy i laminowane, mają gładką powierzchnię i wygodnie leżą w dłoniach. Możesz z nimi pracować długimi godzinami bez uczucia bólu.\n</p><p>Druty są długości 8,6 cm (bez żyłki)</p>', '', 'krotkie-wymienne-druty-brzozowe-symfonie', '', '', '', 'Krótkie wymienne druty brzozowe Symfonie', '', '', '', ''),
(10376, 1, 2, '<p>Druty wymienne z serii Symfonie od KnitPro to połączenie wytrzymałości z ładnym designem. Druty są wygodne, praktyczne i doceniane na całym świecie. Wykonane z brzozy i laminowane, mają gładką powierzchnię i wygodnie leżą w dłoniach. Możesz z nimi pracować długimi godzinami bez uczucia bólu.\n</p><p>Druty są długości 8,6 cm (bez żyłki)</p>', '', 'krotkie-wymienne-druty-brzozowe-symfonie', '', '', '', 'Krótkie wymienne druty brzozowe Symfonie', '', '', '', ''),
(10377, 1, 1, '<p></p><p>Wspaniałe i klasyczne druty na żyłce o dł. 60 cm firmy Pony. Najmniejsze rozmiary drutów (do 7 mm włącznie) są wykonane z metalu, dzięki czemu są wyjątkowo trwałe. Natomiast większe rozmiary są wykonane z plastiku, dzięki czemu są lekkie i wygodne podczas pracy. Żyłka jest przezroczysta i bardzo elastyczna, a na każdym drucie nadrukowano wyraźne rozmiary.</p><p>\n</p><p>Cechą charakterystyczną tych klasycznych drutów na żyłce od Pony jest to, że oczka ślizgają się po nich jak marzenie! Druty zawierają specjalnie opatentowane przez firmę PONY łączenie drutów z żyłką typu GLYDON, które zapobiega haczeniu się włóczki.</p><p>Złącze-Glydon nie jest dostępne w małych rozmiarach, ale zaczyna się od 3 mm.</p><p>\n</p><p><strong>Rozmiary</strong>: od 2,0 do 15,0 mm</p><p>\n</p>', '', 'drut-na-zylce-60-cm', '', '', '', 'Drut na żyłce 60 cm', '', '', '', ''),
(10377, 1, 2, '<p></p><p>Wspaniałe i klasyczne druty na żyłce o dł. 60 cm firmy Pony. Najmniejsze rozmiary drutów (do 7 mm włącznie) są wykonane z metalu, dzięki czemu są wyjątkowo trwałe. Natomiast większe rozmiary są wykonane z plastiku, dzięki czemu są lekkie i wygodne podczas pracy. Żyłka jest przezroczysta i bardzo elastyczna, a na każdym drucie nadrukowano wyraźne rozmiary.</p><p>\n</p><p>Cechą charakterystyczną tych klasycznych drutów na żyłce od Pony jest to, że oczka ślizgają się po nich jak marzenie! Druty zawierają specjalnie opatentowane przez firmę PONY łączenie drutów z żyłką typu GLYDON, które zapobiega haczeniu się włóczki.</p><p>Złącze-Glydon nie jest dostępne w małych rozmiarach, ale zaczyna się od 3 mm.</p><p>\n</p><p><strong>Rozmiary</strong>: od 2,0 do 15,0 mm</p><p>\n</p>', '', 'drut-na-zylce-60-cm', '', '', '', 'Drut na żyłce 60 cm', '', '', '', ''),
(10378, 1, 1, '<p>Druty pończosznicze z serii Basix firmy KnitPro wykonane są z drewna bukowego. Podkreślają naturalne właściwości i wytrzymałość drewna oraz mają ładny, jasny kolor.\n</p><p>Dostępne w szerokiej gamie rozmiarów, dzięki czemu sprawdzą się do wielu projektów. Skarpetki, czapki, kominy, rękawy.</p><p>Przyjemny, naturalny materiał, jednocześnie lekki i mocny, sprawia, że druty są wygodne w użyciu i pozwalają na dzierganie przez kilka godzin bez bólu rąk.</p><p>Druty sprzedawane są w zestawach po 5 sztuk w tym samym rozmiarze.</p><p>Materiał: Buk</p>', '', 'basix-druty-ponczosznicze', '', '', '', 'Basix Druty pończosznicze', '', '', '', ''),
(10378, 1, 2, '<p>Druty pończosznicze z serii Basix firmy KnitPro wykonane są z drewna bukowego. Podkreślają naturalne właściwości i wytrzymałość drewna oraz mają ładny, jasny kolor.\n</p><p>Dostępne w szerokiej gamie rozmiarów, dzięki czemu sprawdzą się do wielu projektów. Skarpetki, czapki, kominy, rękawy.</p><p>Przyjemny, naturalny materiał, jednocześnie lekki i mocny, sprawia, że druty są wygodne w użyciu i pozwalają na dzierganie przez kilka godzin bez bólu rąk.</p><p>Druty sprzedawane są w zestawach po 5 sztuk w tym samym rozmiarze.</p><p>Materiał: Buk</p>', '', 'basix-druty-ponczosznicze', '', '', '', 'Basix Druty pończosznicze', '', '', '', ''),
(10379, 1, 1, '<p>Druty na żyłce wykonane z najlepszej jakości bambusa z Japonii - praca z nimi to czysta przyjemność!</p><p>Żyłka jest bardzo gładka, dzięki czemu oczka łatwo przemieszczają się i nie ‘zatrzymują się’ na złączeniu drutów z żyłką. Co więcej, żyłka jest złocona co nadaje jej luksusowy wygląd. Jest ona zarazem elastyczna i wytrzymała, i może być złożona bez ryzyka, że w którymś miejscu się ‘nadłamie’.</p><p>Bambus z kolei znany jest ze swej wytrzymałości i lekkości. Lekkość sprawia, że z drutami łatwo się pracuje i że możesz je mieć w dłoniach przez długie godziny bez uczucia bólu. Druty te są dobrym wyborem dla osób początkujących jako że łatwo się je trzyma, przez co łatwiej jest mieć kontrolę nad robótką.</p>', '', 'druty-na-zylce-bamboo', '', '', '', 'Druty na żyłce Bamboo', '', '', '', ''),
(10379, 1, 2, '<p>Druty na żyłce wykonane z najlepszej jakości bambusa z Japonii - praca z nimi to czysta przyjemność!</p><p>Żyłka jest bardzo gładka, dzięki czemu oczka łatwo przemieszczają się i nie ‘zatrzymują się’ na złączeniu drutów z żyłką. Co więcej, żyłka jest złocona co nadaje jej luksusowy wygląd. Jest ona zarazem elastyczna i wytrzymała, i może być złożona bez ryzyka, że w którymś miejscu się ‘nadłamie’.</p><p>Bambus z kolei znany jest ze swej wytrzymałości i lekkości. Lekkość sprawia, że z drutami łatwo się pracuje i że możesz je mieć w dłoniach przez długie godziny bez uczucia bólu. Druty te są dobrym wyborem dla osób początkujących jako że łatwo się je trzyma, przez co łatwiej jest mieć kontrolę nad robótką.</p>', '', 'druty-na-zylce-bamboo', '', '', '', 'Druty na żyłce Bamboo', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(10380, 1, 1, '<p>Te wymienne druty pasują do żyłek o długości 20 cm (dając całkowitą długość 40 cm) i mogą być do nich łatwo przymocowane dzięki innowacyjnemu designowi. Przejście między drutami a żyłką jest jednocześnie bardzo gładkie, co zapewnia sprawne prześlizgnięcie się oczek z drutów na żyłkę. Druty wykonane są z mosiądzu pustego w środku i mają wypolerowaną powierzchnię, dzięki czemu praca z nimi to czysta przyjemność.\n</p><p>Końcówki drutów stopniowo się zaostrzają, co sprawia, że druty nadają się na różnego rodzaju projekty.</p><p>Mosiądz ma wiele zalet m.in. lekkość i wytrzymałość. Lekkość sprawia, że z drutami wygodnie się pracuje nawet przez wiele godzin bez uczucia bólu.</p><p>Długość drutów: 8.6 cm\nMateriał: Mosiądz</p>', '', 'wymienne-krotkie-druty-na-zylce-nova', '', '', '', 'Wymienne krótkie druty na żyłce Nova', '', '', '', ''),
(10380, 1, 2, '<p>Te wymienne druty pasują do żyłek o długości 20 cm (dając całkowitą długość 40 cm) i mogą być do nich łatwo przymocowane dzięki innowacyjnemu designowi. Przejście między drutami a żyłką jest jednocześnie bardzo gładkie, co zapewnia sprawne prześlizgnięcie się oczek z drutów na żyłkę. Druty wykonane są z mosiądzu pustego w środku i mają wypolerowaną powierzchnię, dzięki czemu praca z nimi to czysta przyjemność.\n</p><p>Końcówki drutów stopniowo się zaostrzają, co sprawia, że druty nadają się na różnego rodzaju projekty.</p><p>Mosiądz ma wiele zalet m.in. lekkość i wytrzymałość. Lekkość sprawia, że z drutami wygodnie się pracuje nawet przez wiele godzin bez uczucia bólu.</p><p>Długość drutów: 8.6 cm\nMateriał: Mosiądz</p>', '', 'wymienne-krotkie-druty-na-zylce-nova', '', '', '', 'Wymienne krótkie druty na żyłce Nova', '', '', '', ''),
(10381, 1, 1, '<p>Jeśli kochasz kolory, spójrz na te śliczne druty pończosznicze. Są wykonane z aluminium i mają ładny metaliczny wygląd od czubka do czubka. Każdy rozmiar ma swój piękny kolor, więc znalezienie odpowiedniego zestawu nie zajmie dużo czasu.\n</p><p>Druty pończosznicze o długości 20 cm są idealne do małych obwodów, takich jak skarpety czy rękawy. Nie są ani za długie, ani za krótkie, dzięki czemu wygodnie się nimi pracuje i nie musisz się obawiać, że spadną z nich oczka.</p><p>Tutaj otrzymasz zestaw lekkich i wytrzymałych drutów dziewiarskich, które dzięki gładkiej powierzchni zapewniają komfortową pracę. Mają spiczaste końcówki, ale z zaokrągleniem, które sprawia, że oczka łatwo przesuwają się po drutach.</p><p>Z pewnością pokochasz te druty pończosznicze!</p>', '', 'alu-druty-ponczosznicze', '', '', '', 'Alu Druty Pończosznicze', '', '', '', ''),
(10381, 1, 2, '<p>Jeśli kochasz kolory, spójrz na te śliczne druty pończosznicze. Są wykonane z aluminium i mają ładny metaliczny wygląd od czubka do czubka. Każdy rozmiar ma swój piękny kolor, więc znalezienie odpowiedniego zestawu nie zajmie dużo czasu.\n</p><p>Druty pończosznicze o długości 20 cm są idealne do małych obwodów, takich jak skarpety czy rękawy. Nie są ani za długie, ani za krótkie, dzięki czemu wygodnie się nimi pracuje i nie musisz się obawiać, że spadną z nich oczka.</p><p>Tutaj otrzymasz zestaw lekkich i wytrzymałych drutów dziewiarskich, które dzięki gładkiej powierzchni zapewniają komfortową pracę. Mają spiczaste końcówki, ale z zaokrągleniem, które sprawia, że oczka łatwo przesuwają się po drutach.</p><p>Z pewnością pokochasz te druty pończosznicze!</p>', '', 'alu-druty-ponczosznicze', '', '', '', 'Alu Druty Pończosznicze', '', '', '', ''),
(10382, 1, 1, '<p>Te ergonomiczne druty na żyłce od Prym to wysokiej jakości produkt, który zachwyci Cię swoją lekkością, elastycznością oraz tym jak wygodnie leży w dłoni.\n</p><p>W 2016 roku produkt ten został nagrodzony nagrodą Red Dot Design, która przyznawana jest corocznie produktom najwyższej jakości i o najlepszym designie.</p><p>Żyłka wykonana jest z cienkiej stali, co czyni ją elastyczną i wytrzymałą - możesz ją więc śmiało składać/zwijać bez obawy, że ulegnie ona uszkodzeniu. Druty na żyłce do rozmiaru 4 mm włącznie posiadają stalową żyłkę z ciemnofioletową powłoką.</p><p>Druty dostępne są w dwóch długościach: 60 i 80 cm, i dostępne są w rozmiarach 3-12 mm.</p><p>Długość drutów to 13,4 cm. Dotyczy wszystkich rozmiarów.</p><p>Zwróć uwagę, że druty do rozmiaru 4 mm są okrągłe, a te powyżej 4,5 mm są trójkątne.</p><p>Wykonane z trwałego, syntetycznego materiału.\n</p>', '', 'ergonomiczne-druty-na-zylce', '', '', '', 'Ergonomiczne druty na żyłce', '', '', '', ''),
(10382, 1, 2, '<p>Te ergonomiczne druty na żyłce od Prym to wysokiej jakości produkt, który zachwyci Cię swoją lekkością, elastycznością oraz tym jak wygodnie leży w dłoni.\n</p><p>W 2016 roku produkt ten został nagrodzony nagrodą Red Dot Design, która przyznawana jest corocznie produktom najwyższej jakości i o najlepszym designie.</p><p>Żyłka wykonana jest z cienkiej stali, co czyni ją elastyczną i wytrzymałą - możesz ją więc śmiało składać/zwijać bez obawy, że ulegnie ona uszkodzeniu. Druty na żyłce do rozmiaru 4 mm włącznie posiadają stalową żyłkę z ciemnofioletową powłoką.</p><p>Druty dostępne są w dwóch długościach: 60 i 80 cm, i dostępne są w rozmiarach 3-12 mm.</p><p>Długość drutów to 13,4 cm. Dotyczy wszystkich rozmiarów.</p><p>Zwróć uwagę, że druty do rozmiaru 4 mm są okrągłe, a te powyżej 4,5 mm są trójkątne.</p><p>Wykonane z trwałego, syntetycznego materiału.\n</p>', '', 'ergonomiczne-druty-na-zylce', '', '', '', 'Ergonomiczne druty na żyłce', '', '', '', ''),
(10383, 1, 1, '<p>Te ładne i wytrzymałe druty od KnitPro są wygodne, praktyczne i ładnie wykonane. Użyty materiał to drewno brzozy, które poddane zostało procesom laminowania i barwienia, dając w efekcie końcowym gładkość i komfort pracy.\n</p><p>Druty mają długość 25 cm, co oznacza, że nadają się na projekty, które nie wymagają trzymania wielu oczek na drutach.</p><p>Druty tak wygodnie leżą w ręku, że możesz z nimi pracować przez wiele godzin bez uczucia zmęczenia w rękach.</p>', '', 'pojedyncze-druty-symfonie', '', '', '', 'Pojedyncze druty Symfonie', '', '', '', ''),
(10383, 1, 2, '<p>Te ładne i wytrzymałe druty od KnitPro są wygodne, praktyczne i ładnie wykonane. Użyty materiał to drewno brzozy, które poddane zostało procesom laminowania i barwienia, dając w efekcie końcowym gładkość i komfort pracy.\n</p><p>Druty mają długość 25 cm, co oznacza, że nadają się na projekty, które nie wymagają trzymania wielu oczek na drutach.</p><p>Druty tak wygodnie leżą w ręku, że możesz z nimi pracować przez wiele godzin bez uczucia zmęczenia w rękach.</p>', '', 'pojedyncze-druty-symfonie', '', '', '', 'Pojedyncze druty Symfonie', '', '', '', ''),
(10384, 1, 1, '<p>Druty ergonomiczne od Prym to jakość, którą docenią dłonie każdego kto spróbował pracować z robótką przez wiele godzin.</p><p>Druty są lekkie, elastyczne i bardzo wygodnie leżą w dłoni. W 2016 roku produkt ten został nagrodzony nagrodą Red Dot Design, która przyznawana jest corocznie produktom najwyższej jakości i o najlepszym designie. Druty mają 20 cm długości i dostępne są w rozmiarach 2,5 - 8 mm.</p><p>Druty sprzedawane są w zestawach po 5 sztuk.</p><p>\n</p>', '', 'druty-ergonomiczne-od-prym', '', '', '', 'Druty ergonomiczne od Prym', '', '', '', ''),
(10384, 1, 2, '<p>Druty ergonomiczne od Prym to jakość, którą docenią dłonie każdego kto spróbował pracować z robótką przez wiele godzin.</p><p>Druty są lekkie, elastyczne i bardzo wygodnie leżą w dłoni. W 2016 roku produkt ten został nagrodzony nagrodą Red Dot Design, która przyznawana jest corocznie produktom najwyższej jakości i o najlepszym designie. Druty mają 20 cm długości i dostępne są w rozmiarach 2,5 - 8 mm.</p><p>Druty sprzedawane są w zestawach po 5 sztuk.</p><p>\n</p>', '', 'druty-ergonomiczne-od-prym', '', '', '', 'Druty ergonomiczne od Prym', '', '', '', ''),
(10385, 1, 1, '<p>Piękne i mocne druty na żyłce z wielobarwnej serii <strong>Swift </strong>Hobbii. Kolor żyłek zmienia się wraz z rozmiarem drutów – przecież nie może być nudno! Dodatkowym bonusem jest fakt, że szybko znajdziesz potrzebny rozmiar.\n</p><p>Druty są wykonane ze stali nierdzewnej i są zarówno lekkie, jak i wygodne w użyciu. Mają delikatną, gładką powierzchnię i zaokrąglone końcówki. Rozmiary są nadrukowane laserowo na metalu i nie ścierają się z upływem czasu.</p><p>Żyłki wykonane ze stali nierdzewnej i pokryte poliamidem. Oprócz ładnych kolorów, bardzo dobrze utrzymują kształt i zawsze będą się prostować podczas użytkowania i nie będą się skręcać. Ponieważ żyłki są bardziej sztywne (w przeciwieństwie do np. żyłek nylonowych) nadal można ich używać do techniki magic-loop, jeśli kupisz druty na żyłce o długości 80 cm.</p><p>Miłego dziergania ;-)\n</p><p>\n</p>', '', 'swift-druty-na-zylce-80-cm', '', '', '', 'Swift Druty na żyłce - 80 cm', '', '', '', ''),
(10385, 1, 2, '<p>Piękne i mocne druty na żyłce z wielobarwnej serii <strong>Swift </strong>Hobbii. Kolor żyłek zmienia się wraz z rozmiarem drutów – przecież nie może być nudno! Dodatkowym bonusem jest fakt, że szybko znajdziesz potrzebny rozmiar.\n</p><p>Druty są wykonane ze stali nierdzewnej i są zarówno lekkie, jak i wygodne w użyciu. Mają delikatną, gładką powierzchnię i zaokrąglone końcówki. Rozmiary są nadrukowane laserowo na metalu i nie ścierają się z upływem czasu.</p><p>Żyłki wykonane ze stali nierdzewnej i pokryte poliamidem. Oprócz ładnych kolorów, bardzo dobrze utrzymują kształt i zawsze będą się prostować podczas użytkowania i nie będą się skręcać. Ponieważ żyłki są bardziej sztywne (w przeciwieństwie do np. żyłek nylonowych) nadal można ich używać do techniki magic-loop, jeśli kupisz druty na żyłce o długości 80 cm.</p><p>Miłego dziergania ;-)\n</p><p>\n</p>', '', 'swift-druty-na-zylce-80-cm', '', '', '', 'Swift Druty na żyłce - 80 cm', '', '', '', ''),
(10386, 1, 1, '<p>Jeśli jesteś fanem drutów firmy KnitPro to ten zestaw jest must-have dla Ciebie!</p><p>Zestaw zawiera siedem par bardzo krótkich wymiennych drutów na żyłce o długości zaledwie 5 cm. Żyłki są również bardzo krótkie, dzięki czemu masz możliwość robienia na drutach rękawów, skarpetek, rękawiczek itp. bez użycia drutów pończoszniczych lub metody magic-loop. Łącząc druty i żyłkę możesz uzyskać obwód wynoszący zaledwie 22,5 cm. Wspaniale – dzierganie będzie wyjątkowo szybkie :-)</p><p>Kupując ten zestaw otrzymujesz wspaniałe druty dziewiarskie od 3-6 mm w stylu denim z dopasowanym etui z imitacji skóry i denimu. Wewnątrz cienkiego etui znajdziesz mniejszą wyjmowaną kieszeń, która chroni końcówki drutów. Etui ma dwa wewnętrzne zamki błyskawiczne i zewnętrzne zatrzaski, które utrzymują zawartość bezpiecznie na miejscu.</p><p>Podobnie jak drewniane druty dziewiarskie Symfonie firmy KnitPro, druty w tym zestawie są mocne, gładkie i mają bardzo precyzyjną końcówkę, która jest idealna do wszystkich rodzajów przędzy.</p><p><strong>Materiał</strong>: Laminowana brzoza\n<strong>Kolory drutów: </strong>Indygo z czarnymi przejściami\n<strong>Kolor żyłek:</strong> Niebieski z czarnymi przejściami\n<strong>Długość drutów</strong>: 5 cm\n<strong>Zawartość</strong>:\n7 par drutów w rozmiarach: 3 - 3,5 - 4 - 4,5 - 5 - 5,5 - 6 mm\n2 żyłki: 13 cm i 17 cm (bez gwintu)\n4 stopery\n2 klucze\nDenim etui\n</p>', '', 'denim-zestaw-bardzo-krotkich-wymiennych-drutow', '', '', '', 'DENIM Zestaw Bardzo Krótkich Wymiennych Drutów', '', '', '', ''),
(10386, 1, 2, '<p>Jeśli jesteś fanem drutów firmy KnitPro to ten zestaw jest must-have dla Ciebie!</p><p>Zestaw zawiera siedem par bardzo krótkich wymiennych drutów na żyłce o długości zaledwie 5 cm. Żyłki są również bardzo krótkie, dzięki czemu masz możliwość robienia na drutach rękawów, skarpetek, rękawiczek itp. bez użycia drutów pończoszniczych lub metody magic-loop. Łącząc druty i żyłkę możesz uzyskać obwód wynoszący zaledwie 22,5 cm. Wspaniale – dzierganie będzie wyjątkowo szybkie :-)</p><p>Kupując ten zestaw otrzymujesz wspaniałe druty dziewiarskie od 3-6 mm w stylu denim z dopasowanym etui z imitacji skóry i denimu. Wewnątrz cienkiego etui znajdziesz mniejszą wyjmowaną kieszeń, która chroni końcówki drutów. Etui ma dwa wewnętrzne zamki błyskawiczne i zewnętrzne zatrzaski, które utrzymują zawartość bezpiecznie na miejscu.</p><p>Podobnie jak drewniane druty dziewiarskie Symfonie firmy KnitPro, druty w tym zestawie są mocne, gładkie i mają bardzo precyzyjną końcówkę, która jest idealna do wszystkich rodzajów przędzy.</p><p><strong>Materiał</strong>: Laminowana brzoza\n<strong>Kolory drutów: </strong>Indygo z czarnymi przejściami\n<strong>Kolor żyłek:</strong> Niebieski z czarnymi przejściami\n<strong>Długość drutów</strong>: 5 cm\n<strong>Zawartość</strong>:\n7 par drutów w rozmiarach: 3 - 3,5 - 4 - 4,5 - 5 - 5,5 - 6 mm\n2 żyłki: 13 cm i 17 cm (bez gwintu)\n4 stopery\n2 klucze\nDenim etui\n</p>', '', 'denim-zestaw-bardzo-krotkich-wymiennych-drutow', '', '', '', 'DENIM Zestaw Bardzo Krótkich Wymiennych Drutów', '', '', '', ''),
(10387, 1, 1, '<p>Wspaniałe i klasyczne druty na żyłce o dł. 80 cm firmy Pony. Najmniejsze rozmiary drutów (do 7 mm włącznie) są wykonane z metalu, dzięki czemu są wyjątkowo trwałe. Natomiast większe rozmiary są wykonane z plastiku, dzięki czemu są lekkie i wygodne podczas pracy. Żyłka jest przezroczysta i bardzo elastyczna, a na każdym drucie nadrukowano wyraźne rozmiary.</p><p>\n</p><p>Cechą charakterystyczną tych klasycznych drutów na żyłce od Pony jest to, że oczka ślizgają się po nich jak marzenie! Druty zawierają specjalnie opatentowane przez firmę PONY łączenie drutów z żyłką typu GLYDON, które zapobiega haczeniu się włóczki.</p><p>Złącze-Glydon nie jest dostępne w małych rozmiarach, ale zaczyna się od 3 mm.</p><p>Długa żyłka zapewnia bowiem, że nie będziesz gubić oczek.\n</p><p><strong>Rozmiary</strong>: od 2,0 do 25,0 mm</p><p>\n</p><p>\n</p>', '', 'druty-na-zylce-80-cm', '', '', '', 'Druty na żyłce 80 cm', '', '', '', ''),
(10387, 1, 2, '<p>Wspaniałe i klasyczne druty na żyłce o dł. 80 cm firmy Pony. Najmniejsze rozmiary drutów (do 7 mm włącznie) są wykonane z metalu, dzięki czemu są wyjątkowo trwałe. Natomiast większe rozmiary są wykonane z plastiku, dzięki czemu są lekkie i wygodne podczas pracy. Żyłka jest przezroczysta i bardzo elastyczna, a na każdym drucie nadrukowano wyraźne rozmiary.</p><p>\n</p><p>Cechą charakterystyczną tych klasycznych drutów na żyłce od Pony jest to, że oczka ślizgają się po nich jak marzenie! Druty zawierają specjalnie opatentowane przez firmę PONY łączenie drutów z żyłką typu GLYDON, które zapobiega haczeniu się włóczki.</p><p>Złącze-Glydon nie jest dostępne w małych rozmiarach, ale zaczyna się od 3 mm.</p><p>Długa żyłka zapewnia bowiem, że nie będziesz gubić oczek.\n</p><p><strong>Rozmiary</strong>: od 2,0 do 25,0 mm</p><p>\n</p><p>\n</p>', '', 'druty-na-zylce-80-cm', '', '', '', 'Druty na żyłce 80 cm', '', '', '', ''),
(10388, 1, 1, '<p>Ładne i wytrzymałe druty od KnitPro wykonane z drewna brzozy, które poddane zostało laminowaniu i barwieniu, czego rezultatem końcowym jest gładka i ładna powierzchnia. KnitPro, jedna z wiodących marek w świecie szydełkowania i robienia na drutach, stworzyła te druty z myślą o osobach, które cenią wygodę i komfort pracy. Druty te są tak dobrej jakości, że możesz z nimi pracować nawet przez długie godziny bez uczucia bólu.\n</p><p>Całkowita długość: 80 cm\nDługość drutów: 12,8 cm\n</p>', '', 'druty-na-zylce-symfonie-80-cm', '', '', '', 'Druty na żyłce Symfonie - 80 cm', '', '', '', ''),
(10388, 1, 2, '<p>Ładne i wytrzymałe druty od KnitPro wykonane z drewna brzozy, które poddane zostało laminowaniu i barwieniu, czego rezultatem końcowym jest gładka i ładna powierzchnia. KnitPro, jedna z wiodących marek w świecie szydełkowania i robienia na drutach, stworzyła te druty z myślą o osobach, które cenią wygodę i komfort pracy. Druty te są tak dobrej jakości, że możesz z nimi pracować nawet przez długie godziny bez uczucia bólu.\n</p><p>Całkowita długość: 80 cm\nDługość drutów: 12,8 cm\n</p>', '', 'druty-na-zylce-symfonie-80-cm', '', '', '', 'Druty na żyłce Symfonie - 80 cm', '', '', '', ''),
(10389, 1, 1, '<p>Druty te wykonane są z najlepszej jakości bambusa z Japonii i sprawiają, że praca z nimi to prawdziwa przyjemność.\n</p><p>Końce stopniowo zaostrzają się, co czyni produkt idealnym na wszystkie rodzaje projektów. Bambus znany jest ze swojej lekkości i wytrzymałości - z pewnością polubisz materiał za to, jak wygodnie się z nim pracuje nawet przez wiele godzin.</p><p>‘Główki’ drutów wykonane są z drewna i mają ładny, zielony kolor, który ładnie zgrywa się z jasną zielenią bambusa. Druty dostępne są w 3 długościach: 25, 30 i 33 cm, oraz w rozmiarach 2-10 mm.</p><p>Druty te są dobrym zakupem dla nowicjuszy, jako że bambus czyni druty łatwe do trzymania i ułatwia zachowanie kontroli nad robótką.</p>', '', 'druty-pojedyncze-bamboo', '', '', '', 'Druty pojedyncze Bamboo', '', '', '', ''),
(10389, 1, 2, '<p>Druty te wykonane są z najlepszej jakości bambusa z Japonii i sprawiają, że praca z nimi to prawdziwa przyjemność.\n</p><p>Końce stopniowo zaostrzają się, co czyni produkt idealnym na wszystkie rodzaje projektów. Bambus znany jest ze swojej lekkości i wytrzymałości - z pewnością polubisz materiał za to, jak wygodnie się z nim pracuje nawet przez wiele godzin.</p><p>‘Główki’ drutów wykonane są z drewna i mają ładny, zielony kolor, który ładnie zgrywa się z jasną zielenią bambusa. Druty dostępne są w 3 długościach: 25, 30 i 33 cm, oraz w rozmiarach 2-10 mm.</p><p>Druty te są dobrym zakupem dla nowicjuszy, jako że bambus czyni druty łatwe do trzymania i ułatwia zachowanie kontroli nad robótką.</p>', '', 'druty-pojedyncze-bamboo', '', '', '', 'Druty pojedyncze Bamboo', '', '', '', ''),
(10390, 1, 1, '<p>Dokonaj nowego odkrycia i wypróbuj te niesamowite druty na żyłce J\'adore, idealne do wszelkiego rodzaju projektów dziewiarskich. Mają piękny lawendowy kolor, który w połączeniu ze złotymi metalowymi przejściami i czarnymi nylonowymi żyłkami emanuje prawdziwą elegancją.\n</p><p>Gładka powierzchnia zapewnia wiele godzin przyjemności z robienia na drutach. Płynne przejście między drutami a żyłką, która nie skręca się podczas dziergania, gwarantuje, że oczka przechodzą gładko i bezproblemowo.</p><p>Brzozowe druty o kwadratowym przekroju są ergonomiczne i wygodne dla dłoni podczas dziergania. Ten ergonomiczny design jest szczególnie zalecany osobom cierpiącym na bóle stawów i słabe nadgarstki.</p><p>Rozmiar drutów można łatwo zmierzyć po przekątnej używając standardowego miernika grubości drutów.</p><p>Te druty na żyłce są krótkie i nadają się do swetrów dziecięcych, plisy dekoltu i innych mniejszych obwodów.\n</p>', '', 'j-adore-cubics-druty-na-zylce-40-cm', '', '', '', 'J\'adore Cubics Druty na żyłce - 40 cm', '', '', '', ''),
(10390, 1, 2, '<p>Dokonaj nowego odkrycia i wypróbuj te niesamowite druty na żyłce J\'adore, idealne do wszelkiego rodzaju projektów dziewiarskich. Mają piękny lawendowy kolor, który w połączeniu ze złotymi metalowymi przejściami i czarnymi nylonowymi żyłkami emanuje prawdziwą elegancją.\n</p><p>Gładka powierzchnia zapewnia wiele godzin przyjemności z robienia na drutach. Płynne przejście między drutami a żyłką, która nie skręca się podczas dziergania, gwarantuje, że oczka przechodzą gładko i bezproblemowo.</p><p>Brzozowe druty o kwadratowym przekroju są ergonomiczne i wygodne dla dłoni podczas dziergania. Ten ergonomiczny design jest szczególnie zalecany osobom cierpiącym na bóle stawów i słabe nadgarstki.</p><p>Rozmiar drutów można łatwo zmierzyć po przekątnej używając standardowego miernika grubości drutów.</p><p>Te druty na żyłce są krótkie i nadają się do swetrów dziecięcych, plisy dekoltu i innych mniejszych obwodów.\n</p>', '', 'j-adore-cubics-druty-na-zylce-40-cm', '', '', '', 'J\'adore Cubics Druty na żyłce - 40 cm', '', '', '', ''),
(10391, 1, 1, '<p>Piękne i mocne druty na żyłce z wielobarwnej serii <strong>Swift </strong>Hobbii. Kolor żyłek zmienia się wraz z rozmiarem drutów – przecież nie może być nudno! Dodatkowym bonusem jest fakt, że szybko znajdziesz potrzebny rozmiar.\n</p><p>Druty są wykonane ze stali nierdzewnej i są zarówno lekkie, jak i wygodne w użyciu. Mają delikatną, gładką powierzchnię i zaokrąglone końcówki. Rozmiary są nadrukowane laserowo na metalu i nie ścierają się z upływem czasu.</p><p>Żyłki wykonane ze stali nierdzewnej i pokryte poliamidem. Oprócz ładnych kolorów, bardzo dobrze utrzymują kształt i zawsze będą się prostować podczas użytkowania i nie będą się skręcać. Ponieważ żyłki nie są miękkie (w przeciwieństwie do np. żyłek nylonowych) nie zalecamy używania ich do techniki magic-loop przy tej długości. Jeśli chcesz używać drutów <strong>Swift </strong>do magic-loop, zalecamy zakup drutów o dł. 80 cm, do których link znajdziesz tutaj na stronie.</p><p>Miłego dziergania ;-)\n</p>', '', 'swift-druty-na-zylce-60-cm', '', '', '', 'Swift Druty na żyłce - 60 cm', '', '', '', ''),
(10391, 1, 2, '<p>Piękne i mocne druty na żyłce z wielobarwnej serii <strong>Swift </strong>Hobbii. Kolor żyłek zmienia się wraz z rozmiarem drutów – przecież nie może być nudno! Dodatkowym bonusem jest fakt, że szybko znajdziesz potrzebny rozmiar.\n</p><p>Druty są wykonane ze stali nierdzewnej i są zarówno lekkie, jak i wygodne w użyciu. Mają delikatną, gładką powierzchnię i zaokrąglone końcówki. Rozmiary są nadrukowane laserowo na metalu i nie ścierają się z upływem czasu.</p><p>Żyłki wykonane ze stali nierdzewnej i pokryte poliamidem. Oprócz ładnych kolorów, bardzo dobrze utrzymują kształt i zawsze będą się prostować podczas użytkowania i nie będą się skręcać. Ponieważ żyłki nie są miękkie (w przeciwieństwie do np. żyłek nylonowych) nie zalecamy używania ich do techniki magic-loop przy tej długości. Jeśli chcesz używać drutów <strong>Swift </strong>do magic-loop, zalecamy zakup drutów o dł. 80 cm, do których link znajdziesz tutaj na stronie.</p><p>Miłego dziergania ;-)\n</p>', '', 'swift-druty-na-zylce-60-cm', '', '', '', 'Swift Druty na żyłce - 60 cm', '', '', '', ''),
(10392, 1, 1, '<p>Doświadcz najwyższej przyjemności z robienia na drutach dzięki naszym wymiennym drutom na żyłce <strong>Stellar </strong>- teraz dostępnym pojedynczo. Przeznaczone są dla rękodzielników, którym zależy na najwyższej jakości i lekkości. Druty wykonane są z lekkiego aluminium, dzięki czemu są mocne, gładkie i lekkie. Gładka powierzchnia i idealnie zwężające się końcówki sprawiają, że druty łatwo przesuwają się po ściegach każdego rodzaju włóczki.\n</p><p>Rozmiary są drukowane laserowo na drutach, dzięki czemu pozostają widoczne i łatwe do zidentyfikowania przez cały okres użytkowania. Występują w pięknym i intensywnym szafirowo-niebieskim kolorze, który nadaje drutom piękny, metaliczny wygląd. Przenieś swoje projekty dziewiarskie na nowy poziom dzięki tym wysokiej jakości drutom i połącz je z żyłkami i akcesoriami KnitPro.</p>', '', 'stellar-wymienne-druty-na-zylce-sapphire', '', '', '', 'Stellar Wymienne druty na żyłce - Sapphire', '', '', '', ''),
(10392, 1, 2, '<p>Doświadcz najwyższej przyjemności z robienia na drutach dzięki naszym wymiennym drutom na żyłce <strong>Stellar </strong>- teraz dostępnym pojedynczo. Przeznaczone są dla rękodzielników, którym zależy na najwyższej jakości i lekkości. Druty wykonane są z lekkiego aluminium, dzięki czemu są mocne, gładkie i lekkie. Gładka powierzchnia i idealnie zwężające się końcówki sprawiają, że druty łatwo przesuwają się po ściegach każdego rodzaju włóczki.\n</p><p>Rozmiary są drukowane laserowo na drutach, dzięki czemu pozostają widoczne i łatwe do zidentyfikowania przez cały okres użytkowania. Występują w pięknym i intensywnym szafirowo-niebieskim kolorze, który nadaje drutom piękny, metaliczny wygląd. Przenieś swoje projekty dziewiarskie na nowy poziom dzięki tym wysokiej jakości drutom i połącz je z żyłkami i akcesoriami KnitPro.</p>', '', 'stellar-wymienne-druty-na-zylce-sapphire', '', '', '', 'Stellar Wymienne druty na żyłce - Sapphire', '', '', '', ''),
(10393, 1, 1, '<p>Te stylowe druty od KnitPro wykonane są z lekkich i eleganckich włókien węglowych, które zapewniają wygodę w pracy z robótką. Końcówki drutów zostały wzmocnione mosiądzem dzięki czemu gładko przechodzą między oczkami niezależnie od tego z jaką włóczką pracujesz.\n</p><p>Druty dostępne są w rozmiarach 2-6 mm oraz długościach 25 og 35 cm.</p>', '', 'pojedyncze-druty-karbonz', '', '', '', 'Pojedyncze druty Karbonz', '', '', '', ''),
(10393, 1, 2, '<p>Te stylowe druty od KnitPro wykonane są z lekkich i eleganckich włókien węglowych, które zapewniają wygodę w pracy z robótką. Końcówki drutów zostały wzmocnione mosiądzem dzięki czemu gładko przechodzą między oczkami niezależnie od tego z jaką włóczką pracujesz.\n</p><p>Druty dostępne są w rozmiarach 2-6 mm oraz długościach 25 og 35 cm.</p>', '', 'pojedyncze-druty-karbonz', '', '', '', 'Pojedyncze druty Karbonz', '', '', '', ''),
(10394, 1, 1, '<p>Te wymienne druty pasują do wszystkich żyłek od KnitPro i mogą być do nich łatwo przymocowane dzięki innowacyjnemu designowi. Przejście między drutami a żyłką jest jednocześnie bardzo gładkie, co zapewnia sprawne prześlizgnięcie się oczek z drutów na żyłkę. Druty wykonane są z mosiądzu pustego w środku i mają wypolerowaną powierzchnię, dzięki czemu praca z nimi to czysta przyjemność.\n</p><p>Końcówki drutów stopniowo się zaostrzają, co sprawia, że druty nadają się na różnego rodzaju projekty.</p><p>Mosiądz ma wiele zalet m.in. lekkość i wytrzymałość. Lekkość sprawia, że z drutami wygodnie się pracuje nawet przez wiele godzin bez uczucia bólu.</p><p>Długość drutów: 11,6 cm (13 cm od rozmiaru 9 mm)</p><p>Materiał: Mosiądz\n</p>', '', 'wymienne-druty-na-zylce-nova', '', '', '', 'Wymienne druty na żyłce Nova', '', '', '', ''),
(10394, 1, 2, '<p>Te wymienne druty pasują do wszystkich żyłek od KnitPro i mogą być do nich łatwo przymocowane dzięki innowacyjnemu designowi. Przejście między drutami a żyłką jest jednocześnie bardzo gładkie, co zapewnia sprawne prześlizgnięcie się oczek z drutów na żyłkę. Druty wykonane są z mosiądzu pustego w środku i mają wypolerowaną powierzchnię, dzięki czemu praca z nimi to czysta przyjemność.\n</p><p>Końcówki drutów stopniowo się zaostrzają, co sprawia, że druty nadają się na różnego rodzaju projekty.</p><p>Mosiądz ma wiele zalet m.in. lekkość i wytrzymałość. Lekkość sprawia, że z drutami wygodnie się pracuje nawet przez wiele godzin bez uczucia bólu.</p><p>Długość drutów: 11,6 cm (13 cm od rozmiaru 9 mm)</p><p>Materiał: Mosiądz\n</p>', '', 'wymienne-druty-na-zylce-nova', '', '', '', 'Wymienne druty na żyłce Nova', '', '', '', ''),
(10395, 1, 1, '<p>Idealny zestaw dla “początkujących” dla każdego, kto chce wypróbować wymienne druty na żyłce przed zakupem kompletnego zestawu.\n</p><p>Zestaw Symfonie Starter zawiera 3 popularne drewniane druty ze srebrnymi złączami, 3 czarne żyłki obrotowe i akcesoria.</p><p>Wszystko zapakowane w praktyczne etui z tkaniny w kolorze fioletowym, które z pewnością zostanie zauważone. Początkowy zestaw drutów dziewiarskich jest idealny na rozpoczęcie przygody z dzierganiem. Zapinane na zamek etui idealnie sprawdzi się do przechowywania i robienia na drutach w podróży.</p><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami firmy KnitPro!</p><p>Metalowy kluczyk służy do dokręcenia żyłki z drutami, aby druty nie odkręciły się podczas pracy. Włóż końcówkę klucza przez mały otwór w gwincie i mocno dokręć drut, trzymając klucz w miejscu. Na tej stronie znajdziesz link do filmu.</p><p>Jeśli potrzebujesz drutów wymiennych bez żyłki możesz wykorzystać stopery i przykręcić je do żyłki. W ten sposób robótka pozostanie na żyłce, a ty możesz wykorzystać druty do innego projektu. Stopery przykręcasz do żyłki w taki sam sposób jak druty.</p><p><strong>Zestaw zawiera:</strong></p><ul><li><p>Druty 4.00 mm</p></li><li><p>Druty 5.00 mm</p></li><li><p>Druty 6,00 mm</p></li><li><p>Żyłka 35 cm (długość wraz z drutami 60cm)</p></li><li><p>Żyłka 56 cm (długość wraz z drutami 80cm)</p></li><li><p>Żyłka 76 cm (długość wraz z drutami 100cm)</p></li><li><p>6 stoperów</p></li><li><p>3 klucze</p></li><li><p>1 łącznik</p></li><li><p>Fioletowe etui z tkaniny</p></li></ul>', '', 'symfonie-starter-zestaw-wymiennych-drutow-na-zylce', '', '', '', 'Symfonie Starter Zestaw wymiennych drutów na żyłce', '', '', '', ''),
(10395, 1, 2, '<p>Idealny zestaw dla “początkujących” dla każdego, kto chce wypróbować wymienne druty na żyłce przed zakupem kompletnego zestawu.\n</p><p>Zestaw Symfonie Starter zawiera 3 popularne drewniane druty ze srebrnymi złączami, 3 czarne żyłki obrotowe i akcesoria.</p><p>Wszystko zapakowane w praktyczne etui z tkaniny w kolorze fioletowym, które z pewnością zostanie zauważone. Początkowy zestaw drutów dziewiarskich jest idealny na rozpoczęcie przygody z dzierganiem. Zapinane na zamek etui idealnie sprawdzi się do przechowywania i robienia na drutach w podróży.</p><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami firmy KnitPro!</p><p>Metalowy kluczyk służy do dokręcenia żyłki z drutami, aby druty nie odkręciły się podczas pracy. Włóż końcówkę klucza przez mały otwór w gwincie i mocno dokręć drut, trzymając klucz w miejscu. Na tej stronie znajdziesz link do filmu.</p><p>Jeśli potrzebujesz drutów wymiennych bez żyłki możesz wykorzystać stopery i przykręcić je do żyłki. W ten sposób robótka pozostanie na żyłce, a ty możesz wykorzystać druty do innego projektu. Stopery przykręcasz do żyłki w taki sam sposób jak druty.</p><p><strong>Zestaw zawiera:</strong></p><ul><li><p>Druty 4.00 mm</p></li><li><p>Druty 5.00 mm</p></li><li><p>Druty 6,00 mm</p></li><li><p>Żyłka 35 cm (długość wraz z drutami 60cm)</p></li><li><p>Żyłka 56 cm (długość wraz z drutami 80cm)</p></li><li><p>Żyłka 76 cm (długość wraz z drutami 100cm)</p></li><li><p>6 stoperów</p></li><li><p>3 klucze</p></li><li><p>1 łącznik</p></li><li><p>Fioletowe etui z tkaniny</p></li></ul>', '', 'symfonie-starter-zestaw-wymiennych-drutow-na-zylce', '', '', '', 'Symfonie Starter Zestaw wymiennych drutów na żyłce', '', '', '', ''),
(10396, 1, 1, '<p>Dokonaj nowego odkrycia i wypróbuj te niesamowite druty na żyłce J\'adore, idealne do wszelkiego rodzaju projektów dziewiarskich. Mają piękny lawendowy kolor, który w połączeniu ze złotymi metalowymi przejściami i czarnymi nylonowymi żyłkami emanuje prawdziwą elegancją.\n</p><p>Gładka powierzchnia zapewnia wiele godzin przyjemności z robienia na drutach. Płynne przejście między drutami a żyłką, która nie skręca się podczas dziergania, gwarantuje, że oczka przechodzą gładko i bezproblemowo.</p><p>Brzozowe druty o kwadratowym przekroju są ergonomiczne i wygodne dla dłoni podczas dziergania. Ten ergonomiczny design jest szczególnie zalecany osobom cierpiącym na bóle stawów i słabe nadgarstki.</p><p>Rozmiar drutów można łatwo zmierzyć po przekątnej używając standardowego miernika grubości drutów.</p><p>Te druty na żyłce mają długość 60 cm. Zalecamy wybranie drutów o długości 80 cm, jeśli zamierzasz użyć ich do techniki magic loop.\n</p>', '', 'j-adore-cubics-druty-na-zylce-60-cm', '', '', '', 'J\'adore Cubics Druty na żyłce  - 60 cm', '', '', '', ''),
(10396, 1, 2, '<p>Dokonaj nowego odkrycia i wypróbuj te niesamowite druty na żyłce J\'adore, idealne do wszelkiego rodzaju projektów dziewiarskich. Mają piękny lawendowy kolor, który w połączeniu ze złotymi metalowymi przejściami i czarnymi nylonowymi żyłkami emanuje prawdziwą elegancją.\n</p><p>Gładka powierzchnia zapewnia wiele godzin przyjemności z robienia na drutach. Płynne przejście między drutami a żyłką, która nie skręca się podczas dziergania, gwarantuje, że oczka przechodzą gładko i bezproblemowo.</p><p>Brzozowe druty o kwadratowym przekroju są ergonomiczne i wygodne dla dłoni podczas dziergania. Ten ergonomiczny design jest szczególnie zalecany osobom cierpiącym na bóle stawów i słabe nadgarstki.</p><p>Rozmiar drutów można łatwo zmierzyć po przekątnej używając standardowego miernika grubości drutów.</p><p>Te druty na żyłce mają długość 60 cm. Zalecamy wybranie drutów o długości 80 cm, jeśli zamierzasz użyć ich do techniki magic loop.\n</p>', '', 'j-adore-cubics-druty-na-zylce-60-cm', '', '', '', 'J\'adore Cubics Druty na żyłce  - 60 cm', '', '', '', ''),
(10397, 1, 1, '<p>Kombinacja włókna węglowego z gładkim mosiądzem daje wyjątkowe doświadczenie pracy z drutami. Żyłka jest gładka, elastyczna i giętka, dzięki czemu nie pęknie gdy będziesz ją zwijać.</p><p>Końcówki są do tego wzmocnione mosiądzem niklowym - druty te nadadzą się dzięki temu na każdą włóczkę i na każdy projekt!</p><p>Druty dostępne są w rozmiarach 3-8 mm i mają długość 11,6 cm (bez żyłki).</p>', '', 'wymienne-druty-na-zylce-karbonz', '', '', '', 'Wymienne druty na żyłce Karbonz', '', '', '', ''),
(10397, 1, 2, '<p>Kombinacja włókna węglowego z gładkim mosiądzem daje wyjątkowe doświadczenie pracy z drutami. Żyłka jest gładka, elastyczna i giętka, dzięki czemu nie pęknie gdy będziesz ją zwijać.</p><p>Końcówki są do tego wzmocnione mosiądzem niklowym - druty te nadadzą się dzięki temu na każdą włóczkę i na każdy projekt!</p><p>Druty dostępne są w rozmiarach 3-8 mm i mają długość 11,6 cm (bez żyłki).</p>', '', 'wymienne-druty-na-zylce-karbonz', '', '', '', 'Wymienne druty na żyłce Karbonz', '', '', '', ''),
(10398, 1, 1, '<p>Wspaniałe i klasyczne druty na żyłce o dł. 40 cm firmy Pony. Najmniejsze rozmiary drutów (do 7 mm włącznie) są wykonane z metalu, dzięki czemu są wyjątkowo trwałe. Natomiast większe rozmiary są wykonane z plastiku, dzięki czemu są lekkie i wygodne podczas pracy. Żyłka jest przezroczysta i bardzo elastyczna, a na każdym drucie nadrukowano wyraźne rozmiary.</p><p>\n</p><p>Cechą charakterystyczną tych klasycznych drutów na żyłce od Pony jest to, że oczka ślizgają się po nich jak marzenie! Druty zawierają specjalnie opatentowane przez firmę PONY łączenie drutów z żyłką typu GLYDON, które zapobiega haczeniu się włóczki.</p><p>Złącze-Glydon nie jest dostępne w małych rozmiarach, ale zaczyna się od 3 mm.</p><p>Długość 40 cm czyni te druty idealnymi na małe projekty takie jak czapki, rękawiczki, małe ponczo itp.\n</p><p><strong>Rozmiary</strong>: od 2,0 do 10,0 mm</p><p>\n</p>', '', 'drut-na-zylce-40-cm', '', '', '', 'Drut na żyłce 40 cm', '', '', '', ''),
(10398, 1, 2, '<p>Wspaniałe i klasyczne druty na żyłce o dł. 40 cm firmy Pony. Najmniejsze rozmiary drutów (do 7 mm włącznie) są wykonane z metalu, dzięki czemu są wyjątkowo trwałe. Natomiast większe rozmiary są wykonane z plastiku, dzięki czemu są lekkie i wygodne podczas pracy. Żyłka jest przezroczysta i bardzo elastyczna, a na każdym drucie nadrukowano wyraźne rozmiary.</p><p>\n</p><p>Cechą charakterystyczną tych klasycznych drutów na żyłce od Pony jest to, że oczka ślizgają się po nich jak marzenie! Druty zawierają specjalnie opatentowane przez firmę PONY łączenie drutów z żyłką typu GLYDON, które zapobiega haczeniu się włóczki.</p><p>Złącze-Glydon nie jest dostępne w małych rozmiarach, ale zaczyna się od 3 mm.</p><p>Długość 40 cm czyni te druty idealnymi na małe projekty takie jak czapki, rękawiczki, małe ponczo itp.\n</p><p><strong>Rozmiary</strong>: od 2,0 do 10,0 mm</p><p>\n</p>', '', 'drut-na-zylce-40-cm', '', '', '', 'Drut na żyłce 40 cm', '', '', '', ''),
(10399, 1, 1, '<p>Te druty na żyłce, podobnie jak reszta produktów z serii Perfect od Pony, wykonane są z przyjaznego środowisku drewna - a właściwie z połączenia 3 rodzajów drewna. W ten sposób otrzymano ten piękny, naturalny wzór i kombinację barw bez użycia sztucznych barwników. Druty te są ładne, gładkie, silne i elastyczne, a praca z nimi to prawdziwa przyjemność!</p><p>Co więcej, przejścia między drutami a żyłką są wykonane tak dobrze, że oczka przechodzą przez nie gładko i bezproblemowo. Podsumowując, za tak przystępną cenę otrzymujesz naprawdę dużo.</p><p>Druty mają długość 60 cm i dostępne są w 11 rozmiarach: 3, 3.5, 4, 4.5, 5, 5.5, 6, 7, 8, 9 oraz 10 mm.</p>', '', 'druty-na-zylce-perfect-60-cm', '', '', '', 'Druty na żyłce Perfect - 60 cm', '', '', '', ''),
(10399, 1, 2, '<p>Te druty na żyłce, podobnie jak reszta produktów z serii Perfect od Pony, wykonane są z przyjaznego środowisku drewna - a właściwie z połączenia 3 rodzajów drewna. W ten sposób otrzymano ten piękny, naturalny wzór i kombinację barw bez użycia sztucznych barwników. Druty te są ładne, gładkie, silne i elastyczne, a praca z nimi to prawdziwa przyjemność!</p><p>Co więcej, przejścia między drutami a żyłką są wykonane tak dobrze, że oczka przechodzą przez nie gładko i bezproblemowo. Podsumowując, za tak przystępną cenę otrzymujesz naprawdę dużo.</p><p>Druty mają długość 60 cm i dostępne są w 11 rozmiarach: 3, 3.5, 4, 4.5, 5, 5.5, 6, 7, 8, 9 oraz 10 mm.</p>', '', 'druty-na-zylce-perfect-60-cm', '', '', '', 'Druty na żyłce Perfect - 60 cm', '', '', '', ''),
(10400, 1, 1, '<p>Druty te wykonane są z akrylu, dzięki czemu są one nie tylko wygodne w pracy ale i wytrzymałe. Końce drutów stopniowo się zaostrzają, co czyni druty odpowiednimi do różnych projektów. Oprócz tego leżą one wygodnie w dłoniach umożliwiając pracę długimi godzinami bez uczucia bólu. W przeciwieństwie do innych szydełek, nawet najbardziej śliskie włóczki nie będą się tak łatwo ześlizgiwać z tego szydełka. Dlatego też produkt ten polecany jest osobom, które nie mają jeszcze tak dużego doświadczenia.\n</p><p>Żyłka jest natomiast bardzo gładka i połączona z drutami w taki sposób, że oczka nie będą się haczyć na złączeniu. Żyłka jest także elastyczna i giętka, więc nie musisz się obawiać o jej pęknięcie w wypadku jej składania.</p><p>\n</p>', '', 'druty-na-zylce-trendz-120-cm', '', '', '', 'Druty na żyłce Trendz 120 cm', '', '', '', ''),
(10400, 1, 2, '<p>Druty te wykonane są z akrylu, dzięki czemu są one nie tylko wygodne w pracy ale i wytrzymałe. Końce drutów stopniowo się zaostrzają, co czyni druty odpowiednimi do różnych projektów. Oprócz tego leżą one wygodnie w dłoniach umożliwiając pracę długimi godzinami bez uczucia bólu. W przeciwieństwie do innych szydełek, nawet najbardziej śliskie włóczki nie będą się tak łatwo ześlizgiwać z tego szydełka. Dlatego też produkt ten polecany jest osobom, które nie mają jeszcze tak dużego doświadczenia.\n</p><p>Żyłka jest natomiast bardzo gładka i połączona z drutami w taki sposób, że oczka nie będą się haczyć na złączeniu. Żyłka jest także elastyczna i giętka, więc nie musisz się obawiać o jej pęknięcie w wypadku jej składania.</p><p>\n</p>', '', 'druty-na-zylce-trendz-120-cm', '', '', '', 'Druty na żyłce Trendz 120 cm', '', '', '', ''),
(10401, 1, 1, '<p>Ten piękny zestaw to 8 par wymiennych drutów na żyłce w popularnych rozmiarach 3.5-8 mm. Druty wykonane są z drewna brzozy, są wyjątkowo wygodne i zapewniają duży komfort pracy.\n</p><p>Z drutami łatwo się pracuje, a ich śliczny, elegancki design cieszy oko. Drewno brzozy zostało poddane laminowaniu, farbowaniu i polerowaniu, co w efekcie końcowym daje bardzo gładką powierzchnię.</p><p>W zestawie otrzymasz:</p><ul><li><p>8 par wymiennych drutów na żyłce w rozmiarach: 3.5mm, 4.0mm, 4.5mm, 5.0mm, 5.5mm, 6.0mm, 7.0mm, 8.0mm</p></li><li><p>4 żyłki (1x60 cm, 2x80 cm, 1x100 cm)</p></li><li><p>8 stoperów</p></li><li><p>4 klucz</p></li><li><p>1 zestaw przedłużeń</p></li><li><p>1 miernik rozmiaru szydełek i drutów</p></li></ul><p>Zestaw zapakowany jest w śliczne, żakardowe etui, w którym możesz przetrzymywać jego zawartość.</p>', '', 'zestaw-wymiennych-drutow-na-zylce-symfonie-deluxe', '', '', '', 'Zestaw wymiennych drutów na żyłce Symfonie Deluxe', '', '', '', ''),
(10401, 1, 2, '<p>Ten piękny zestaw to 8 par wymiennych drutów na żyłce w popularnych rozmiarach 3.5-8 mm. Druty wykonane są z drewna brzozy, są wyjątkowo wygodne i zapewniają duży komfort pracy.\n</p><p>Z drutami łatwo się pracuje, a ich śliczny, elegancki design cieszy oko. Drewno brzozy zostało poddane laminowaniu, farbowaniu i polerowaniu, co w efekcie końcowym daje bardzo gładką powierzchnię.</p><p>W zestawie otrzymasz:</p><ul><li><p>8 par wymiennych drutów na żyłce w rozmiarach: 3.5mm, 4.0mm, 4.5mm, 5.0mm, 5.5mm, 6.0mm, 7.0mm, 8.0mm</p></li><li><p>4 żyłki (1x60 cm, 2x80 cm, 1x100 cm)</p></li><li><p>8 stoperów</p></li><li><p>4 klucz</p></li><li><p>1 zestaw przedłużeń</p></li><li><p>1 miernik rozmiaru szydełek i drutów</p></li></ul><p>Zestaw zapakowany jest w śliczne, żakardowe etui, w którym możesz przetrzymywać jego zawartość.</p>', '', 'zestaw-wymiennych-drutow-na-zylce-symfonie-deluxe', '', '', '', 'Zestaw wymiennych drutów na żyłce Symfonie Deluxe', '', '', '', ''),
(10402, 1, 1, '<p>25 szt. plastikowych znaczników ściegów, które pasują na druty do 6,5 mm. Znaczniki ściegów są bardzo przydatne, gdy np. musisz zaznaczyć miejsce, w którym należy odejmować lub dodawać oczka, motyw wzoru, lub po prostu zaznaczyć początek okrążenia.\n</p><p>Znaczniki mają zapięcie, dzięki czemu można je otworzyć i zdjąć z drutów w dowolnym momencie. Możesz również przymocować je do oczek zamiast do drutów. Końcówki są zaokrąglone, dzięki czemu nie kłują i pasują zarówno do cienkiej, jak i normalnej przędzy dziewiarskiej.</p><p>Dostępne w 4 różnych kolorach.</p>', '', 'znaczniki-sciegow-z-zamknieciem-25-szt', '', '', '', 'Znaczniki ściegów z zamknięciem - 25 szt.', '', '', '', ''),
(10402, 1, 2, '<p>25 szt. plastikowych znaczników ściegów, które pasują na druty do 6,5 mm. Znaczniki ściegów są bardzo przydatne, gdy np. musisz zaznaczyć miejsce, w którym należy odejmować lub dodawać oczka, motyw wzoru, lub po prostu zaznaczyć początek okrążenia.\n</p><p>Znaczniki mają zapięcie, dzięki czemu można je otworzyć i zdjąć z drutów w dowolnym momencie. Możesz również przymocować je do oczek zamiast do drutów. Końcówki są zaokrąglone, dzięki czemu nie kłują i pasują zarówno do cienkiej, jak i normalnej przędzy dziewiarskiej.</p><p>Dostępne w 4 różnych kolorach.</p>', '', 'znaczniki-sciegow-z-zamknieciem-25-szt', '', '', '', 'Znaczniki ściegów z zamknięciem - 25 szt.', '', '', '', ''),
(10403, 1, 1, '<p>Igły nadają się doskonale do zszywania końcówek. Nie są one ostre i mają dość duże oczka, co czyni szycie nimi niezwykle łatwym. W tym zestawie otrzymasz 6 igieł w 2 rozmiarach:\n</p><p>- 3 igły po 2 x 72 mm</p><p>- 3 igły po 3 x 93 mm</p><p>\n</p>', '', 'plastikowe-igly-do-cerowania', '', '', '', 'Plastikowe igły do cerowania', '', '', '', ''),
(10403, 1, 2, '<p>Igły nadają się doskonale do zszywania końcówek. Nie są one ostre i mają dość duże oczka, co czyni szycie nimi niezwykle łatwym. W tym zestawie otrzymasz 6 igieł w 2 rozmiarach:\n</p><p>- 3 igły po 2 x 72 mm</p><p>- 3 igły po 3 x 93 mm</p><p>\n</p>', '', 'plastikowe-igly-do-cerowania', '', '', '', 'Plastikowe igły do cerowania', '', '', '', ''),
(10404, 1, 1, '<p>Tutaj otrzymasz średniej wielkości opakowanie z piękną i miękką watą do projektów hobbystycznych, takich jak lalki, misie, amigurumi itp. Wata jest bezzapachowa i może być używana przez alergików.</p><p>Dostarczana w opakowaniu próżniowym.</p>', '', 'wata-do-wypelnienia-300-g', '', '', '', 'Wata do wypełnienia - 300 g', '', '', '', ''),
(10404, 1, 2, '<p>Tutaj otrzymasz średniej wielkości opakowanie z piękną i miękką watą do projektów hobbystycznych, takich jak lalki, misie, amigurumi itp. Wata jest bezzapachowa i może być używana przez alergików.</p><p>Dostarczana w opakowaniu próżniowym.</p>', '', 'wata-do-wypelnienia-300-g', '', '', '', 'Wata do wypełnienia - 300 g', '', '', '', ''),
(10405, 1, 1, '<p>Zadbaj o swoje wełniane robótki używając naszego nowego płynu do prania wełny z lanoliną. Ten detergent od Eucalan jest wolny od toksyn, wybielaczy, fosforanów, perfum i barwników. Pomoże on zachować miękkość i przyjemność dotyku Twoich wełnianych rzeczy. Eucalan ma naturalne pH, a jego zapachy pochodzą jedynie z esencji olejków. Środek może być użyty zarówno do prania mechaicznego jak i ręcznego. Oferujemy go w dwóch rozmiarach (100 i 500 ml) oraz 5 wersjach zapachowych: Grapefruit, Jasmin, Lavender, Eucalyptus oraz Neutral .</p><p>UPS! Zwróć uwagę, że Eucalan nie musi być wypłukiwany - jest to zaleta, ponieważ zbyt długie płukanie sprawia, że rzeczy wyglądają na sprane. Zachowasz też w ten sposób lanolinę oraz olejki, które z kolei będą trzymać mole z daleka od ubrań.</p><p>Butelka 500 ml wystarcza na ca. 75-100 prań. Co więcej, butelki są przyjazne środowisku (są biodegradowalne).\n</p>', '', 'plyn-do-prania-welny', '', '', '', 'Płyn do prania wełny', '', '', '', ''),
(10405, 1, 2, '<p>Zadbaj o swoje wełniane robótki używając naszego nowego płynu do prania wełny z lanoliną. Ten detergent od Eucalan jest wolny od toksyn, wybielaczy, fosforanów, perfum i barwników. Pomoże on zachować miękkość i przyjemność dotyku Twoich wełnianych rzeczy. Eucalan ma naturalne pH, a jego zapachy pochodzą jedynie z esencji olejków. Środek może być użyty zarówno do prania mechaicznego jak i ręcznego. Oferujemy go w dwóch rozmiarach (100 i 500 ml) oraz 5 wersjach zapachowych: Grapefruit, Jasmin, Lavender, Eucalyptus oraz Neutral .</p><p>UPS! Zwróć uwagę, że Eucalan nie musi być wypłukiwany - jest to zaleta, ponieważ zbyt długie płukanie sprawia, że rzeczy wyglądają na sprane. Zachowasz też w ten sposób lanolinę oraz olejki, które z kolei będą trzymać mole z daleka od ubrań.</p><p>Butelka 500 ml wystarcza na ca. 75-100 prań. Co więcej, butelki są przyjazne środowisku (są biodegradowalne).\n</p>', '', 'plyn-do-prania-welny', '', '', '', 'Płyn do prania wełny', '', '', '', ''),
(10406, 1, 1, '<p>Tutaj otrzymasz bardzo ładne małe pudełko z 45 metalowymi znacznikami ściegów. Pudełko ma małe okienko w pokrywce, dzięki czemu możesz zobaczyć wspaniałą zawartość, a do tego jest bardzo praktyczne, jeśli chcesz zapakować znaczniki do torby projektowej. Znaczniki można otwierać i pasują na druty aż do 7 mm.\n</p><p>Do wyboru jest kilka kombinacji kolorystycznych znaczników ściegów.</p><p>Średnica pudełka: 4,5 cm\n</p><p>Wysokość pudełka: 1,8 cm\n</p>', '', 'znaczniki-sciegow-metal', '', '', '', 'Znaczniki ściegów - Metal', '', '', '', ''),
(10406, 1, 2, '<p>Tutaj otrzymasz bardzo ładne małe pudełko z 45 metalowymi znacznikami ściegów. Pudełko ma małe okienko w pokrywce, dzięki czemu możesz zobaczyć wspaniałą zawartość, a do tego jest bardzo praktyczne, jeśli chcesz zapakować znaczniki do torby projektowej. Znaczniki można otwierać i pasują na druty aż do 7 mm.\n</p><p>Do wyboru jest kilka kombinacji kolorystycznych znaczników ściegów.</p><p>Średnica pudełka: 4,5 cm\n</p><p>Wysokość pudełka: 1,8 cm\n</p>', '', 'znaczniki-sciegow-metal', '', '', '', 'Znaczniki ściegów - Metal', '', '', '', ''),
(10407, 1, 1, '<p>Fantastyczny zestaw nylonowych żyłek firmy Knitpro. Żyłki są wytrzymałe, elastyczne i dostępne w fioletowym kolorze. Zakończone gwintem zapewniającym gładkie i płynne połączenie z drutami.</p><p><strong>W zestawie znajduje się:</strong></p><ul><li><p>1 żyłka</p></li><li><p>2 stopery</p></li><li><p>1 klucz ułatwiający przykręcenie</p></li></ul><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami firmy KnitPro!</p><p>Metalowy kluczyk służy do dokręcenia żyłki z drutami, aby druty nie odkręciły się podczas pracy. Włóż końcówkę klucza przez mały otwór w gwincie i mocno dokręć drut, trzymając klucz w miejscu. Na tej stronie znajdziesz link do filmu.</p><p>Jeśli potrzebujesz drutów wymiennych bez żyłki możesz wykorzystać stopery i przykręcić je do żyłki. W ten sposób robótka pozostanie na żyłce, a ty możesz wykorzystać druty do innego projektu. Stopery przykręcasz do żyłki w taki sam sposób jak druty.</p><p><strong>Pssst! Zwróć uwagę, że podana długość to całkowita długość żyłki z drutami:</strong>\n</p><p></p><p>40 cm: żyłka ma 20 cm długości bez drutów\n50 cm: żyłka ma 28 cm długości bez drutów\n60 cm: żyłka ma 35 cm długości bez drutów\n80 cm: żyłka ma 56 cm długości bez drutów\n100 cm: żyłka ma 76 cm długości bez drutów\n120 cm: żyłka ma 94 cm długości bez drutów\n150 cm: żyłka ma 126 cm długości bez drutów</p><p></p>', '', 'zylka-do-wymiennych-drutow', '', '', '', 'Żyłka do wymiennych drutów', '', '', '', ''),
(10407, 1, 2, '<p>Fantastyczny zestaw nylonowych żyłek firmy Knitpro. Żyłki są wytrzymałe, elastyczne i dostępne w fioletowym kolorze. Zakończone gwintem zapewniającym gładkie i płynne połączenie z drutami.</p><p><strong>W zestawie znajduje się:</strong></p><ul><li><p>1 żyłka</p></li><li><p>2 stopery</p></li><li><p>1 klucz ułatwiający przykręcenie</p></li></ul><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami firmy KnitPro!</p><p>Metalowy kluczyk służy do dokręcenia żyłki z drutami, aby druty nie odkręciły się podczas pracy. Włóż końcówkę klucza przez mały otwór w gwincie i mocno dokręć drut, trzymając klucz w miejscu. Na tej stronie znajdziesz link do filmu.</p><p>Jeśli potrzebujesz drutów wymiennych bez żyłki możesz wykorzystać stopery i przykręcić je do żyłki. W ten sposób robótka pozostanie na żyłce, a ty możesz wykorzystać druty do innego projektu. Stopery przykręcasz do żyłki w taki sam sposób jak druty.</p><p><strong>Pssst! Zwróć uwagę, że podana długość to całkowita długość żyłki z drutami:</strong>\n</p><p></p><p>40 cm: żyłka ma 20 cm długości bez drutów\n50 cm: żyłka ma 28 cm długości bez drutów\n60 cm: żyłka ma 35 cm długości bez drutów\n80 cm: żyłka ma 56 cm długości bez drutów\n100 cm: żyłka ma 76 cm długości bez drutów\n120 cm: żyłka ma 94 cm długości bez drutów\n150 cm: żyłka ma 126 cm długości bez drutów</p><p></p>', '', 'zylka-do-wymiennych-drutow', '', '', '', 'Żyłka do wymiennych drutów', '', '', '', '');
