(10408, 1, 1, '<p>Śliczne znaczniki ściegów w kształcie serca z zamknięciem. Końcówki znaczników są zaokrąglone, aby nie kłuły i pasują zarówno do cienkiej, jak i normalnej przędzy dziewiarskiej.</p><p>Znaczniki to idealny gadżet, jeśli brakuje Ci trzeciej ręki do zaznaczenia istotnych miejsc podczas dziergania.</p><p>Znaczniki ściegów mogą być używane do wielu różnych celów, dzięki nim:\n- zaznaczysz początek okrążenia lub raport wzoru\n- wyróżnisz ważne oczka na drutach. Znaczniki ściegów można łatwo zawiesić na drucie pomiędzy oczkami, pasują na druty do 7 mm\n- zaznaczysz szczególne rzędy w robótce\n- zaznaczysz dodawanie i odejmowanie oczek\n- złapiesz zgubione oczko, nim całkowicie ucieknie</p><p>\n\n</p>', '', 'znaczniki-sciegow-z-zamknieciem-serce', '', '', '', 'Znaczniki ściegów z zamknięciem – Serce', '', '', '', ''),
(10408, 1, 2, '<p>Śliczne znaczniki ściegów w kształcie serca z zamknięciem. Końcówki znaczników są zaokrąglone, aby nie kłuły i pasują zarówno do cienkiej, jak i normalnej przędzy dziewiarskiej.</p><p>Znaczniki to idealny gadżet, jeśli brakuje Ci trzeciej ręki do zaznaczenia istotnych miejsc podczas dziergania.</p><p>Znaczniki ściegów mogą być używane do wielu różnych celów, dzięki nim:\n- zaznaczysz początek okrążenia lub raport wzoru\n- wyróżnisz ważne oczka na drutach. Znaczniki ściegów można łatwo zawiesić na drucie pomiędzy oczkami, pasują na druty do 7 mm\n- zaznaczysz szczególne rzędy w robótce\n- zaznaczysz dodawanie i odejmowanie oczek\n- złapiesz zgubione oczko, nim całkowicie ucieknie</p><p>\n\n</p>', '', 'znaczniki-sciegow-z-zamknieciem-serce', '', '', '', 'Znaczniki ściegów z zamknięciem – Serce', '', '', '', ''),
(10409, 1, 1, '<p>Miękka wata, przy pomocy której możesz wypchać lalki, misie, poduszki itp. Jeśli potrzebujesz tylko odrobiny waty do małego DIY-projektu, to małe 100-gramowe opakowanie jest idealnym rozwiązaniem.\n</p><p>Toleruje pranie w 40°C oraz suszenie w suszarce bębnowej w niskich temperaturach. Wata jest bezzapachowa i może być używana przez alergików.</p><p>Dostarczana w opakowaniu próżniowym.</p>', '', 'wata-do-wypelnienia-100-g', '', '', '', 'Wata do wypełnienia - 100 g', '', '', '', ''),
(10409, 1, 2, '<p>Miękka wata, przy pomocy której możesz wypchać lalki, misie, poduszki itp. Jeśli potrzebujesz tylko odrobiny waty do małego DIY-projektu, to małe 100-gramowe opakowanie jest idealnym rozwiązaniem.\n</p><p>Toleruje pranie w 40°C oraz suszenie w suszarce bębnowej w niskich temperaturach. Wata jest bezzapachowa i może być używana przez alergików.</p><p>Dostarczana w opakowaniu próżniowym.</p>', '', 'wata-do-wypelnienia-100-g', '', '', '', 'Wata do wypełnienia - 100 g', '', '', '', ''),
(10410, 1, 1, '<p><strong>Nowa wersja naszej lampki na szyję z przedłużoną żywotnością baterii.</strong></p><p>Lampa Deluxe jest idealnym wyborem dla Ciebie, jeśli szukasz wygodnego rozwiązania, które zapewni Ci odpowiednie oświetlenie podczas szydełkowania czy robienia na drutach.</p><p>Kabel od lampy możesz owinąć sobie wygodnie naokoło szyi tak że obie ręce masz wolne. Co więcej możesz regulować światło wybierając jedną z dwóch mocy oświetlenia.</p><p>To nie wszystko! Obie końcówki lampy wyposażone są w żarówki LED, których można używać razem lub osobno. Dzięki temu możesz oświetlić 2 różne rzeczy jednocześnie np. robótkę i wzór.</p><p>Lampę Deluxe możesz zakupić w dwóch rozmiarach: 60 cm i 73 cm. Jeśli zwykle trzymasz robótkę wyżej, blisko brody, polecamy rozmiar 60 cm. Jeśli natomiast wolisz trzymać robótkę na kolanach, rozmiar 73 cm będzie dla Ciebie lepszym rozwiązaniem.</p><p><strong>Postępuj zgodnie z naszymi instrukcjami jak poprawnie wkładać baterie (patrz zdjęcie).</strong>\n</p><p><em>Dane techniczne</em>\nLumen: 20-25 lm\nKelvin: między 6500-7500 kelvin</p>', '', 'lampa-na-szyje-deluxe-czarny', '', '', '', 'Lampa na szyję Deluxe - Czarny', '', '', '', ''),
(10410, 1, 2, '<p><strong>Nowa wersja naszej lampki na szyję z przedłużoną żywotnością baterii.</strong></p><p>Lampa Deluxe jest idealnym wyborem dla Ciebie, jeśli szukasz wygodnego rozwiązania, które zapewni Ci odpowiednie oświetlenie podczas szydełkowania czy robienia na drutach.</p><p>Kabel od lampy możesz owinąć sobie wygodnie naokoło szyi tak że obie ręce masz wolne. Co więcej możesz regulować światło wybierając jedną z dwóch mocy oświetlenia.</p><p>To nie wszystko! Obie końcówki lampy wyposażone są w żarówki LED, których można używać razem lub osobno. Dzięki temu możesz oświetlić 2 różne rzeczy jednocześnie np. robótkę i wzór.</p><p>Lampę Deluxe możesz zakupić w dwóch rozmiarach: 60 cm i 73 cm. Jeśli zwykle trzymasz robótkę wyżej, blisko brody, polecamy rozmiar 60 cm. Jeśli natomiast wolisz trzymać robótkę na kolanach, rozmiar 73 cm będzie dla Ciebie lepszym rozwiązaniem.</p><p><strong>Postępuj zgodnie z naszymi instrukcjami jak poprawnie wkładać baterie (patrz zdjęcie).</strong>\n</p><p><em>Dane techniczne</em>\nLumen: 20-25 lm\nKelvin: między 6500-7500 kelvin</p>', '', 'lampa-na-szyje-deluxe-czarny', '', '', '', 'Lampa na szyję Deluxe - Czarny', '', '', '', ''),
(10411, 1, 1, '<p><strong>Edycja limitowana!</strong></p><p>Nie mogliśmy się opanować i nagle wpadliśmy w świąteczny nastrój, kiedy musieliśmy zdecydować o jaki kolor wzbogacić naszą rodzinę lamp na szyję. Dlatego już teraz możemy zaprezentować tę nową, piękną lampę na szyję w najpiękniejszym, świątecznym czerwonym kolorze. Dostępna w limitowanej partii, więc zdobądź ją już teraz.</p><p>Jest to idealne rozwiązanie dla tych, którzy chcą pracować przy odpowiednim oświetleniu. Można ją zawiesić na szyi, dzięki czemu masz wolne ręce.</p><p>Lampa na szyję Deluxe umożliwia wybór pomiędzy 2 poziomami jasności. Aby dopasować skalę świecenia, wystarczy, że naciśniesz i przytrzymasz przycisk włączania/wyłączania:</p><p>1. naciśnięcie: Lampa włącza się (50% jasności)\n2. naciśnięcie: Lampa wyłącza się\n3. naciśnięcie: Lampa włącza się (100% jasności)\n4. naciśnięcie: Lampa wyłącza się\n</p><p>To nie wszystko! Obie końcówki lampy wyposażone są w żarówki LED, których można używać razem lub osobno. Dzięki temu możesz oświetlić 2 różne rzeczy jednocześnie np. robótkę i wzór.</p><p>Lampę Deluxe możesz zakupić w dwóch rozmiarach: 60 cm i 73 cm. Jeśli zwykle trzymasz robótkę wyżej, blisko brody, polecamy rozmiar 60 cm. Jeśli natomiast wolisz trzymać robótkę na kolanach, rozmiar 73 cm będzie dla Ciebie lepszym rozwiązaniem.</p><p><strong>Postępuj zgodnie z naszymi instrukcjami jak poprawnie wkładać baterie (patrz zdjęcie).</strong>\n</p><p><em>Dane techniczne</em>\nLumen: 20-25 lm\nKelvin: między 6500-7500 kelvin</p>', '', 'lampa-na-szyje-deluxe-czerwony', '', '', '', 'Lampa na szyję Deluxe - Czerwony', '', '', '', ''),
(10411, 1, 2, '<p><strong>Edycja limitowana!</strong></p><p>Nie mogliśmy się opanować i nagle wpadliśmy w świąteczny nastrój, kiedy musieliśmy zdecydować o jaki kolor wzbogacić naszą rodzinę lamp na szyję. Dlatego już teraz możemy zaprezentować tę nową, piękną lampę na szyję w najpiękniejszym, świątecznym czerwonym kolorze. Dostępna w limitowanej partii, więc zdobądź ją już teraz.</p><p>Jest to idealne rozwiązanie dla tych, którzy chcą pracować przy odpowiednim oświetleniu. Można ją zawiesić na szyi, dzięki czemu masz wolne ręce.</p><p>Lampa na szyję Deluxe umożliwia wybór pomiędzy 2 poziomami jasności. Aby dopasować skalę świecenia, wystarczy, że naciśniesz i przytrzymasz przycisk włączania/wyłączania:</p><p>1. naciśnięcie: Lampa włącza się (50% jasności)\n2. naciśnięcie: Lampa wyłącza się\n3. naciśnięcie: Lampa włącza się (100% jasności)\n4. naciśnięcie: Lampa wyłącza się\n</p><p>To nie wszystko! Obie końcówki lampy wyposażone są w żarówki LED, których można używać razem lub osobno. Dzięki temu możesz oświetlić 2 różne rzeczy jednocześnie np. robótkę i wzór.</p><p>Lampę Deluxe możesz zakupić w dwóch rozmiarach: 60 cm i 73 cm. Jeśli zwykle trzymasz robótkę wyżej, blisko brody, polecamy rozmiar 60 cm. Jeśli natomiast wolisz trzymać robótkę na kolanach, rozmiar 73 cm będzie dla Ciebie lepszym rozwiązaniem.</p><p><strong>Postępuj zgodnie z naszymi instrukcjami jak poprawnie wkładać baterie (patrz zdjęcie).</strong>\n</p><p><em>Dane techniczne</em>\nLumen: 20-25 lm\nKelvin: między 6500-7500 kelvin</p>', '', 'lampa-na-szyje-deluxe-czerwony', '', '', '', 'Lampa na szyję Deluxe - Czerwony', '', '', '', ''),
(10412, 1, 1, '<p>Elektroniczny licznik rzędów bardzo przydatny do robótek na drutach lub szydełku. Można go łatwo założyć na palec i liczyć bez konieczności odkładania robótki.\n</p><p>Gdy licznik wyłączy się po kwadransie, zapamiętuje ostatni rząd, a gdy ponownie zostanie włączony pokazuje na którym rzędzie zakończyliśmy pracę. Jeśli ma zostać zresetowany do 0, po prostu naciśnij \"\"Resetuj\"\".</p><p>Niezbędne narzędzie dla tych, którzy kochają robić na drutach lub szydełku!</p><p><em>Uwaga! Licznik rzędów nie może być ponownie użyty, ponieważ nie można wymienić w nim baterii.</em></p>', '', 'elektroniczny-licznik-rzedow', '', '', '', 'Elektroniczny Licznik Rzędów', '', '', '', ''),
(10412, 1, 2, '<p>Elektroniczny licznik rzędów bardzo przydatny do robótek na drutach lub szydełku. Można go łatwo założyć na palec i liczyć bez konieczności odkładania robótki.\n</p><p>Gdy licznik wyłączy się po kwadransie, zapamiętuje ostatni rząd, a gdy ponownie zostanie włączony pokazuje na którym rzędzie zakończyliśmy pracę. Jeśli ma zostać zresetowany do 0, po prostu naciśnij \"\"Resetuj\"\".</p><p>Niezbędne narzędzie dla tych, którzy kochają robić na drutach lub szydełku!</p><p><em>Uwaga! Licznik rzędów nie może być ponownie użyty, ponieważ nie można wymienić w nim baterii.</em></p>', '', 'elektroniczny-licznik-rzedow', '', '', '', 'Elektroniczny Licznik Rzędów', '', '', '', ''),
(10413, 1, 1, '<p>Igły do ​​wełny nadają się do zszywania końcówek. Oczko jest bardzo duże i dlatego można je łatwo nawlec. Mają one zakrzywioną końcówkę i nie są ostre, dzięki czemu nadają się szczególnie do projektów dla dzieci.</p>', '', 'igly-do-welny-igly-do-cerowania-z-zakrzywiona-koncowka-tworzywo-sztuczne', '', '', '', 'Igły do wełny/Igły do cerowania z zakrzywioną końcówką. Tworzywo sztuczne', '', '', '', ''),
(10413, 1, 2, '<p>Igły do ​​wełny nadają się do zszywania końcówek. Oczko jest bardzo duże i dlatego można je łatwo nawlec. Mają one zakrzywioną końcówkę i nie są ostre, dzięki czemu nadają się szczególnie do projektów dla dzieci.</p>', '', 'igly-do-welny-igly-do-cerowania-z-zakrzywiona-koncowka-tworzywo-sztuczne', '', '', '', 'Igły do wełny/Igły do cerowania z zakrzywioną końcówką. Tworzywo sztuczne', '', '', '', ''),
(10414, 1, 1, '<p>Kapitalny, mały pojemnik na igły, zamykany na zakręcane wieczko. Od teraz zawsze będziesz miała kontrolę nad przyborami do szycia i nigdy więcej się nie ukłujesz.</p><p>Uwaga: pojemnik nie zawiera igieł!</p>', '', 'pojemnik-na-igly', '', '', '', 'Pojemnik na igły', '', '', '', ''),
(10414, 1, 2, '<p>Kapitalny, mały pojemnik na igły, zamykany na zakręcane wieczko. Od teraz zawsze będziesz miała kontrolę nad przyborami do szycia i nigdy więcej się nie ukłujesz.</p><p>Uwaga: pojemnik nie zawiera igieł!</p>', '', 'pojemnik-na-igly', '', '', '', 'Pojemnik na igły', '', '', '', ''),
(10415, 1, 1, '<p>Czy Twoim własnoręcznie zrobionym misiom lub skrzatom brakuje małego dodatku? Jeśli chcesz dodać swoim figurką ładny detal i nadać eleganckiego wyglądu, w takim razie przyszyj im te ładne okulary.\n</p><p>Okulary są dostępne w dwóch rozmiarach i dwóch kolorach, więc mamy nadzieję, że będą pasować do Twoich szydełkowych i dziewiarskich projektów.</p><p>UWAGA! To nie jest zabawka.</p><p>\n</p>', '', 'miniaturowe-okulary-5-szt', '', '', '', 'Miniaturowe Okulary - 5 szt.', '', '', '', ''),
(10415, 1, 2, '<p>Czy Twoim własnoręcznie zrobionym misiom lub skrzatom brakuje małego dodatku? Jeśli chcesz dodać swoim figurką ładny detal i nadać eleganckiego wyglądu, w takim razie przyszyj im te ładne okulary.\n</p><p>Okulary są dostępne w dwóch rozmiarach i dwóch kolorach, więc mamy nadzieję, że będą pasować do Twoich szydełkowych i dziewiarskich projektów.</p><p>UWAGA! To nie jest zabawka.</p><p>\n</p>', '', 'miniaturowe-okulary-5-szt', '', '', '', 'Miniaturowe Okulary - 5 szt.', '', '', '', ''),
(10416, 1, 1, '<p>Bezpieczne oczy – zwane także oczkami amigurumi – do własnoręcznie wykonanych pluszowych misiów i figurek. Mogą być używane do projektów robionych na drutach, szydełkowanych lub szytych, a w Hobbii znajdziesz je w wielu rozmiarach.</p><p>To zestaw składający się z czterech różnych rozmiarów.\n</p><p>Wszystkie zestawy zawierają plastikowe elementy zabezpieczające, które będą potrzebne podczas montażu oczu. ALE zawsze należy postępować zgodnie z naszą szczegółową instrukcją prawidłowego montażu! Na tej stronie znajdziesz przewodniki wideo, które dokładnie omawiają niezbędne wymagania montażowe, dzięki czemu Twoje własnoręcznie wykonane projekty dla dzieci w wieku 0-3 lat, spełnią te same wymagania dotyczące wytrzymałości i bezpieczeństwa, co gotowe zabawki!</p><p><strong>Wymagania bezpieczeństwa, z którymi należy się zapoznać przed założeniem bezpiecznych oczu:</strong></p><p>- Przed montażem należy sprawdzić, czy wszystkie części oka są nienaruszone i nieuszkodzone.</p><p>- Zalecamy roztopić tylną część po zamontowaniu oka. To proste i zajmuje tylko chwilę. Ta metoda gwarantuje, że zatyczka nigdy się nie poluzuje. Metoda często stosowana w przypadku zakupionych zabawek.</p><p>- Gęstość ściegu na drutach lub szydełku, a także rodzaj włóczki decydują o tym, jak bezpiecznie zamocowane jest oczko. Dlatego też, gdy gotowy projekt jest dla dzieci w wieku 0-3 lat, należy go zabezpieczyć wszywając siatkę pod zatyczką i zakładając wyszydełkowaną osłonę wokół tylnej części oka. Zobacz zdjęcia i film instruktażowy.</p><p>- Zawsze pamiętaj, aby sprawdzić ukończony produkt, upewniając się, że wszystkie części są solidnie, mocno i bezpiecznie zamontowane.</p><p>- Wykonuj regularne kontrole! Należy pamiętać, że wszystkie produkty z czasem ulegają zużyciu. Dlatego należy regularnie sprawdzać, czy oczy są nadal nienaruszone i porządnie zamocowane. Jako twórca domowych wyrobów dla dzieci w wieku 0-3 lat, Twoja praca wiąże się z dużą odpowiedzialnością.</p><p>Zalecamy dokładne zapoznanie się z niniejszą instrukcją. Szczegółowy przewodnik Go Handmade dotyczący bezpiecznego obchodzenia się i montażu projektów DIY z włóczki znajdziesz <a href=\"https://shop11802.sfstatic.io/upload_dir/docs/Sikkerhedsguide/PL_Guide_2024_3.pdf\"><strong>tutaj</strong></a>.</p><p><em>Psst.. Jeśli masz wątpliwości czy montaż jest bezpieczny, zalecamy wyhaftowanie oczu. To bezpieczne i piękne rozwiązanie, dla którego na tej stronie przygotowaliśmy także przewodnik wideo.</em></p>', '', 'oczka-zaciskowe-mix', '', '', '', 'Oczka zaciskowe - Mix', '', '', '', ''),
