 dokładne zapoznanie się z niniejszą instrukcją. Szczegółowy przewodnik Go Handmade dotyczący bezpiecznego obchodzenia się i montażu projektów DIY z włóczki znajdziesz <a href=\"https://shop11802.sfstatic.io/upload_dir/docs/Sikkerhedsguide/PL_Guide_2024_3.pdf\"><strong>tutaj</strong></a>.</p><p><em>Psst.. Jeśli masz wątpliwości czy montaż jest bezpieczny, zalecamy wyhaftowanie oczu. To bezpieczne i piękne rozwiązanie, dla którego na tej stronie przygotowaliśmy także przewodnik wideo.</em></p>', '', 'oczka-zaciskowe-mix', '', '', '', 'Oczka zaciskowe - Mix', '', '', '', ''),
(10417, 1, 1, '<p>W Hobbi jesteśmy, jak zawsze, podekscytowani sezonem świątecznym. Niesie on ze sobą niesamowitą przytulność - zapach świątecznych ciasteczek, tu i ówdzie ozdoby świąteczne, trzaskający płomień w kominku, a także cudowne chwile z włóczką w dłoniach.\n</p><p>Prezentujemy tegoroczny kalendarz adwentowy, stworzony we współpracy z niesamowitą Toni Lipsey, kobietą stojącą za TL Yarn Crafts i jej równie niesamowitą mamą, Gwendolyn Jones, znaną również jako Mama Gwen.</p><p>\n</p><p>Ten kalendarz jest idealny dla tych, którzy uwielbiają dziergać na drutach, kochają niespodzianki i świąteczną atmosferę. Kalendarz składa się z czterech pakietów. Jeden pakiet na każdą niedzielę Adwentu. W każdym pakiecie znajdziesz wspaniałe połączenie ulubionej włóczki Hobbii i uroczych akcesoriów, a także unikalny link i kod QR, który daje dostęp do zupełnie nowego wzoru dziewiarskiego od Mamy Gwen.</p><p>\n</p><p>Podczas gdy Ty z niecierpliwością czekasz na otwarcie swojego kalendarza adwentowego, możesz wykorzystać ten czas na znalezienie drutów na żyłce w rozmiarach 3,5 mm / 4 mm / 4,5 mm / 5,5 mm – na pewno będą Ci potrzebne!</p><p>Mamy nadzieję, że nasz kalendarz adwentowy sprawi, że grudzień będzie jeszcze bardziej magiczny i przytulny. Ciesz się więc na czas wypełniony dziewiarską radością i świątecznym duchem!</p><p>\n</p><p>Ten kalendarz adwentowy jest również idealnym prezentem na Boże Narodzenie dla bliskiej Ci osoby, która uwielbia dziergać na drutach.</p><p>Wesołych Świąt Bożego Narodzenia – i moc dziewiarskiej przytulności!</p><p>\n</p><p>Uwaga: Jeśli zamówisz kalendarz adwentowy razem z innymi produktami, pozostała część zamówienia zostanie wysłana osobno. Nie martw się – nie ma żadnych dodatkowych kosztów wysyłki dla całego zamówienia.</p><p>\n</p><p><em>Kalendarz adwentowy nie jest odpowiedni dla osób z alergią na wełnę.</em></p>', '', 'kalendarz-adwentowy-dla-dziergajacych-na-drutach', '', '', '', 'Kalendarz Adwentowy dla Dziergających na drutach', '', '', '', ''),
(10417, 1, 2, '<p>W Hobbi jesteśmy, jak zawsze, podekscytowani sezonem świątecznym. Niesie on ze sobą niesamowitą przytulność - zapach świątecznych ciasteczek, tu i ówdzie ozdoby świąteczne, trzaskający płomień w kominku, a także cudowne chwile z włóczką w dłoniach.\n</p><p>Prezentujemy tegoroczny kalendarz adwentowy, stworzony we współpracy z niesamowitą Toni Lipsey, kobietą stojącą za TL Yarn Crafts i jej równie niesamowitą mamą, Gwendolyn Jones, znaną również jako Mama Gwen.</p><p>\n</p><p>Ten kalendarz jest idealny dla tych, którzy uwielbiają dziergać na drutach, kochają niespodzianki i świąteczną atmosferę. Kalendarz składa się z czterech pakietów. Jeden pakiet na każdą niedzielę Adwentu. W każdym pakiecie znajdziesz wspaniałe połączenie ulubionej włóczki Hobbii i uroczych akcesoriów, a także unikalny link i kod QR, który daje dostęp do zupełnie nowego wzoru dziewiarskiego od Mamy Gwen.</p><p>\n</p><p>Podczas gdy Ty z niecierpliwością czekasz na otwarcie swojego kalendarza adwentowego, możesz wykorzystać ten czas na znalezienie drutów na żyłce w rozmiarach 3,5 mm / 4 mm / 4,5 mm / 5,5 mm – na pewno będą Ci potrzebne!</p><p>Mamy nadzieję, że nasz kalendarz adwentowy sprawi, że grudzień będzie jeszcze bardziej magiczny i przytulny. Ciesz się więc na czas wypełniony dziewiarską radością i świątecznym duchem!</p><p>\n</p><p>Ten kalendarz adwentowy jest również idealnym prezentem na Boże Narodzenie dla bliskiej Ci osoby, która uwielbia dziergać na drutach.</p><p>Wesołych Świąt Bożego Narodzenia – i moc dziewiarskiej przytulności!</p><p>\n</p><p>Uwaga: Jeśli zamówisz kalendarz adwentowy razem z innymi produktami, pozostała część zamówienia zostanie wysłana osobno. Nie martw się – nie ma żadnych dodatkowych kosztów wysyłki dla całego zamówienia.</p><p>\n</p><p><em>Kalendarz adwentowy nie jest odpowiedni dla osób z alergią na wełnę.</em></p>', '', 'kalendarz-adwentowy-dla-dziergajacych-na-drutach', '', '', '', 'Kalendarz Adwentowy dla Dziergających na drutach', '', '', '', ''),
(10418, 1, 1, '<p>Jumbo znaczniki ściegów zawierają 15 szt. dużych znaczników w trzech różnych kolorach. Znaczniki posiadają zapięcie, dzięki czemu można je otworzyć i zdjąć z drutów w dowolnym momencie. Możesz również przymocować je do oczek zamiast do drutów. Końcówki są zaokrąglone, dzięki czemu nie kłują i są szczególnie odpowiednie do grubej przędzy dziewiarskiej. Nadają się na druty od 7-12 mm.\n</p><p>Znaczniki to świetny gadżet, zaznaczysz nimi miejsce, w którym należy odejmować lub dodawać oczka, motyw wzoru, lub po prostu zaznaczysz początek okrążenia.</p><p>\n</p>', '', 'znaczniki-sciegow-jumbo-z-zamknieciem', '', '', '', 'Znaczniki ściegów Jumbo z zamknięciem', '', '', '', ''),
(10418, 1, 2, '<p>Jumbo znaczniki ściegów zawierają 15 szt. dużych znaczników w trzech różnych kolorach. Znaczniki posiadają zapięcie, dzięki czemu można je otworzyć i zdjąć z drutów w dowolnym momencie. Możesz również przymocować je do oczek zamiast do drutów. Końcówki są zaokrąglone, dzięki czemu nie kłują i są szczególnie odpowiednie do grubej przędzy dziewiarskiej. Nadają się na druty od 7-12 mm.\n</p><p>Znaczniki to świetny gadżet, zaznaczysz nimi miejsce, w którym należy odejmować lub dodawać oczka, motyw wzoru, lub po prostu zaznaczysz początek okrążenia.</p><p>\n</p>', '', 'znaczniki-sciegow-jumbo-z-zamknieciem', '', '', '', 'Znaczniki ściegów Jumbo z zamknięciem', '', '', '', ''),
(10419, 1, 1, '<p>100 zamykanych znaczników do ściegu w małym, praktycznym pudełku z przegrodami. \'Ślimaczki\' są bardzo przydatne do zaznaczania początków i końców wzorów, gdzie masz wprowadzić lub wyprowadzić nić, lub gdzie kolejna runda ma się zacząć.</p><p>Końcówki znaczników są zaokrąglone tak aby nie ukłuły oraz aby pasowały do zarówno cieńkich jak i normalnych przędzy.</p><p>Znaczniki mają 10 różnych kolorów rozłożonych na 10 przegród.</p>', '', 'znaczniki-sciegow-100-sztuk', '', '', '', 'Znaczniki ściegów - 100 sztuk', '', '', '', ''),
(10419, 1, 2, '<p>100 zamykanych znaczników do ściegu w małym, praktycznym pudełku z przegrodami. \'Ślimaczki\' są bardzo przydatne do zaznaczania początków i końców wzorów, gdzie masz wprowadzić lub wyprowadzić nić, lub gdzie kolejna runda ma się zacząć.</p><p>Końcówki znaczników są zaokrąglone tak aby nie ukłuły oraz aby pasowały do zarówno cieńkich jak i normalnych przędzy.</p><p>Znaczniki mają 10 różnych kolorów rozłożonych na 10 przegród.</p>', '', 'znaczniki-sciegow-100-sztuk', '', '', '', 'Znaczniki ściegów - 100 sztuk', '', '', '', ''),
(10420, 1, 1, '<p>Praktyczna, lekka i pojemna torba na przechowywanie włóczek, akcesoriów, wzorów, drutów itp. Torba pomieści około 25 kłębków (50 g każdy) - w zależności od tego czy są one wykonane z wełny, bawełny czy akrylu. Na wierzchu torby znajdują się 2 otwory, przez które możesz przeciągnąć nici, dzięki czemu możesz w niej ułożyć przędze na czas pracy z robótką.\n</p><p>Razem z torbą otrzymasz małe etui z paskiem na ramię, który może zostać przymocowany do torby tak abyś mogła ją zabrać w podróż.</p><p>Torba wyposażona jest w:</p><ul><li><p>1 przegrodę zamykaną na zamek błyskawiczny</p></li><li><p>2 otwarte przegrody z kieszonkami</p></li><li><p>10 małych kieszonek na druty</p></li><li><p>8 małych kieszonek na szydełka w różnych rozmiarach</p></li></ul><p>Torba jest po prostu idealna, jeśli chcesz zabrać swoje przyrządy do dziergania w podróż.</p>', '', 'torba-na-wloczki', '', '', '', 'Torba na włóczki', '', '', '', ''),
(10420, 1, 2, '<p>Praktyczna, lekka i pojemna torba na przechowywanie włóczek, akcesoriów, wzorów, drutów itp. Torba pomieści około 25 kłębków (50 g każdy) - w zależności od tego czy są one wykonane z wełny, bawełny czy akrylu. Na wierzchu torby znajdują się 2 otwory, przez które możesz przeciągnąć nici, dzięki czemu możesz w niej ułożyć przędze na czas pracy z robótką.\n</p><p>Razem z torbą otrzymasz małe etui z paskiem na ramię, który może zostać przymocowany do torby tak abyś mogła ją zabrać w podróż.</p><p>Torba wyposażona jest w:</p><ul><li><p>1 przegrodę zamykaną na zamek błyskawiczny</p></li><li><p>2 otwarte przegrody z kieszonkami</p></li><li><p>10 małych kieszonek na druty</p></li><li><p>8 małych kieszonek na szydełka w różnych rozmiarach</p></li></ul><p>Torba jest po prostu idealna, jeśli chcesz zabrać swoje przyrządy do dziergania w podróż.</p>', '', 'torba-na-wloczki', '', '', '', 'Torba na włóczki', '', '', '', ''),
(10421, 1, 1, '<p>Ten miernik to bardzo pomocny gadżet, dzięki któremu szybko sprawdzisz w jakim rozmiarze jest dany drut. Zmierzy on druty o grubościach 2-10 mm. Miernik jest prostokątny a jego dłuższy bok ma linijkę na 14 cm, której możesz użyć do zmierzenia oczek czy rzędów.</p>', '', 'miernik-rozmiarow-drutow', '', '', '', 'Miernik rozmiarów drutów', '', '', '', ''),
(10421, 1, 2, '<p>Ten miernik to bardzo pomocny gadżet, dzięki któremu szybko sprawdzisz w jakim rozmiarze jest dany drut. Zmierzy on druty o grubościach 2-10 mm. Miernik jest prostokątny a jego dłuższy bok ma linijkę na 14 cm, której możesz użyć do zmierzenia oczek czy rzędów.</p>', '', 'miernik-rozmiarow-drutow', '', '', '', 'Miernik rozmiarów drutów', '', '', '', ''),
(10422, 1, 1, '<p>Praktyczny zestaw żyłek ze stali nierdzewnej z obrotowym złączem 360°. Swivel żyłki firmy KnitPro są wysokiej jakości, wytrzymałe i elastyczne. Zakończone gwintem zapewniającym gładkie i płynne połączenie z drutami, a obrót o 360 stopni znacznie ułatwia pracę.</p><p>Fioletowe żyłki stalowe z delikatną i gładką powłoką. Bez efektu ”pamięci”, co oznacza, że nie skręcają się i za każdym razem łatwo rozprostowują.\n</p><p><strong>W zestawie znajduje się:</strong>\n</p><ul><li><p>1 żyłka</p></li><li><p>2 stopery</p></li><li><p>1 klucz ułatwiający przykręcenie</p></li></ul><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami firmy KnitPro!</p><p>Metalowy kluczyk służy do dokręcenia żyłki z drutami, aby druty nie odkręciły się podczas pracy. Włóż końcówkę klucza przez mały otwór w gwincie i mocno dokręć drut, trzymając klucz w miejscu. Na tej stronie znajdziesz link do filmu.</p><p>Jeśli potrzebujesz drutów wymiennych bez żyłki możesz wykorzystać stopery i przykręcić je do żyłki. W ten sposób robótka pozostanie na żyłce, a ty możesz wykorzystać druty do innego projektu. Stopery przykręcasz do żyłki w taki sam sposób jak druty.</p><p><strong>Pssst! Zwróć uwagę, że podana długość to całkowita długość żyłki z drutami:</strong>\n</p><p></p><p>40 cm: żyłka ma 20 cm długości bez drutów\n50 cm: żyłka ma 28 cm długości bez drutów\n60 cm: żyłka ma 35 cm długości bez drutów\n80 cm: żyłka ma 56 cm długości bez drutów\n100 cm: żyłka ma 76 cm długości bez drutów\n</p>', '', 'swivel-zylki-do-wymiennych-drutow-purple', '', '', '', 'Swivel Żyłki do wymiennych drutów - Purple', '', '', '', ''),
(10422, 1, 2, '<p>Praktyczny zestaw żyłek ze stali nierdzewnej z obrotowym złączem 360°. Swivel żyłki firmy KnitPro są wysokiej jakości, wytrzymałe i elastyczne. Zakończone gwintem zapewniającym gładkie i płynne połączenie z drutami, a obrót o 360 stopni znacznie ułatwia pracę.</p><p>Fioletowe żyłki stalowe z delikatną i gładką powłoką. Bez efektu ”pamięci”, co oznacza, że nie skręcają się i za każdym razem łatwo rozprostowują.\n</p><p><strong>W zestawie znajduje się:</strong>\n</p><ul><li><p>1 żyłka</p></li><li><p>2 stopery</p></li><li><p>1 klucz ułatwiający przykręcenie</p></li></ul><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami firmy KnitPro!</p><p>Metalowy kluczyk służy do dokręcenia żyłki z drutami, aby druty nie odkręciły się podczas pracy. Włóż końcówkę klucza przez mały otwór w gwincie i mocno dokręć drut, trzymając klucz w miejscu. Na tej stronie znajdziesz link do filmu.</p><p>Jeśli potrzebujesz drutów wymiennych bez żyłki możesz wykorzystać stopery i przykręcić je do żyłki. W ten sposób robótka pozostanie na żyłce, a ty możesz wykorzystać druty do innego projektu. Stopery przykręcasz do żyłki w taki sam sposób jak druty.</p><p><strong>Pssst! Zwróć uwagę, że podana długość to całkowita długość żyłki z drutami:</strong>\n</p><p></p><p>40 cm: żyłka ma 20 cm długości bez drutów\n50 cm: żyłka ma 28 cm długości bez drutów\n60 cm: żyłka ma 35 cm długości bez drutów\n80 cm: żyłka ma 56 cm długości bez drutów\n100 cm: żyłka ma 76 cm długości bez drutów\n</p>', '', 'swivel-zylki-do-wymiennych-drutow-purple', '', '', '', 'Swivel Żyłki do wymiennych drutów - Purple', '', '', '', ''),
(10423, 1, 1, '<p>Igły są dostępne w pięknych kolorach, dlatego są niemal must-have. W opakowaniu otrzymujesz dwie igły do wełny/igły do cerowania z zaokrągloną końcówką, co ułatwia zszywanie końcówek włóczki. Oczko jest duże i łatwe do nawleczenia.</p>', '', 'igly-do-welny-igly-do-cerowania-z-zaokraglona-koncowka', '', '', '', 'Igły do wełny/Igły do cerowania z zaokrągloną końcówką', '', '', '', ''),
(10423, 1, 2, '<p>Igły są dostępne w pięknych kolorach, dlatego są niemal must-have. W opakowaniu otrzymujesz dwie igły do wełny/igły do cerowania z zaokrągloną końcówką, co ułatwia zszywanie końcówek włóczki. Oczko jest duże i łatwe do nawleczenia.</p>', '', 'igly-do-welny-igly-do-cerowania-z-zaokraglona-koncowka', '', '', '', 'Igły do wełny/Igły do cerowania z zaokrągloną końcówką', '', '', '', ''),
(10424, 1, 1, '<p>W Hobbi jesteśmy, jak zawsze, podekscytowani sezonem świątecznym. Niesie on ze sobą niesamowitą przytulność - zapach świątecznych ciasteczek, tu i ówdzie ozdoby świąteczne, trzaskający płomień w kominku, a także cudowne chwile z włóczką w dłoniach.\n</p><p>Prezentujemy tegoroczny kalendarz adwentowy, stworzony we współpracy z niesamowitą Toni Lipsey, kobietą stojącą za TL Yarn Crafts i jej równie niesamowitą mamą, Gwendolyn Jones, znaną również jako Mama Gwen.</p><p>\n</p><p>Ten kalendarz jest idealny dla tych, którzy uwielbiają szydełkować, kochają niespodzianki i świąteczną atmosferę. Kalendarz składa się z czterech pakietów. Jeden pakiet na każdą niedzielę Adwentu. W każdym pakiecie znajdziesz wspaniałe połączenie ulubionej włóczki Hobbii i uroczych akcesoriów, a także unikalny link i kod QR, który daje dostęp do zupełnie nowego wzoru szydełkowego od TL Yarn Crafts.</p><p>\n</p><p>Podczas gdy Ty z niecierpliwością czekasz na otwarcie swojego kalendarza adwentowego, możesz wykorzystać ten czas na znalezienie szydełek w rozmiarach 3,25 mm i 4 mm - na pewno będą Ci potrzebne! Kalendarz adwentowy zawiera jeden projekt, wykonany szydełkiem tunezyjskim. Ale nie martw się! Toni poprowadzi Cię przez ten proces za pomocą przyjaznego dla początkujących samouczka wideo. W zestawie otrzymasz również tunezyjskie szydełko.</p><p>\n</p><p>Mamy nadzieję, że nasz kalendarz adwentowy sprawi, że grudzień będzie jeszcze bardziej magiczny i przytulny. Ciesz się więc na czas wypełniony szydełkową radością i świątecznym duchem!</p><p>\n</p><p>Ten kalendarz adwentowy jest również idealnym prezentem na Boże Narodzenie dla bliskiej Ci osoby, która uwielbia szydełkować.</p><p>\n</p><p>Wesołych Świąt Bożego Narodzenia – i moc szydełkowej przytulności!</p><p>\n</p><p>Uwaga: Jeśli zamówisz kalendarz adwentowy razem z innymi produktami, pozostała część zamówienia zostanie wysłana osobno. Nie martw się – nie ma żadnych dodatkowych kosztów wysyłki dla całego zamówienia.</p><p>\n</p><p><em>Kalendarz adwentowy nie jest odpowiedni dla osób z alergią na wełnę.</em></p>', '', 'kalendarz-adwentowy-dla-szydelkujacych', '', '', '', 'Kalendarz Adwentowy dla Szydełkujących', '', '', '', ''),
(10424, 1, 2, '<p>W Hobbi jesteśmy, jak zawsze, podekscytowani sezonem świątecznym. Niesie on ze sobą niesamowitą przytulność - zapach świątecznych ciasteczek, tu i ówdzie ozdoby świąteczne, trzaskający płomień w kominku, a także cudowne chwile z włóczką w dłoniach.\n</p><p>Prezentujemy tegoroczny kalendarz adwentowy, stworzony we współpracy z niesamowitą Toni Lipsey, kobietą stojącą za TL Yarn Crafts i jej równie niesamowitą mamą, Gwendolyn Jones, znaną również jako Mama Gwen.</p><p>\n</p><p>Ten kalendarz jest idealny dla tych, którzy uwielbiają szydełkować, kochają niespodzianki i świąteczną atmosferę. Kalendarz składa się z czterech pakietów. Jeden pakiet na każdą niedzielę Adwentu. W każdym pakiecie znajdziesz wspaniałe połączenie ulubionej włóczki Hobbii i uroczych akcesoriów, a także unikalny link i kod QR, który daje dostęp do zupełnie nowego wzoru szydełkowego od TL Yarn Crafts.</p><p>\n</p><p>Podczas gdy Ty z niecierpliwością czekasz na otwarcie swojego kalendarza adwentowego, możesz wykorzystać ten czas na znalezienie szydełek w rozmiarach 3,25 mm i 4 mm - na pewno będą Ci potrzebne! Kalendarz adwentowy zawiera jeden projekt, wykonany szydełkiem tunezyjskim. Ale nie martw się! Toni poprowadzi Cię przez ten proces za pomocą przyjaznego dla początkujących samouczka wideo. W zestawie otrzymasz również tunezyjskie szydełko.</p><p>\n</p><p>Mamy nadzieję, że nasz kalendarz adwentowy sprawi, że grudzień będzie jeszcze bardziej magiczny i przytulny. Ciesz się więc na czas wypełniony szydełkową radością i świątecznym duchem!</p><p>\n</p><p>Ten kalendarz adwentowy jest również idealnym prezentem na Boże Narodzenie dla bliskiej Ci osoby, która uwielbia szydełkować.</p><p>\n</p><p>Wesołych Świąt Bożego Narodzenia – i moc szydełkowej przytulności!</p><p>\n</p><p>Uwaga: Jeśli zamówisz kalendarz adwentowy razem z innymi produktami, pozostała część zamówienia zostanie wysłana osobno. Nie martw się – nie ma żadnych dodatkowych kosztów wysyłki dla całego zamówienia.</p><p>\n</p><p><em>Kalendarz adwentowy nie jest odpowiedni dla osób z alergią na wełnę.</em></p>', '', 'kalendarz-adwentowy-dla-szydelkujacych', '', '', '', 'Kalendarz Adwentowy dla Szydełkujących', '', '', '', ''),
(10425, 1, 1, '<p>Bezpieczne oczy – zwane także oczkami amigurumi – do własnoręcznie wykonanych pluszowych misiów i figurek. Mogą być używane do projektów robionych na drutach, szydełkowanych lub szytych, a w Hobbii znajdziesz je w wielu rozmiarach.</p><p>To zestaw składający się z czterech różnych rozmiarów.\n</p><p>Wszystkie zestawy zawierają plastikowe elementy zabezpieczające, które będą potrzebne podczas montażu oczu. ALE zawsze należy postępować zgodnie z naszą szczegółową instrukcją prawidłowego montażu! Na tej stronie znajdziesz przewodniki wideo, które dokładnie omawiają niezbędne wymagania montażowe, dzięki czemu Twoje własnoręcznie wykonane projekty dla dzieci w wieku 0-3 lat, spełnią te same wymagania dotyczące wytrzymałości i bezpieczeństwa, co gotowe zabawki!</p><p><strong>Wymagania bezpieczeństwa, z którymi należy się zapoznać przed założeniem bezpiecznych oczu:</strong></p><p>- Przed montażem należy sprawdzić, czy wszystkie części oka są nienaruszone i nieuszkodzone.</p><p>- Zalecamy roztopić tylną część po zamontowaniu oka. To proste i zajmuje tylko chwilę. Ta metoda gwarantuje, że zatyczka nigdy się nie poluzuje. Metoda często stosowana w przypadku zakupionych zabawek.</p><p>- Gęstość ściegu na drutach lub szydełku, a także rodzaj włóczki decydują o tym, jak bezpiecznie zamocowane jest oczko. Dlatego też, gdy gotowy projekt jest dla dzieci w wieku 0-3 lat, należy go zabezpieczyć wszywając siatkę pod zatyczką i zakładając wyszydełkowaną osłonę wokół tylnej części oka. Zobacz zdjęcia i film instruktażowy.</p><p>- Zawsze pamiętaj, aby sprawdzić ukończony produkt, upewniając się, że wszystkie części są solidnie, mocno i bezpiecznie zamontowane.</p><p>- Wykonuj regularne kontrole! Należy pamiętać, że wszystkie produkty z czasem ulegają zużyciu. Dlatego należy regularnie sprawdzać, czy oczy są nadal nienaruszone i porządnie zamocowane. Jako twórca domowych wyrobów dla dzieci w wieku 0-3 lat, Twoja praca wiąże się z dużą odpowiedzialnością.</p><p>Zalecamy dokładne zapoznanie się z niniejszą instrukcją. Szczegółowy przewodnik Go Handmade dotyczący bezpiecznego obchodzenia się i montażu projektów DIY z włóczki znajdziesz <a href=\"https://shop11802.sfstatic.io/upload_dir/docs/Sikkerhedsguide/PL_Guide_2024_3.pdf\"><strong>tutaj</strong></a>.</p><p><em>Psst.. Jeśli masz wątpliwości czy montaż jest bezpieczny, zalecamy wyhaftowanie oczu. To bezpieczne i piękne rozwiązanie, dla którego na tej stronie przygotowaliśmy także przewodnik wideo.</em></p>', '', 'oczka-zaciskowe-mix', '', '', '', 'Oczka zaciskowe - Mix', '', '', '', ''),
