 dokładne zapoznanie się z niniejszą instrukcją. Szczegółowy przewodnik Go Handmade dotyczący bezpiecznego obchodzenia się i montażu projektów DIY z włóczki znajdziesz <a href=\"https://shop11802.sfstatic.io/upload_dir/docs/Sikkerhedsguide/PL_Guide_2024_3.pdf\"><strong>tutaj</strong></a>.</p><p><em>Psst.. Jeśli masz wątpliwości czy montaż jest bezpieczny, zalecamy wyhaftowanie oczu. To bezpieczne i piękne rozwiązanie, dla którego na tej stronie przygotowaliśmy także przewodnik wideo.</em></p>', '', 'oczka-zaciskowe-mix', '', '', '', 'Oczka zaciskowe - Mix', '', '', '', ''),
(10426, 1, 1, '<p>Eleganckie i ładne nożyczki o wysokiej jakości. Uchwyty przypominają kształtem bociana, co nadaje im fantastyczny wygląd. Perfekcyjnie sprawdzą się przy mniejszych projektach.</p>', '', 'nozyczki-stork-large', '', '', '', 'Nożyczki - Stork - Large', '', '', '', ''),
(10426, 1, 2, '<p>Eleganckie i ładne nożyczki o wysokiej jakości. Uchwyty przypominają kształtem bociana, co nadaje im fantastyczny wygląd. Perfekcyjnie sprawdzą się przy mniejszych projektach.</p>', '', 'nozyczki-stork-large', '', '', '', 'Nożyczki - Stork - Large', '', '', '', ''),
(10427, 1, 1, '<p>Świetny zamek błyskawiczny idealnie nadający się do stójki w ręcznie zrobionym swetrze. Ozdobna przywieszka, jako ładny detal do Twojego swetra.\n</p><p>Zamek jest nierozdzielczy.</p><p><strong>Długość</strong>: 35 cm\n<strong>Szerokość</strong>: 3 cm\n<strong>Szerokość zamka</strong>: 6 mm\n<strong>Ilość</strong>: 1 szt.\n<strong>Materiał</strong>: Poliester &amp; Antyczny mosiądz\n<strong>Instrukcja prania</strong>: 40°C\n</p><p></p>', '', 'zamek-blyskawiczny-antyczny-mosiadz', '', '', '', 'Zamek błyskawiczny – Antyczny Mosiądz', '', '', '', ''),
(10427, 1, 2, '<p>Świetny zamek błyskawiczny idealnie nadający się do stójki w ręcznie zrobionym swetrze. Ozdobna przywieszka, jako ładny detal do Twojego swetra.\n</p><p>Zamek jest nierozdzielczy.</p><p><strong>Długość</strong>: 35 cm\n<strong>Szerokość</strong>: 3 cm\n<strong>Szerokość zamka</strong>: 6 mm\n<strong>Ilość</strong>: 1 szt.\n<strong>Materiał</strong>: Poliester &amp; Antyczny mosiądz\n<strong>Instrukcja prania</strong>: 40°C\n</p><p></p>', '', 'zamek-blyskawiczny-antyczny-mosiadz', '', '', '', 'Zamek błyskawiczny – Antyczny Mosiądz', '', '', '', ''),
(10428, 1, 1, '<p>Praktyczna, lekka i pojemna torba na przechowywanie włóczek, akcesoriów, wzorów, drutów itp. Torba pomieści około 25 kłębków (50 g każdy) - w zależności od tego czy są one wykonane z wełny, bawełny czy akrylu. Na wierzchu torby znajdują się 2 otwory, przez które możesz przeciągnąć nici, dzięki czemu możesz w niej ułożyć przędze na czas pracy z robótką.\n</p><p>Razem z torbą otrzymasz małe etui z paskiem na ramię, który może zostać przymocowany do torby tak abyś mogła ją zabrać w podróż.</p><p>Torba wyposażona jest w:</p><ul><li><p>1 przegrodę zamykaną na zamek błyskawiczny</p></li><li><p>2 otwarte przegrody z kieszonkami</p></li><li><p>10 małych kieszonek na druty</p></li><li><p>8 małych kieszonek na szydełka w różnych rozmiarach</p></li></ul><p>Torba jest po prostu idealna, jeśli chcesz zabrać swoje przyrządy do dziergania w podróż.</p>', '', 'torba-na-wloczki', '', '', '', 'Torba na włóczki', '', '', '', ''),
(10428, 1, 2, '<p>Praktyczna, lekka i pojemna torba na przechowywanie włóczek, akcesoriów, wzorów, drutów itp. Torba pomieści około 25 kłębków (50 g każdy) - w zależności od tego czy są one wykonane z wełny, bawełny czy akrylu. Na wierzchu torby znajdują się 2 otwory, przez które możesz przeciągnąć nici, dzięki czemu możesz w niej ułożyć przędze na czas pracy z robótką.\n</p><p>Razem z torbą otrzymasz małe etui z paskiem na ramię, który może zostać przymocowany do torby tak abyś mogła ją zabrać w podróż.</p><p>Torba wyposażona jest w:</p><ul><li><p>1 przegrodę zamykaną na zamek błyskawiczny</p></li><li><p>2 otwarte przegrody z kieszonkami</p></li><li><p>10 małych kieszonek na druty</p></li><li><p>8 małych kieszonek na szydełka w różnych rozmiarach</p></li></ul><p>Torba jest po prostu idealna, jeśli chcesz zabrać swoje przyrządy do dziergania w podróż.</p>', '', 'torba-na-wloczki', '', '', '', 'Torba na włóczki', '', '', '', ''),
(10429, 1, 1, '<p>Sprytny, manualny licznik rzędów w ładnym turkusowym kolorze. Kiedy zrobisz na drutach lub szydełku rząd, po prostu kliknij na biały przycisk u góry, aby zarejestrować, jak daleko zaszłaś w robótce. Jest to fantastyczna pomoc, gdy np. musisz odjąć oczka w każdym 6 rzędzie.</p><p>Licznik rzędów może liczyć do 99, a liczbę możesz poprawić lub zresetować za pomocą przycisków po bokach. Licznik posiada funkcję blokowania, co zapewnia, że nie leży i nie klika w torbie projektowej ;-)</p>', '', 'licznik-rzedow', '', '', '', 'Licznik rzędów', '', '', '', ''),
(10429, 1, 2, '<p>Sprytny, manualny licznik rzędów w ładnym turkusowym kolorze. Kiedy zrobisz na drutach lub szydełku rząd, po prostu kliknij na biały przycisk u góry, aby zarejestrować, jak daleko zaszłaś w robótce. Jest to fantastyczna pomoc, gdy np. musisz odjąć oczka w każdym 6 rzędzie.</p><p>Licznik rzędów może liczyć do 99, a liczbę możesz poprawić lub zresetować za pomocą przycisków po bokach. Licznik posiada funkcję blokowania, co zapewnia, że nie leży i nie klika w torbie projektowej ;-)</p>', '', 'licznik-rzedow', '', '', '', 'Licznik rzędów', '', '', '', ''),
(10430, 1, 1, '<p>Teraz możesz zdobyć naszą nową lampę na szyję w pięknym, charakterystycznym niebieskim kolorze Hobbii.</p><p>Jest to idealne rozwiązanie dla tych, którzy chcą pracować przy odpowiednim oświetleniu. Można ją zawiesić na szyi, dzięki czemu masz wolne ręce.</p><p>Lampa na szyję Deluxe umożliwia wybór pomiędzy 2 poziomami jasności. Aby dopasować skalę świecenia, wystarczy, że naciśniesz i przytrzymasz przycisk włączania/wyłączania:</p><p>1. naciśnięcie: Lampa włącza się (50% jasności)\n2. naciśnięcie: Lampa wyłącza się\n3. naciśnięcie: Lampa włącza się (100% jasności)\n4. naciśnięcie: Lampa wyłącza się\n</p><p>To nie wszystko! Obie końcówki lampy wyposażone są w żarówki LED, których można używać razem lub osobno. Dzięki temu możesz oświetlić 2 różne rzeczy jednocześnie np. robótkę i wzór.</p><p>Lampę Deluxe możesz zakupić w dwóch rozmiarach: 60 cm i 73 cm. Jeśli zwykle trzymasz robótkę wyżej, blisko brody, polecamy rozmiar 60 cm. Jeśli natomiast wolisz trzymać robótkę na kolanach, rozmiar 73 cm będzie dla Ciebie lepszym rozwiązaniem.</p><p><strong>Postępuj zgodnie z naszymi instrukcjami jak poprawnie wkładać baterie (patrz zdjęcie).</strong>\n</p><p><em>Dane techniczne</em>\nLumen: 20-25 lm\nKelvin: między 6500-7500 kelvin</p>', '', 'lampa-na-szyje-deluxe-niebieski', '', '', '', 'Lampa na szyję Deluxe - Niebieski', '', '', '', ''),
(10430, 1, 2, '<p>Teraz możesz zdobyć naszą nową lampę na szyję w pięknym, charakterystycznym niebieskim kolorze Hobbii.</p><p>Jest to idealne rozwiązanie dla tych, którzy chcą pracować przy odpowiednim oświetleniu. Można ją zawiesić na szyi, dzięki czemu masz wolne ręce.</p><p>Lampa na szyję Deluxe umożliwia wybór pomiędzy 2 poziomami jasności. Aby dopasować skalę świecenia, wystarczy, że naciśniesz i przytrzymasz przycisk włączania/wyłączania:</p><p>1. naciśnięcie: Lampa włącza się (50% jasności)\n2. naciśnięcie: Lampa wyłącza się\n3. naciśnięcie: Lampa włącza się (100% jasności)\n4. naciśnięcie: Lampa wyłącza się\n</p><p>To nie wszystko! Obie końcówki lampy wyposażone są w żarówki LED, których można używać razem lub osobno. Dzięki temu możesz oświetlić 2 różne rzeczy jednocześnie np. robótkę i wzór.</p><p>Lampę Deluxe możesz zakupić w dwóch rozmiarach: 60 cm i 73 cm. Jeśli zwykle trzymasz robótkę wyżej, blisko brody, polecamy rozmiar 60 cm. Jeśli natomiast wolisz trzymać robótkę na kolanach, rozmiar 73 cm będzie dla Ciebie lepszym rozwiązaniem.</p><p><strong>Postępuj zgodnie z naszymi instrukcjami jak poprawnie wkładać baterie (patrz zdjęcie).</strong>\n</p><p><em>Dane techniczne</em>\nLumen: 20-25 lm\nKelvin: między 6500-7500 kelvin</p>', '', 'lampa-na-szyje-deluxe-niebieski', '', '', '', 'Lampa na szyję Deluxe - Niebieski', '', '', '', ''),
(10431, 1, 1, '<p>Igły są dostępne w pięknych kolorach, dlatego są niemal „must-have”. W opakowaniu otrzymasz dwie igły do wełny/igły do cerowania z zakrzywioną i zaokrągloną końcówką, co ułatwia zszywanie końcówek włóczki. Oczko jest duże i pasuje do większości włóczek. Zakrzywiona końcówka ułatwia wprowadzenie igły pod oczka podczas zszywania końcówek oraz cerowania skarpet.</p>', '', 'igly-do-welny-igly-do-cerowania-z-zakrzywiona-i-zaokraglona-koncowka', '', '', '', 'Igły do wełny/Igły do cerowania z zakrzywioną i zaokrągloną końcówką', '', '', '', ''),
(10431, 1, 2, '<p>Igły są dostępne w pięknych kolorach, dlatego są niemal „must-have”. W opakowaniu otrzymasz dwie igły do wełny/igły do cerowania z zakrzywioną i zaokrągloną końcówką, co ułatwia zszywanie końcówek włóczki. Oczko jest duże i pasuje do większości włóczek. Zakrzywiona końcówka ułatwia wprowadzenie igły pod oczka podczas zszywania końcówek oraz cerowania skarpet.</p>', '', 'igly-do-welny-igly-do-cerowania-z-zakrzywiona-i-zaokraglona-koncowka', '', '', '', 'Igły do wełny/Igły do cerowania z zakrzywioną i zaokrągloną końcówką', '', '', '', ''),
(10432, 1, 1, '<p>Oto duża i piękna kolekcja plastikowych guzików w świątecznych kolorach. Otrzymasz czerwone, zielone i białe guziki, które mają średnicę 1, 2 lub 3 cm.\n</p><p>Wszystkie guziki mają 4 dziurki i płaski, okrągły kształt z krawędzią.</p><p>Mamy nadzieję, że te urocze guziki zainspirują Cię do rozkwitu Twojej świątecznej kreatywności!</p>', '', 'guziki-plastikowe-swiateczne-kolory', '', '', '', 'Guziki plastikowe – świąteczne kolory', '', '', '', ''),
(10432, 1, 2, '<p>Oto duża i piękna kolekcja plastikowych guzików w świątecznych kolorach. Otrzymasz czerwone, zielone i białe guziki, które mają średnicę 1, 2 lub 3 cm.\n</p><p>Wszystkie guziki mają 4 dziurki i płaski, okrągły kształt z krawędzią.</p><p>Mamy nadzieję, że te urocze guziki zainspirują Cię do rozkwitu Twojej świątecznej kreatywności!</p>', '', 'guziki-plastikowe-swiateczne-kolory', '', '', '', 'Guziki plastikowe – świąteczne kolory', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(10433, 1, 1, '<p>Bezpieczne oczy – zwane także oczkami amigurumi – do własnoręcznie wykonanych pluszowych misiów i figurek. Mogą być używane do projektów robionych na drutach, szydełkowanych lub szytych, a w Hobbii znajdziesz je w wielu rozmiarach.\n</p><p>Wszystkie zestawy zawierają plastikowe elementy zabezpieczające, które będą potrzebne podczas montażu oczu. ALE zawsze należy postępować zgodnie z naszą szczegółową instrukcją prawidłowego montażu! Na tej stronie znajdziesz przewodniki wideo, które dokładnie omawiają niezbędne wymagania montażowe, dzięki czemu Twoje własnoręcznie wykonane projekty dla dzieci w wieku 0-3 lat, spełnią te same wymagania dotyczące wytrzymałości i bezpieczeństwa, co gotowe zabawki!</p><p><strong>Wymagania bezpieczeństwa, z którymi należy się zapoznać przed założeniem bezpiecznych oczu:</strong></p><p>- Przed montażem należy sprawdzić, czy wszystkie części oka są nienaruszone i nieuszkodzone.</p><p>- Zalecamy roztopić tylną część po zamontowaniu oka. To proste i zajmuje tylko chwilę. Ta metoda gwarantuje, że zatyczka nigdy się nie poluzuje. Metoda często stosowana w przypadku zakupionych zabawek.</p><p>- Gęstość ściegu na drutach lub szydełku, a także rodzaj włóczki decydują o tym, jak bezpiecznie zamocowane jest oczko. Dlatego też, gdy gotowy projekt jest dla dzieci w wieku 0-3 lat, należy go zabezpieczyć wszywając siatkę pod zatyczką i zakładając wyszydełkowaną osłonę wokół tylnej części oka. Zobacz zdjęcia i film instruktażowy.</p><p>- Zawsze pamiętaj, aby sprawdzić ukończony produkt, upewniając się, że wszystkie części są solidnie, mocno i bezpiecznie zamontowane.</p><p>- Wykonuj regularne kontrole! Należy pamiętać, że wszystkie produkty z czasem ulegają zużyciu. Dlatego należy regularnie sprawdzać, czy oczy są nadal nienaruszone i porządnie zamocowane. Jako twórca domowych wyrobów dla dzieci w wieku 0-3 lat, Twoja praca wiąże się z dużą odpowiedzialnością.</p><p>Zalecamy dokładne zapoznanie się z niniejszą instrukcją. Szczegółowy przewodnik Go Handmade dotyczący bezpiecznego obchodzenia się i montażu projektów DIY z włóczki znajdziesz <a href=\"https://shop11802.sfstatic.io/upload_dir/docs/Sikkerhedsguide/PL_Guide_2024_3.pdf\"><strong>tutaj</strong></a>.</p><p><em>Psst.. Jeśli masz wątpliwości czy montaż jest bezpieczny, zalecamy wyhaftowanie oczu. To bezpieczne i piękne rozwiązanie, dla którego na tej stronie przygotowaliśmy także przewodnik wideo.</em></p>', '', 'oczka-zaciskowe-7-mm', '', '', '', 'Oczka zaciskowe - 7 mm', '', '', '', ''),
(10433, 1, 2, '<p>Bezpieczne oczy – zwane także oczkami amigurumi – do własnoręcznie wykonanych pluszowych misiów i figurek. Mogą być używane do projektów robionych na drutach, szydełkowanych lub szytych, a w Hobbii znajdziesz je w wielu rozmiarach.\n</p><p>Wszystkie zestawy zawierają plastikowe elementy zabezpieczające, które będą potrzebne podczas montażu oczu. ALE zawsze należy postępować zgodnie z naszą szczegółową instrukcją prawidłowego montażu! Na tej stronie znajdziesz przewodniki wideo, które dokładnie omawiają niezbędne wymagania montażowe, dzięki czemu Twoje własnoręcznie wykonane projekty dla dzieci w wieku 0-3 lat, spełnią te same wymagania dotyczące wytrzymałości i bezpieczeństwa, co gotowe zabawki!</p><p><strong>Wymagania bezpieczeństwa, z którymi należy się zapoznać przed założeniem bezpiecznych oczu:</strong></p><p>- Przed montażem należy sprawdzić, czy wszystkie części oka są nienaruszone i nieuszkodzone.</p><p>- Zalecamy roztopić tylną część po zamontowaniu oka. To proste i zajmuje tylko chwilę. Ta metoda gwarantuje, że zatyczka nigdy się nie poluzuje. Metoda często stosowana w przypadku zakupionych zabawek.</p><p>- Gęstość ściegu na drutach lub szydełku, a także rodzaj włóczki decydują o tym, jak bezpiecznie zamocowane jest oczko. Dlatego też, gdy gotowy projekt jest dla dzieci w wieku 0-3 lat, należy go zabezpieczyć wszywając siatkę pod zatyczką i zakładając wyszydełkowaną osłonę wokół tylnej części oka. Zobacz zdjęcia i film instruktażowy.</p><p>- Zawsze pamiętaj, aby sprawdzić ukończony produkt, upewniając się, że wszystkie części są solidnie, mocno i bezpiecznie zamontowane.</p><p>- Wykonuj regularne kontrole! Należy pamiętać, że wszystkie produkty z czasem ulegają zużyciu. Dlatego należy regularnie sprawdzać, czy oczy są nadal nienaruszone i porządnie zamocowane. Jako twórca domowych wyrobów dla dzieci w wieku 0-3 lat, Twoja praca wiąże się z dużą odpowiedzialnością.</p><p>Zalecamy dokładne zapoznanie się z niniejszą instrukcją. Szczegółowy przewodnik Go Handmade dotyczący bezpiecznego obchodzenia się i montażu projektów DIY z włóczki znajdziesz <a href=\"https://shop11802.sfstatic.io/upload_dir/docs/Sikkerhedsguide/PL_Guide_2024_3.pdf\"><strong>tutaj</strong></a>.</p><p><em>Psst.. Jeśli masz wątpliwości czy montaż jest bezpieczny, zalecamy wyhaftowanie oczu. To bezpieczne i piękne rozwiązanie, dla którego na tej stronie przygotowaliśmy także przewodnik wideo.</em></p>', '', 'oczka-zaciskowe-7-mm', '', '', '', 'Oczka zaciskowe - 7 mm', '', '', '', ''),
(10434, 1, 1, '<p>Dzięki tym drutom pomocniczym, wykonywanie fantazyjnych splotów-warkoczy nigdy nie było prostsze!</p><p>Druty trzymają solidnie oczka dopóki mają być one przerobione, co bardzo ułatwia pracę. Te mocne, aczkolwiek lekkie patyczki są bardzo poręczne, jako że ich końcówki bez problemu łapią te oczka, które potrzebujesz uchwycić.</p><p>W tym zestawie otrzymasz 3 patyczki po 3, 4 i 5 mm w różnych kolorach tak aby było je łatwo rozróżnić.</p>', '', 'druty-pomocnicze-warkoczowe', '', '', '', 'Druty pomocnicze/warkoczowe', '', '', '', ''),
(10434, 1, 2, '<p>Dzięki tym drutom pomocniczym, wykonywanie fantazyjnych splotów-warkoczy nigdy nie było prostsze!</p><p>Druty trzymają solidnie oczka dopóki mają być one przerobione, co bardzo ułatwia pracę. Te mocne, aczkolwiek lekkie patyczki są bardzo poręczne, jako że ich końcówki bez problemu łapią te oczka, które potrzebujesz uchwycić.</p><p>W tym zestawie otrzymasz 3 patyczki po 3, 4 i 5 mm w różnych kolorach tak aby było je łatwo rozróżnić.</p>', '', 'druty-pomocnicze-warkoczowe', '', '', '', 'Druty pomocnicze/warkoczowe', '', '', '', ''),
(10435, 1, 1, '<p>Bezpieczne oczy – zwane także oczkami amigurumi – do własnoręcznie wykonanych pluszowych misiów i figurek. Mogą być używane do projektów robionych na drutach, szydełkowanych lub szytych, a w Hobbii znajdziesz je w wielu rozmiarach.\n</p><p>Wszystkie zestawy zawierają plastikowe elementy zabezpieczające, które będą potrzebne podczas montażu oczu. ALE zawsze należy postępować zgodnie z naszą szczegółową instrukcją prawidłowego montażu! Na tej stronie znajdziesz przewodniki wideo, które dokładnie omawiają niezbędne wymagania montażowe, dzięki czemu Twoje własnoręcznie wykonane projekty dla dzieci w wieku 0-3 lat, spełnią te same wymagania dotyczące wytrzymałości i bezpieczeństwa, co gotowe zabawki!</p><p><strong>Wymagania bezpieczeństwa, z którymi należy się zapoznać przed założeniem bezpiecznych oczu:</strong></p><p>- Przed montażem należy sprawdzić, czy wszystkie części oka są nienaruszone i nieuszkodzone.</p><p>- Zalecamy roztopić tylną część po zamontowaniu oka. To proste i zajmuje tylko chwilę. Ta metoda gwarantuje, że zatyczka nigdy się nie poluzuje. Metoda często stosowana w przypadku zakupionych zabawek.</p><p>- Gęstość ściegu na drutach lub szydełku, a także rodzaj włóczki decydują o tym, jak bezpiecznie zamocowane jest oczko. Dlatego też, gdy gotowy projekt jest dla dzieci w wieku 0-3 lat, należy go zabezpieczyć wszywając siatkę pod zatyczką i zakładając wyszydełkowaną osłonę wokół tylnej części oka. Zobacz zdjęcia i film instruktażowy.</p><p>- Zawsze pamiętaj, aby sprawdzić ukończony produkt, upewniając się, że wszystkie części są solidnie, mocno i bezpiecznie zamontowane.</p><p>- Wykonuj regularne kontrole! Należy pamiętać, że wszystkie produkty z czasem ulegają zużyciu. Dlatego należy regularnie sprawdzać, czy oczy są nadal nienaruszone i porządnie zamocowane. Jako twórca domowych wyrobów dla dzieci w wieku 0-3 lat, Twoja praca wiąże się z dużą odpowiedzialnością.</p><p>Zalecamy dokładne zapoznanie się z niniejszą instrukcją. Szczegółowy przewodnik Go Handmade dotyczący bezpiecznego obchodzenia się i montażu projektów DIY z włóczki znajdziesz <a href=\"https://shop11802.sfstatic.io/upload_dir/docs/Sikkerhedsguide/PL_Guide_2024_3.pdf\"><strong>tutaj</strong></a>.</p><p><em>Psst.. Jeśli masz wątpliwości czy montaż jest bezpieczny, zalecamy wyhaftowanie oczu. To bezpieczne i piękne rozwiązanie, dla którego na tej stronie przygotowaliśmy także przewodnik wideo.</em></p>', '', 'oczka-zaciskowe-6-mm', '', '', '', 'Oczka zaciskowe - 6 mm', '', '', '', ''),
