przewodnik Go Handmade dotyczący bezpiecznego obchodzenia się i montażu projektów DIY z włóczki znajdziesz <a href=\"https://shop11802.sfstatic.io/upload_dir/docs/Sikkerhedsguide/PL_Guide_2024_3.pdf\"><strong>tutaj</strong></a>.</p><p><em>Psst.. Jeśli masz wątpliwości czy montaż jest bezpieczny, zalecamy wyhaftowanie oczu. To bezpieczne i piękne rozwiązanie, dla którego na tej stronie przygotowaliśmy także przewodnik wideo.</em></p>', '', 'oczka-zaciskowe-6-mm', '', '', '', 'Oczka zaciskowe - 6 mm', '', '', '', ''),
(10436, 1, 1, '<p>Każdy lubi dostawać ręcznie wykonane prezenty. A większość z nas uwielbia obdarowywać i sprawiać niespodzianki :-) Dzięki tym ładnym etykietom sprawisz, że Twoje prezenty będą wyjątkowe!</p><p>Zestaw etykiet na prezent zawiera cztery różne wzory, kolory i nadruki. Nie masz wątpliwości, że prezent to rękodzieło.\n</p>', '', 'etykiety-na-prezent', '', '', '', 'Etykiety na prezent', '', '', '', ''),
(10436, 1, 2, '<p>Każdy lubi dostawać ręcznie wykonane prezenty. A większość z nas uwielbia obdarowywać i sprawiać niespodzianki :-) Dzięki tym ładnym etykietom sprawisz, że Twoje prezenty będą wyjątkowe!</p><p>Zestaw etykiet na prezent zawiera cztery różne wzory, kolory i nadruki. Nie masz wątpliwości, że prezent to rękodzieło.\n</p>', '', 'etykiety-na-prezent', '', '', '', 'Etykiety na prezent', '', '', '', ''),
(10437, 1, 1, '<p>Zapięcie do szala to fantastyczny dodatek, którym podkręcisz swój projekt albo też i cały strój. Oprócz przytrzymywania chust, może służyć także w torebkach albo na włosach - jako ozdoba. Tylko Twoja fantazja wyznacza granice jego użycia. W zestawie otrzymujesz 2 zapięcia wykonane z metalu.</p>', '', 'zapiecie-do-szala', '', '', '', 'Zapięcie do szala', '', '', '', ''),
(10437, 1, 2, '<p>Zapięcie do szala to fantastyczny dodatek, którym podkręcisz swój projekt albo też i cały strój. Oprócz przytrzymywania chust, może służyć także w torebkach albo na włosach - jako ozdoba. Tylko Twoja fantazja wyznacza granice jego użycia. W zestawie otrzymujesz 2 zapięcia wykonane z metalu.</p>', '', 'zapiecie-do-szala', '', '', '', 'Zapięcie do szala', '', '', '', ''),
(10438, 1, 1, '<p>Cienka i przezroczysta nić, którą można wszyć w brzegi lub mankiety, lub w krawędzie szwów pończoszniczych, aby zapobiec zsuwaniu się krawędzi na siebie\n</p><p>Nić może być używana do wszystkich rodzajów włóczek - kolorów też.</p><p>Długość: 200 m</p><p>100% Poliamid</p><p>Można prać w 95°C</p>', '', 'elastyczna-nic-do-robienia-na-drutach-szydelkowania-200m', '', '', '', 'Elastyczna nić do robienia na drutach/szydełkowania – 200m', '', '', '', ''),
