(10440, 1, 1, '<p>Wyjątkowy zestaw BARDZO KRÓTKICH żyłek firmy KnitPro. Otrzymujesz dwie żyłki pasujące do bardzo krótkich, wymiennych drutów Denim firmy KnitPro, które są odpowiednie dla bardzo małych obwodów. Łącząc żyłki z krótkimi drutami Denim, masz możliwość uzyskania drutów o całkowitej długości 26 i 30 cm. Idealne do skarpet, ubranek dziecięcych itp. Link do drutów znajdziesz na tej stronie.\n</p><p>Żyłki są niebieskie, wytrzymałe i elastyczne, nie załamują się ani nie skręcają. Wykonane są z nylonu.</p><p><strong>Zestaw zawiera:</strong></p><ul><li><p>1 żyłka o dł. 13 cm (bez gwintu)</p></li><li><p>1 żyłka o dł. 17 cm (bez gwintu)</p></li><li><p>4 stopery</p></li><li><p>2 klucze</p></li></ul><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami KnitPro! Jednak te krótkie żyłki pasują tylko do drutów Denim KnitPro i nie są wystarczająco długie, aby pasowały do wszystkich innych wymiennych drutów.</p><p>Używasz małego klucza, aby upewnić się, że żyłki i druty są odpowiednio połączone. Włóż koniec klucza przez mały otwór w gwincie i mocno dokręć drut. Link do filmu znajdziesz na tej stronie.</p><p>Stoperów używasz, jeśli chcesz odłożyć robótkę. Druty wymieniasz na stopery, dzięki czemu robótka pozostaje na żyłce. Po prostu przykręcasz stopery do żyłki, w taki sam sposób jak druty.</p>', '', 'bardzo-krotkie-zylki-do-wymiennych-drutow', '', '', '', 'BARDZO Krótkie żyłki do Wymiennych Drutów', '', '', '', ''),
(10440, 1, 2, '<p>Wyjątkowy zestaw BARDZO KRÓTKICH żyłek firmy KnitPro. Otrzymujesz dwie żyłki pasujące do bardzo krótkich, wymiennych drutów Denim firmy KnitPro, które są odpowiednie dla bardzo małych obwodów. Łącząc żyłki z krótkimi drutami Denim, masz możliwość uzyskania drutów o całkowitej długości 26 i 30 cm. Idealne do skarpet, ubranek dziecięcych itp. Link do drutów znajdziesz na tej stronie.\n</p><p>Żyłki są niebieskie, wytrzymałe i elastyczne, nie załamują się ani nie skręcają. Wykonane są z nylonu.</p><p><strong>Zestaw zawiera:</strong></p><ul><li><p>1 żyłka o dł. 13 cm (bez gwintu)</p></li><li><p>1 żyłka o dł. 17 cm (bez gwintu)</p></li><li><p>4 stopery</p></li><li><p>2 klucze</p></li></ul><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami KnitPro! Jednak te krótkie żyłki pasują tylko do drutów Denim KnitPro i nie są wystarczająco długie, aby pasowały do wszystkich innych wymiennych drutów.</p><p>Używasz małego klucza, aby upewnić się, że żyłki i druty są odpowiednio połączone. Włóż koniec klucza przez mały otwór w gwincie i mocno dokręć drut. Link do filmu znajdziesz na tej stronie.</p><p>Stoperów używasz, jeśli chcesz odłożyć robótkę. Druty wymieniasz na stopery, dzięki czemu robótka pozostaje na żyłce. Po prostu przykręcasz stopery do żyłki, w taki sam sposób jak druty.</p>', '', 'bardzo-krotkie-zylki-do-wymiennych-drutow', '', '', '', 'BARDZO Krótkie żyłki do Wymiennych Drutów', '', '', '', ''),
(10441, 1, 1, '<p>Oto zabawny i kolorowy świąteczny zestaw z czterema znacznikami ściegów. Urocze motywy w zielonym, czerwonym i białym kolorze z pewnością wprawią cię w świąteczny nastrój, gdy będziesz dziergać na drutach lub szydełkować!\n</p><p>Użyj ich, aby zaznaczyć, gdzie należy odjąć i dodać oczka, gdzie zaczyna się i kończy nowy wzór lub po prostu oznacz początek okrążenia. Znaczniki są zamykane dzięki czemu możesz oznaczyć konkretne oczko i przesunąć znacznik w razie potrzeby.</p><p>Znaczniki ściegów składają się z haczyka z zawieszką i obie części wykonane są z metalu w złotym kolorze. Znaczniki pasują na druty do 8 mm.</p><p>Naprawdę nie chcesz przegapić tych uroczych świątecznych znaczników! W opakowaniu znajduje się choinka, ludzik z ciasta, płatek śniegu i Święty Mikołaj.</p><p>Długość zawieszki: 1,5 - 2 cm</p>', '', 'swiateczne-znaczniki-sciegow-snowflake', '', '', '', 'Świąteczne znaczniki ściegów - Snowflake', '', '', '', ''),
(10441, 1, 2, '<p>Oto zabawny i kolorowy świąteczny zestaw z czterema znacznikami ściegów. Urocze motywy w zielonym, czerwonym i białym kolorze z pewnością wprawią cię w świąteczny nastrój, gdy będziesz dziergać na drutach lub szydełkować!\n</p><p>Użyj ich, aby zaznaczyć, gdzie należy odjąć i dodać oczka, gdzie zaczyna się i kończy nowy wzór lub po prostu oznacz początek okrążenia. Znaczniki są zamykane dzięki czemu możesz oznaczyć konkretne oczko i przesunąć znacznik w razie potrzeby.</p><p>Znaczniki ściegów składają się z haczyka z zawieszką i obie części wykonane są z metalu w złotym kolorze. Znaczniki pasują na druty do 8 mm.</p><p>Naprawdę nie chcesz przegapić tych uroczych świątecznych znaczników! W opakowaniu znajduje się choinka, ludzik z ciasta, płatek śniegu i Święty Mikołaj.</p><p>Długość zawieszki: 1,5 - 2 cm</p>', '', 'swiateczne-znaczniki-sciegow-snowflake', '', '', '', 'Świąteczne znaczniki ściegów - Snowflake', '', '', '', ''),
(10442, 1, 1, '<p>Ta wspaniała kolekcja drewnianych guzików to pozycja obowiązkowa dla miłośników świąt Bożego Narodzenia i projektów bożonarodzeniowych.\n</p><p>W tym opakowaniu otrzymasz 36 guzików w 4 pięknych świątecznych motywach.</p><p>Nadają się do większości projektów dzięki średnicy 18 mm. Mają płaski, okrągły kształt i dwie dziurki.</p>', '', 'drewniane-guziki-swiateczne-18-mm', '', '', '', 'Drewniane Guziki – Świąteczne - 18 mm', '', '', '', ''),
(10442, 1, 2, '<p>Ta wspaniała kolekcja drewnianych guzików to pozycja obowiązkowa dla miłośników świąt Bożego Narodzenia i projektów bożonarodzeniowych.\n</p><p>W tym opakowaniu otrzymasz 36 guzików w 4 pięknych świątecznych motywach.</p><p>Nadają się do większości projektów dzięki średnicy 18 mm. Mają płaski, okrągły kształt i dwie dziurki.</p>', '', 'drewniane-guziki-swiateczne-18-mm', '', '', '', 'Drewniane Guziki – Świąteczne - 18 mm', '', '', '', ''),
(10443, 1, 1, '<p>Praktyczny zestaw żyłek ze stali nierdzewnej z obrotowym złączem 360°. Swivel żyłki firmy KnitPro są wysokiej jakości, wytrzymałe i elastyczne. Zakończone gwintem zapewniającym gładkie i płynne połączenie z drutami, a obrót o 360 stopni znacznie ułatwia pracę.</p><p>Dostępne w turkusowym kolorze, dzięki czemu idealnie pasują do Kolekcji Mindfull firmy KnitPro. Stalowe żyłki mają cienką i gładką powłokę, bez efektu „pamięci”, co oznacza, że nie skręcają się i za każdym razem łatwo rozprostowują.</p><p><strong>W zestawie znajduje się:</strong>\n</p><ul><li><p>1 żyłka</p></li><li><p>2 stopery</p></li><li><p>1 klucz ułatwiający przykręcenie</p></li></ul><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami firmy KnitPro!</p><p>Metalowy kluczyk służy do dokręcenia żyłki z drutami, aby druty nie odkręciły się podczas pracy. Włóż końcówkę klucza przez mały otwór w gwincie i mocno dokręć drut, trzymając klucz w miejscu. Na tej stronie znajdziesz link do filmu.</p><p>Stopery w tym zestawie to delikatne półkule z kwiatowym motywem, których używasz, jeśli chcesz odłożyć robótkę na jakiś czas. Jeśli potrzebujesz drutów możesz wykorzystać stopery i przykręcić je do żyłki. W ten sposób robótka pozostanie na żyłce, a ty możesz użyć drutów do innego projektu. Stopery przykręcasz do żyłki w taki sam sposób jak druty.</p><p><strong>Pssst! Zwróć uwagę, że podana długość to całkowita długość żyłki z drutami:</strong>\n</p><p></p><p>40 cm: żyłka ma 20 cm długości bez drutów\n50 cm: żyłka ma 28 cm długości bez drutów\n60 cm: żyłka ma 35 cm długości bez drutów\n80 cm: żyłka ma 56 cm długości bez drutów\n100 cm: żyłka ma 76 cm długości bez drutów</p>', '', 'swivel-zylki-do-wymiennych-drutow-teal', '', '', '', 'Swivel Żyłki do wymiennych drutów - Teal', '', '', '', ''),
(10443, 1, 2, '<p>Praktyczny zestaw żyłek ze stali nierdzewnej z obrotowym złączem 360°. Swivel żyłki firmy KnitPro są wysokiej jakości, wytrzymałe i elastyczne. Zakończone gwintem zapewniającym gładkie i płynne połączenie z drutami, a obrót o 360 stopni znacznie ułatwia pracę.</p><p>Dostępne w turkusowym kolorze, dzięki czemu idealnie pasują do Kolekcji Mindfull firmy KnitPro. Stalowe żyłki mają cienką i gładką powłokę, bez efektu „pamięci”, co oznacza, że nie skręcają się i za każdym razem łatwo rozprostowują.</p><p><strong>W zestawie znajduje się:</strong>\n</p><ul><li><p>1 żyłka</p></li><li><p>2 stopery</p></li><li><p>1 klucz ułatwiający przykręcenie</p></li></ul><p>Wszystkie części są kompatybilne ze wszystkimi wymiennymi drutami/szydełkami firmy KnitPro!</p><p>Metalowy kluczyk służy do dokręcenia żyłki z drutami, aby druty nie odkręciły się podczas pracy. Włóż końcówkę klucza przez mały otwór w gwincie i mocno dokręć drut, trzymając klucz w miejscu. Na tej stronie znajdziesz link do filmu.</p><p>Stopery w tym zestawie to delikatne półkule z kwiatowym motywem, których używasz, jeśli chcesz odłożyć robótkę na jakiś czas. Jeśli potrzebujesz drutów możesz wykorzystać stopery i przykręcić je do żyłki. W ten sposób robótka pozostanie na żyłce, a ty możesz użyć drutów do innego projektu. Stopery przykręcasz do żyłki w taki sam sposób jak druty.</p><p><strong>Pssst! Zwróć uwagę, że podana długość to całkowita długość żyłki z drutami:</strong>\n</p><p></p><p>40 cm: żyłka ma 20 cm długości bez drutów\n50 cm: żyłka ma 28 cm długości bez drutów\n60 cm: żyłka ma 35 cm długości bez drutów\n80 cm: żyłka ma 56 cm długości bez drutów\n100 cm: żyłka ma 76 cm długości bez drutów</p>', '', 'swivel-zylki-do-wymiennych-drutow-teal', '', '', '', 'Swivel Żyłki do wymiennych drutów - Teal', '', '', '', ''),
(10444, 1, 1, '<p>Linijka w charakterystycznym kolorze Hobbii ze szkłem powiększającym, które ułatwia odczytywanie drobnego druku. Dzięki wyraźnemu i czytelnemu obrazowi czytanie wzorów staje się dużo łatwiejsze. Linijka sprawi, że już nigdy nie zgubisz się w wierszach tekstu.</p><p>Jej wszechstronne i uniwersalne wykorzystanie sprawia, że to produkt bardzo przydatny w codziennym życiu. Lupa do czytania i linijka do mierzenia, która może mierzyć do 15 cm lub 6 cali.</p>', '', 'linijka-z-lupa', '', '', '', 'Linijka z Lupą', '', '', '', ''),
(10444, 1, 2, '<p>Linijka w charakterystycznym kolorze Hobbii ze szkłem powiększającym, które ułatwia odczytywanie drobnego druku. Dzięki wyraźnemu i czytelnemu obrazowi czytanie wzorów staje się dużo łatwiejsze. Linijka sprawi, że już nigdy nie zgubisz się w wierszach tekstu.</p><p>Jej wszechstronne i uniwersalne wykorzystanie sprawia, że to produkt bardzo przydatny w codziennym życiu. Lupa do czytania i linijka do mierzenia, która może mierzyć do 15 cm lub 6 cali.</p>', '', 'linijka-z-lupa', '', '', '', 'Linijka z Lupą', '', '', '', ''),
(10445, 1, 1, '<p>Bezpieczne oczy – zwane także oczkami amigurumi – do własnoręcznie wykonanych pluszowych misiów i figurek. Mogą być używane do projektów robionych na drutach, szydełkowanych lub szytych, a w Hobbii znajdziesz je w wielu rozmiarach.\n</p><p>Wszystkie zestawy zawierają plastikowe elementy zabezpieczające, które będą potrzebne podczas montażu oczu. ALE zawsze należy postępować zgodnie z naszą szczegółową instrukcją prawidłowego montażu! Na tej stronie znajdziesz przewodniki wideo, które dokładnie omawiają niezbędne wymagania montażowe, dzięki czemu Twoje własnoręcznie wykonane projekty dla dzieci w wieku 0-3 lat, spełnią te same wymagania dotyczące wytrzymałości i bezpieczeństwa, co gotowe zabawki!</p><p><strong>Wymagania bezpieczeństwa, z którymi należy się zapoznać przed założeniem bezpiecznych oczu:</strong></p><p>- Przed montażem należy sprawdzić, czy wszystkie części oka są nienaruszone i nieuszkodzone.</p><p>- Zalecamy roztopić tylną część po zamontowaniu oka. To proste i zajmuje tylko chwilę. Ta metoda gwarantuje, że zatyczka nigdy się nie poluzuje. Metoda często stosowana w przypadku zakupionych zabawek.</p><p>- Gęstość ściegu na drutach lub szydełku, a także rodzaj włóczki decydują o tym, jak bezpiecznie zamocowane jest oczko. Dlatego też, gdy gotowy projekt jest dla dzieci w wieku 0-3 lat, należy go zabezpieczyć wszywając siatkę pod zatyczką i zakładając wyszydełkowaną osłonę wokół tylnej części oka. Zobacz zdjęcia i film instruktażowy.</p><p>- Zawsze pamiętaj, aby sprawdzić ukończony produkt, upewniając się, że wszystkie części są solidnie, mocno i bezpiecznie zamontowane.</p><p>- Wykonuj regularne kontrole! Należy pamiętać, że wszystkie produkty z czasem ulegają zużyciu. Dlatego należy regularnie sprawdzać, czy oczy są nadal nienaruszone i porządnie zamocowane. Jako twórca domowych wyrobów dla dzieci w wieku 0-3 lat, Twoja praca wiąże się z dużą odpowiedzialnością.</p><p>Zalecamy dokładne zapoznanie się z niniejszą instrukcją. Szczegółowy przewodnik Go Handmade dotyczący bezpiecznego obchodzenia się i montażu projektów DIY z włóczki znajdziesz <a href=\"https://shop11802.sfstatic.io/upload_dir/docs/Sikkerhedsguide/PL_Guide_2024_3.pdf\"><strong>tutaj</strong></a>.</p><p><em>Psst.. Jeśli masz wątpliwości czy montaż jest bezpieczny, zalecamy wyhaftowanie oczu. To bezpieczne i piękne rozwiązanie, dla którego na tej stronie przygotowaliśmy także przewodnik wideo.</em></p>', '', 'oczka-zaciskowe-8-mm', '', '', '', 'Oczka zaciskowe - 8 mm', '', '', '', ''),
(10445, 1, 2, '<p>Bezpieczne oczy – zwane także oczkami amigurumi – do własnoręcznie wykonanych pluszowych misiów i figurek. Mogą być używane do projektów robionych na drutach, szydełkowanych lub szytych, a w Hobbii znajdziesz je w wielu rozmiarach.\n</p><p>Wszystkie zestawy zawierają plastikowe elementy zabezpieczające, które będą potrzebne podczas montażu oczu. ALE zawsze należy postępować zgodnie z naszą szczegółową instrukcją prawidłowego montażu! Na tej stronie znajdziesz przewodniki wideo, które dokładnie omawiają niezbędne wymagania montażowe, dzięki czemu Twoje własnoręcznie wykonane projekty dla dzieci w wieku 0-3 lat, spełnią te same wymagania dotyczące wytrzymałości i bezpieczeństwa, co gotowe zabawki!</p><p><strong>Wymagania bezpieczeństwa, z którymi należy się zapoznać przed założeniem bezpiecznych oczu:</strong></p><p>- Przed montażem należy sprawdzić, czy wszystkie części oka są nienaruszone i nieuszkodzone.</p><p>- Zalecamy roztopić tylną część po zamontowaniu oka. To proste i zajmuje tylko chwilę. Ta metoda gwarantuje, że zatyczka nigdy się nie poluzuje. Metoda często stosowana w przypadku zakupionych zabawek.</p><p>- Gęstość ściegu na drutach lub szydełku, a także rodzaj włóczki decydują o tym, jak bezpiecznie zamocowane jest oczko. Dlatego też, gdy gotowy projekt jest dla dzieci w wieku 0-3 lat, należy go zabezpieczyć wszywając siatkę pod zatyczką i zakładając wyszydełkowaną osłonę wokół tylnej części oka. Zobacz zdjęcia i film instruktażowy.</p><p>- Zawsze pamiętaj, aby sprawdzić ukończony produkt, upewniając się, że wszystkie części są solidnie, mocno i bezpiecznie zamontowane.</p><p>- Wykonuj regularne kontrole! Należy pamiętać, że wszystkie produkty z czasem ulegają zużyciu. Dlatego należy regularnie sprawdzać, czy oczy są nadal nienaruszone i porządnie zamocowane. Jako twórca domowych wyrobów dla dzieci w wieku 0-3 lat, Twoja praca wiąże się z dużą odpowiedzialnością.</p><p>Zalecamy dokładne zapoznanie się z niniejszą instrukcją. Szczegółowy przewodnik Go Handmade dotyczący bezpiecznego obchodzenia się i montażu projektów DIY z włóczki znajdziesz <a href=\"https://shop11802.sfstatic.io/upload_dir/docs/Sikkerhedsguide/PL_Guide_2024_3.pdf\"><strong>tutaj</strong></a>.</p><p><em>Psst.. Jeśli masz wątpliwości czy montaż jest bezpieczny, zalecamy wyhaftowanie oczu. To bezpieczne i piękne rozwiązanie, dla którego na tej stronie przygotowaliśmy także przewodnik wideo.</em></p>', '', 'oczka-zaciskowe-8-mm', '', '', '', 'Oczka zaciskowe - 8 mm', '', '', '', ''),
(10446, 1, 1, '<p>Dzięki tym ruchomym połączeniom możesz sprawić, że nogi, ręce i uszy w ręcznie zrobionych zabawkach będą ruchome. Wyszydełkuj lub zrób na drutach poszczególne części ciała a następnie złącz je ze sobą za pomocą tych złączy. Działa to na tej samej zasadzie co oczka zaciskowe, z tą różnicą, że łączysz tutaj ze sobą dwie odrębne części ciała.\n\nAby połączyć nogę z ciałem należy przełożyć wydłużoną część przez oczka nogi a następnie przez oczka w korpusie i założyć płaski krążek od wewnątrz.\n\nZobacz filmy, które pokazują, jak zapewnić bezpieczne montowanie. Przed użyciem zabawki zawsze sprawdź, czy połączenia są prawidłowo zamocowane.\n\nRuchome połączenia są dostępne w kilku rozmiarach, dzięki czemu możesz dobrać odpowiedni rozmiar do zabawki.\n\nIlość: 8 złączy w opakowaniu\n\n<em>Produkt został przetestowany na zawartość substancji nieszkodliwych (Certyfikat EN71-3).</em>\n</p>', '', 'ruchome-polaczenia-do-amigurumi', '', '', '', 'Ruchome połączenia do Amigurumi', '', '', '', ''),
(10446, 1, 2, '<p>Dzięki tym ruchomym połączeniom możesz sprawić, że nogi, ręce i uszy w ręcznie zrobionych zabawkach będą ruchome. Wyszydełkuj lub zrób na drutach poszczególne części ciała a następnie złącz je ze sobą za pomocą tych złączy. Działa to na tej samej zasadzie co oczka zaciskowe, z tą różnicą, że łączysz tutaj ze sobą dwie odrębne części ciała.\n\nAby połączyć nogę z ciałem należy przełożyć wydłużoną część przez oczka nogi a następnie przez oczka w korpusie i założyć płaski krążek od wewnątrz.\n\nZobacz filmy, które pokazują, jak zapewnić bezpieczne montowanie. Przed użyciem zabawki zawsze sprawdź, czy połączenia są prawidłowo zamocowane.\n\nRuchome połączenia są dostępne w kilku rozmiarach, dzięki czemu możesz dobrać odpowiedni rozmiar do zabawki.\n\nIlość: 8 złączy w opakowaniu\n\n<em>Produkt został przetestowany na zawartość substancji nieszkodliwych (Certyfikat EN71-3).</em>\n</p>', '', 'ruchome-polaczenia-do-amigurumi', '', '', '', 'Ruchome połączenia do Amigurumi', '', '', '', ''),
(10447, 1, 1, '<p>Praktyczna kwadratowa miarka z funkcją zwijania.\n</p><p>Nic nie powinno pozostać niezauważone, więc oczywiście otrzymujesz tę praktyczną taśmę mierniczą w ładnym różowym kolorze. Taśma ma długość 150 cm i za każdym razem zapewnia precyzyjny wynik pomiaru. Z jednej strony znajduje się podziałka centymetrowa, a z drugiej calowa. Na górze znajduje się praktyczny uchwyt.</p><p>Taśmę łatwo można zwinąć, gdy nie jest używana, naciskając przycisk na środku.</p>', '', 'zwijana-miarka-krawiecka', '', '', '', 'Zwijana Miarka Krawiecka', '', '', '', ''),
(10447, 1, 2, '<p>Praktyczna kwadratowa miarka z funkcją zwijania.\n</p><p>Nic nie powinno pozostać niezauważone, więc oczywiście otrzymujesz tę praktyczną taśmę mierniczą w ładnym różowym kolorze. Taśma ma długość 150 cm i za każdym razem zapewnia precyzyjny wynik pomiaru. Z jednej strony znajduje się podziałka centymetrowa, a z drugiej calowa. Na górze znajduje się praktyczny uchwyt.</p><p>Taśmę łatwo można zwinąć, gdy nie jest używana, naciskając przycisk na środku.</p>', '', 'zwijana-miarka-krawiecka', '', '', '', 'Zwijana Miarka Krawiecka', '', '', '', ''),
(10448, 1, 1, '<p>Bezpieczne oczy – zwane także oczkami amigurumi – do własnoręcznie wykonanych pluszowych misiów i figurek. Mogą być używane do projektów robionych na drutach, szydełkowanych lub szytych, a w Hobbii znajdziesz je w wielu rozmiarach.\n</p><p>Wszystkie zestawy zawierają plastikowe elementy zabezpieczające, które będą potrzebne podczas montażu oczu. ALE zawsze należy postępować zgodnie z naszą szczegółową instrukcją prawidłowego montażu! Na tej stronie znajdziesz przewodniki wideo, które dokładnie omawiają niezbędne wymagania montażowe, dzięki czemu Twoje własnoręcznie wykonane projekty dla dzieci w wieku 0-3 lat, spełnią te same wymagania dotyczące wytrzymałości i bezpieczeństwa, co gotowe zabawki!</p><p><strong>Wymagania bezpieczeństwa, z którymi należy się zapoznać przed założeniem bezpiecznych oczu:</strong></p><p>- Przed montażem należy sprawdzić, czy wszystkie części oka są nienaruszone i nieuszkodzone.</p><p>- Zalecamy roztopić tylną część po zamontowaniu oka. To proste i zajmuje tylko chwilę. Ta metoda gwarantuje, że zatyczka nigdy się nie poluzuje. Metoda często stosowana w przypadku zakupionych zabawek.</p><p>- Gęstość ściegu na drutach lub szydełku, a także rodzaj włóczki decydują o tym, jak bezpiecznie zamocowane jest oczko. Dlatego też, gdy gotowy projekt jest dla dzieci w wieku 0-3 lat, należy go zabezpieczyć wszywając siatkę pod zatyczką i zakładając wyszydełkowaną osłonę wokół tylnej części oka. Zobacz zdjęcia i film instruktażowy.</p><p>- Zawsze pamiętaj, aby sprawdzić ukończony produkt, upewniając się, że wszystkie części są solidnie, mocno i bezpiecznie zamontowane.</p><p>- Wykonuj regularne kontrole! Należy pamiętać, że wszystkie produkty z czasem ulegają zużyciu. Dlatego należy regularnie sprawdzać, czy oczy są nadal nienaruszone i porządnie zamocowane. Jako twórca domowych wyrobów dla dzieci w wieku 0-3 lat, Twoja praca wiąże się z dużą odpowiedzialnością.</p><p>Zalecamy dokładne zapoznanie się z niniejszą instrukcją. Szczegółowy przewodnik Go Handmade dotyczący bezpiecznego obchodzenia się i montażu projektów DIY z włóczki znajdziesz <a href=\"https://shop11802.sfstatic.io/upload_dir/docs/Sikkerhedsguide/PL_Guide_2024_3.pdf\"><strong>tutaj</strong></a>.</p><p><em>Psst.. Jeśli masz wątpliwości czy montaż jest bezpieczny, zalecamy wyhaftowanie oczu. To bezpieczne i piękne rozwiązanie, dla którego na tej stronie przygotowaliśmy także przewodnik wideo.</em></p>', '', 'oczka-zaciskowe-10-mm', '', '', '', 'Oczka zaciskowe - 10 mm', '', '', '', ''),
