(10450, 1, 1, '<p>Elegancki kosz z filcu do przechowywania z dwoma przegródkami. Przegrody są mocowane na rzepy i można je zdjąć, dzięki czemu możesz stworzyć dwa pojemniki lub zadowolić się jednym dużym.\n</p><p>Ty wybierasz, jaki cel koszyk może spełnić dla Ciebie i Twoich projektów. Uważamy, że jest genialny z kilku powodów:</p><p>- do przechowywania włóczek i akcesoriów, aby zawsze były łatwo dostępne, gdy jesteś w domu</p><p>- aby Twoje różne projekty były od siebie oddzielone</p><p>- aby trzymać motki oddzielnie, jeśli dziergasz kilkoma motkami/kolorami</p><p>- jako detal dekoracyjny wypełniony włóczką</p>', '', 'kosz-filcowy', '', '', '', 'Kosz filcowy', '', '', '', ''),
(10450, 1, 2, '<p>Elegancki kosz z filcu do przechowywania z dwoma przegródkami. Przegrody są mocowane na rzepy i można je zdjąć, dzięki czemu możesz stworzyć dwa pojemniki lub zadowolić się jednym dużym.\n</p><p>Ty wybierasz, jaki cel koszyk może spełnić dla Ciebie i Twoich projektów. Uważamy, że jest genialny z kilku powodów:</p><p>- do przechowywania włóczek i akcesoriów, aby zawsze były łatwo dostępne, gdy jesteś w domu</p><p>- aby Twoje różne projekty były od siebie oddzielone</p><p>- aby trzymać motki oddzielnie, jeśli dziergasz kilkoma motkami/kolorami</p><p>- jako detal dekoracyjny wypełniony włóczką</p>', '', 'kosz-filcowy', '', '', '', 'Kosz filcowy', '', '', '', ''),
(10451, 1, 1, '<p>Igły do wełny charakteryzują się dużymi oczkami, które ułatwiają szycie, dzięki czemu są idealne do szydełkowania lub wykonywania na drutach luźnych oczek. Gładka powierzchnia aluminium sprawia, że igłami bardzo łatwo się operuje niezależnie od tego z jaką włóczką pracujesz.\n</p><p>W paczce otrzymasz 3 igły w rozmiarach 2.25 mm, 2.75 mm oraz 3.25 mm w kolorze niebieskim, czerwonym i pomarańczowym.</p><p>Długość igieł do wełny: 7,4 cm - 8,5 cm - 10 cm\n</p>', '', 'aluminiowe-igly-do-welny', '', '', '', 'Aluminiowe igły do wełny', '', '', '', '');
